('Energy infrastructure', '', 2, 8, 'when will petroleum disappear\r\nfrom our energy maps?', 'In 2003 the US accounted\r\nfor over 25% of global oil\r\nconsumption.\r\nIceland plans to become\r\nthe world’s first all-hydrogen\r\neconomy by 2030.', 'In 2004 fuel cells began to replace batteries in\r\nsome portable electronic devices. It is predicted\r\nthat hydrogen will start being used as a back-up\r\npower source in remote locations, and in\r\nindustrial and large commercial buildings over\r\nthe next two to three years. By 2008, hydrogen\r\ncould power specialized fleets of vehicles such\r\nas buses. By 2015, hydrogen-fuelled cars might\r\nbe available on the mass market.\r\nThe benefits of fuel cells include: reduction in air\r\npollution, decrease of oil impact and consumption,\r\nreduction in trade deficit, and production of new\r\njobs. Iceland is on the brink of becoming the\r\nworld’s first all-hydrogen economy; two-thirds of\r\nits power already comes from either geothermal\r\nor hydro-electric sources.', NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 99, 1212410203, 1220520248, 50, 50, 664),
('African internet backbone', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 100, 1212410203, 1220520248, 51, 51, 664),
('Media Attention to African Scientific ', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 101, 1212410203, 1220520248, 52, 52, 664),
('Connected communities', '', 2, 8, 'how will this new medium\r\nempower people?', 'The internet provides an\r\nunparalleled medium for sharing.', 'Connectivity technologies are reaching and\r\ninfluencing people’s lives and behaviours\r\nmore rapidly than any previous technology.\r\nThe internet has had an adoption time of six\r\nyears compared to the motorized vehicle,\r\nwhich took us 55 years to accept. Its impact\r\ncrosses social, cultural, and geographic\r\nboundaries, ranging from authoritarian\r\nregimes and less developed nations to social\r\nactivists using SMS ‘smart mobbing’, and the\r\nweb for social actions and charities. The\r\nconnectivity is manifesting itself in modified\r\nmethods of working, expanded asynchronous\r\ncommunities, and a new vocabulary. This is\r\njust the beginning.', NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 102, 1212410203, 1220520248, 53, 53, 664),
('Public information access', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 103, 1212410203, 1220520248, 54, 54, 664),
