('Endangered species', '', 3, 8, 'how can revenue be generated\r\nto ensure a future for\r\nendangered environments?', 'Two-thirds of threatened\r\nspecies and habitats\r\nare in countries that do\r\nnot have the resources\r\nto protect them.', 'Protecting vital habitats is the first step toward\r\nsaving wildlife. By combining habitat protection\r\nand anti-poaching initiatives with ongoing efforts\r\nto fight illegal trade, WWF hopes to give animals\r\na viable hold on the future. The United Nations\r\nEnvironment Programme (UNEP)/world monitoring\r\ncentre has several strategies for conservation.\r\nOne objective is to analyze the state of global\r\nbiodiversity, assess trends, and provide early\r\nwarning of emerging threats in support of\r\ninternational co-operation and action. Another is to\r\ndevelop and implement international agreements\r\nand programmes that promote conservation of\r\nbiodiversity. Furthermore, an objective is to provide\r\nexpertise, tools, techniques, and information for\r\npublic awareness and education.\r\nThe index in Fig 1 shows a decline of about 30%\r\nbetween 1970 and 2000 in 555 species of\r\nmammals, birds and reptiles living in terrestrial\r\necosystems. The index in Fig 2 shows a decline\r\nin freshwater species of approximately 50% from\r\n1970 to 2000 in 323 vertebrate species found in\r\nrivers, lakes and wetland ecosystems. The marine\r\nspecies index (Fig 3) shows a decline of about\r\n30% from 1970 to 2000 in 267 species of\r\nmammals, birds, reptiles, and fish occurring in\r\nthe world’s ocean and coastal ecosystems.', NULL, NULL, NULL, 31, NULL, 'issue', 'active', NULL, 108, 1212410203, 1220520248, 59, 59, 664),
('Waste management', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 32, NULL, 'issue', 'active', NULL, 109, 1212410203, 1220520248, 60, 60, 664),
('Travel and mobility pressures', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 32, NULL, 'issue', 'active', NULL, 110, 1212410203, 1220520248, 61, 61, 664),
('Deforestation', '', 3, 4, 'how important are trees?', '“In the next 24 hours, deforestation will release\r\nas much CO2 into the atmosphere as 8 million\r\npeople fl ying from London to New York.”\r\nSource: Daniel Howden, Deforestation: the hidden cause of\r\nglobal warming, The Independent, 14 May 2007\r\nwww.commondreams.org/archive/2007/05/14/1175/', 'Over the last few hundred years, human beings have\r\ncleared forests on a massive scale to make way for\r\nagriculture. When forests are cleared, the trees are burnt,\r\nconstituting emissions of new CO2 to the atmosphere.\r\nAny new trees or plants planted will reabsorb some of\r\nthis CO2, but will take decades or longer to sequester the\r\ncarbon originally held in the lost biomass.\r\nAlmost 20% (8 GtCO2/year) of current anthropogenic\r\ngreenhouse gas emissions are from deforestation.\r\nDeforestation emissions are highly concentrated in just a\r\nfew countries with 50% accounted for by Indonesia and\r\nBrazil alone. The main causes are the economic drivers of\r\ninternational agri-business, for example, the demand for\r\npalm oil, which is used extensively in food and cosmetics.\r\nSince 1800, around one third of total carbon emissions\r\nhave been from land-use changes, in particular\r\ndeforestation (Fig 1). This places an upper bound\r\non the level of carbon sequestration that could be\r\nachieved if all the forests cleared over that period could\r\nbe re-established. Curbing new deforestation, on the\r\nother hand, is a highly cost-effective way of reducing\r\ngreenhouse gas emissions and has the potential to offer\r\nsignifi cant reductions fairly quickly. It also helps preserve\r\nbiodiversity and protect soil and water quality.', NULL, '9.jpg', '9back.jpg', 32, NULL, 'issue', 'active', NULL, 111, 1212410203, 1220520248, 62, 62, 664),
('Climate Change', '', 3, 6, 'if cancer doesn’t kill you,\r\nwill warmer weather?', 'In the summer of 2003 the heatwave\r\nin Europe left over 30 000 dead from\r\nheat stress.\r\nSource: UNEP, Impacts of summer 2003 heatwave\r\nin Europe, March 2004', 'An increase in global average temperatures is being linked\r\nto an increase in the severity and frequency of extreme\r\nheatwaves and the morbidity and mortality attributable to\r\nthese events. Research has concluded that an increase in\r\ntemperatures would result in a net increase in\r\ntemperature-related morbidity and mortality. Any\r\nameliorating impact of increasing temperature on winter\r\nmortality rates would not be great enough to offset the\r\nprojected increase in mortality attributed to heat events.\r\nBy 2100, projections suggest that in the US there\r\nwill be approximately 100M more citizens 65 years of\r\nage than in 2000. As a result, the combined share of the\r\npopulation that will be composed of the very young and\r\nolder adults is projected to increase from about 15% to\r\n25%. This anticipated increase suggests, all else equal,\r\nthat the US population will become more vulnerable to\r\nthe health impacts of climate change. In addition, poverty\r\nexacerbates vulnerability to climate-sensitive health\r\nproblems directly by reducing the capacity to adapt to\r\nchanging conditions.', NULL, '35.jpg', NULL, 31, NULL, 'issue', 'active', NULL, 112, 1212410203, 1220520248, 63, 63, 664),
