('Food Security', '', 3, 11, 'how do you feed\r\nyour family?', 'Of Africa’s poor, 70% live\r\nin rural areas and depend\r\non agriculture for food\r\nand a livelihood.\r\nSource: Rural Poverty Portal\r\nwww.ruralpovertyportal.org/\r\nenglish/regions/africa/index.htm', 'The Food and Agriculture Organization (FAO) describes\r\nfood security as when all people, at all times, have access\r\nto suffi cient, safe and nutritious food to meet their dietary\r\nneeds and food preferences for an active and healthy life.\r\nBetween 2001 and 2003, FAO estimated that there were\r\n854M undernourished people worldwide. At the same\r\ntime there were more than 1bn overweight adults with at\r\nleast 300M of them obese.\r\nFactors infl uencing food security include the diversion\r\nof land use to non-food uses, for example, biofuels\r\nand other export-oriented crops. These crops are often\r\nintensively grown using signifi cant application of fertilisers\r\nand pesticides. This, coupled with a mono-crop system,\r\nresults in soil erosion and the loss of biodiversity. In some\r\ncountries the best lands have been used for growing\r\ncash crops leaving marginal lands for growing food.\r\nDeforestation - currently at 20 000 hectares per day - is\r\nbeing driven by factors including changing diets resulting\r\nin an increase in demand for meat-based products and\r\nfor biofuels. The 2008 Gallagher review of biofuels for the\r\nUK government called for a slowdown in the growth of\r\nbiofuels and for policy to be directed at preventing the\r\ndiversion of land for the growing of food to the growing of\r\nbiofuel crops.', NULL, NULL, NULL, 31, NULL, 'issue', 'active', NULL, 134, 1212581464, 1220520248, 85, 85, 664),
('International perceptions of Africa', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 31, NULL, 'issue', 'active', NULL, 135, 1212581535, 1220520248, 86, 86, 664),
('Capital Investment', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 32, NULL, 'issue', 'active', NULL, 136, 1212581592, 1220520248, 87, 87, 664),
('Public Private Partnerships', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 32, NULL, 'issue', 'active', NULL, 137, 1212581677, 1220520248, 88, 88, 664),
('Institutional Capacity', '', 5, 11, 'is your public sector\r\neffective?', 'Rwanda’s Revenue Authority reduced paperwork for\r\nbusinesses and, as a result, increased tax collection\r\nfrom 9% of gross domestic product in 1998, to 15%\r\nin 2005. This supported increased spending on poverty\r\nreduction programmes causing poverty to drop from\r\n70% in 1994 to 60% in 2002.\r\nSource: DFID’s 2006 White Paper, Making Governance Work for the Poor', 'Institutional capacity often refers to a country’s\r\nadministrative and management ability to effectively\r\nundertake national development. A signifi cant part of\r\nthis includes the ability to plan government expenditure\r\nand the delivery of public services such as health and\r\neducation. This is one of the main mechanisms through\r\nwhich the lives of the poor can be directly affected by\r\nnational institutions. In addition to the availability of\r\nresources, this is dependent on the commitment of\r\nleaders and the public sector to appropriately translate\r\nthe needs of the poor into policy responses and actual\r\ndelivery.\r\nEffective expenditure and public services delivery rely\r\non the ability to collect and analyse statistical data to\r\naccurately determine and forecast a country’s current\r\nand future needs. This includes access to up-to-date and\r\naccurate data, statistical computer packages as well as\r\nthe computers to undertake such analysis. Lack of such\r\ncapacity is driven by poverty and can also be a cause\r\nof poverty. The International Monetary Fund notes that\r\nin Africa, the difference between budgeted and actual\r\nrecurrent expenditure can be as high as 30 – 50%. This\r\nmeans that the country’s leadership cannot make the\r\nbest decisions about how to spend public money, and\r\nkey sectors such as health and education can remain\r\nunderfunded.', NULL, NULL, NULL, 32, NULL, 'issue', 'active', NULL, 138, 1212581779, 1220520248, 89, 89, 664),
('Land Reform', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 31, NULL, 'issue', 'active', NULL, 139, 1212581852, 1220520248, 90, 90, 664),
('Delivery', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 32, NULL, 'issue', 'active', NULL, 140, 1212581960, 1220520248, 91, 91, 664),
('Ageing Population', '', 1, 6, 'how many centenarians\r\nwill you know?', 'There are currently\r\n580M people over the\r\nage of 65 in the world,\r\nwith 355M of them in\r\ndeveloping countries.\r\nBy 2020, 70% of the\r\nworld’s elderly will be in\r\ndeveloping countries.\r\nSource: Old Age and Ageing in\r\nAfrica, IFA Global Conference,\r\nJune 2006', 'Populations age as a result of a reduction in total\r\nfertility rates and/or an increase in life expectancy. This\r\nis characterised by an increase in the proportion of\r\nthe oldest people, along with increases in the average\r\nage and the median age. Another indication of ageing\r\npopulations is a reduction in the number of young people.\r\nThis coincides with the growth of the middle-aged\r\nsegment. By 2007 there will be a reverse demographic\r\npyramid in the EU. Projections by the UN show that by\r\n2030 at least half of the Western population will be over\r\nthe age of 50. The life expectancy of 50-year-olds will be\r\nanother 40 years. By 2050 the share of 65+ in the EU will\r\nbe around 28%.\r\nThe older population is growing at a considerably faster\r\nrate than the world’s total population. In absolute terms\r\nthe number of older persons has tripled over the last\r\n50 years and will more than triple again in the next 50\r\nyears. And although the ageing phenomenon now affects\r\ndeveloped countries in particular, it will become a major\r\nconcern for developing countries in the second half of the\r\n21st century.', NULL, '44.jpg', '44back.jpg', 1, NULL, 'issue', 'active', NULL, 141, 1223346748, 1223346761, 1, 1, 664),
('Time poor', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 142, 1223986724, 1223986889, 1, 1, 664),
('widening wealth  gap', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 144, 1223986967, 1223986967, 1, 1, 664),
('community', '', 1, 7, 'do you know your neighbours?', 'London is home to\r\npeople from more than\r\n200 different cultural\r\ncommunities. Such diversity\r\nstimulates creativity,\r\nwhich is why London has\r\nbecome a global hotspot\r\nfor innovative theatre, fi lm,\r\nart, dance, music, fashion,\r\nand food.\r\nSource: www.london2012.org/en/\r\nourvision/olympism+and+culture/', 'Urban areas often bring together a mix of people and\r\ncultures. Sao Paulo, for example, with its core population\r\nof 10.6M, has the largest Lebanese urban community\r\noutside Lebanon and the largest Japanese “city” outside\r\nJapan as well as the world’s third-largest Italian urban\r\npopulation. Colombia’s capital, Bogotá, has seen a tenfold\r\nincrease in its population since the 1960s and less than\r\n50% of its inhabitants were born within the city. Its multiethnic\r\npopulation, including Caucasians, Afro-Colombians\r\nof the Pacifi c and 47 indigenous groups of remote\r\norigins, all contribute to a rich cultural fabric. Against\r\nthis background, the city authorities adopted a radical\r\nsustainable development plan over the past ten years to\r\noffer its communities opportunities – for example, car-free\r\ndays - to reclaim the streets and to stimulate diverse\r\nsocial interactions.\r\nIn contrast, gated communities have, since the 1970s,\r\nbecome a symbol of urban fragmentation and social\r\nsegregation in many North and South American cities.\r\nIn the US, they represent an average of 10% of the new\r\nhomes market and more than 30% in low-density urban\r\nareas. The motivations for living in a gated community\r\nare mostly driven by fear of crime and difference. Various\r\nstudies have shown that no single criterion of class,\r\ngender, or wealth is as important as the number of social\r\nrelationships a person has for happiness.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 145, 1223988120, 1223988120, 1, 1, 664),
('life balance', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 146, 1223988120, 1223988120, 1, 1, 664),
('authenticity', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 147, 1223988120, 1223988120, 1, 1, 664),
('ethical luxury', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 148, 1223988120, 1223988120, 1, 1, 664),
('mobility', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 149, 1223988120, 1223988120, 1, 1, 664),
('micro segmentation', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 150, 1223988120, 1223988120, 1, 1, 664),
('education', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 151, 1223988120, 1223988120, 1, 1, 664),
('renewable energy', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 152, 1223988120, 1223988120, 1, 1, 664),
('security', '', 2, 11, 'how safe are you?', 'In Lagos 70% of respondents in a\r\ncity-wide survey were fearful of being\r\nvictims of crime, with 90% fearful of\r\nbeing killed in a criminal attack.\r\nSource: UN-HABITAT, Global Report on Global\r\nSettlements 2007, www.unhabitat.org/pmss/\r\ngetPage.asp?page=bookView&book=2432', 'Safety and security covers a wide range of issues\r\nincluding crime, violence, terrorism and war. The fear of\r\ncrime and violence is an issue for both high- and\r\nlow-income countries. In the US and the UK people\r\nrepeatedly rank crime among the top concerns they\r\nhave in everyday life. Crime rates have been increasing\r\nglobally - between 1980 and 2000 the total recorded\r\ncrimes increased from 2300 to 3000 crimes for every\r\n100 000 people. Although rates fell in North America and\r\nWestern Europe, they increased in Latin America and the\r\nCaribbean, Eastern Europe and Africa.\r\nThe causes of crime and violence vary widely. Poverty\r\nhas been cited as a cause of crime and violence\r\nalongside unemployment, inequality, substance\r\nmisuse, intergenerational transmission, the rapid\r\npace of urbanisation, poor urban planning design and\r\nmanagement, growth in youthful population and the\r\nconcentration of political power. In Malawi the risk of\r\nburglary goes up in the “hungry season”, which is when\r\npeople are less likely to have food.\r\nThe poor are disproportionately more affected by\r\nterrorism and war due to their lack of options in dealing\r\nwith such risks. War has serious implications for poverty\r\nas it threatens life, property and the overall social and\r\neconomic development of a country.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 153, 1223988120, 1223988120, 1, 1, 664),
('privacy', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 154, 1223988120, 1223988120, 1, 1, 664),
('transport', '', 2, 7, 'how will you move around?', '“With the opening of the high speed rail, Taiwan island\r\nwill become Taiwan city. Travel times and costs will\r\ndramatically decrease, communications between cities\r\nwill be far easier, and Taiwan city can compete with the\r\ntop Asian cities like Hong Kong and Shanghai.”\r\nSource: Hank Huang, Taiwan Institute of Economic Research, 4 January 2007\r\nhttp://news.bbc.co.uk/1/hi/world/asia-pacifi c/6230761stm', 'Transport technology has shaped urbanisation. In Britain,\r\nthe growth of the railways in the 19th century infl uenced\r\nthe development of cities with the population of London\r\nincreasing from 1M in 1800 to 4M by 1850. Today, in\r\nTokyo, the world’s largest city region (with a population of\r\nover 30M), a 45-minute commuting radius by train can\r\nmeasure as much as 220km. In the latter part of the 20th\r\ncentury, cheap fuel and high car ownership led to urban\r\nsprawl and low-density suburbs, particularly in the US\r\nand Australia.\r\nIn 1970 there were 200M cars in the world, but by 2006\r\nthis had grown to more than 850M – and the number\r\nis expected to double by 2030. Peak oil (the decline of\r\noil availability) together with the need to further improve\r\nurban air quality will drive the development of city vehicles\r\nthat encompass new technologies. They are likely to be\r\nelectric-powered or fuelled by liquefi ed petroleum gas\r\nor compressed natural gas. This could also radically\r\ndisrupt the suburban model and bring wholesale change\r\nto the way we live in cities. According to Newman and\r\nKenworthy, a more sustainable urban form inevitably\r\ninvolves the development of higher densities that integrate\r\npublic transport and move away from car-based city living.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 155, 1223988120, 1223988120, 1, 1, 664),
('energy', '', 2, 7, 'how is your city powered?', 'In Barcelona, an Ordinance introduced in 2000 led to a 10-fold increase in the\r\nnumber of solar water heaters in three years and had repercussions throughout\r\nSpain. Available solar energy in Barcelona equals about 10 times the city’s energy\r\nconsumption.\r\nSource: www.gtz.de/de/dokumente/en-Internat-Experiences-Promoting-Solar-Water_Heaters.pdf', 'Urbanisation is one of the key factors affecting growth in\r\nenergy demand. By 2030 global energy consumption is\r\nprojected to be two-thirds higher than it is today, due to\r\npopulation growth, continued urbanisation, and economic\r\nexpansion. The largest share of this growth will almost\r\ncertainly occur in the developing world, with most of the\r\nadditional energy currently projected to come from fossil\r\nfuels. But there is also an increasing awareness of the need\r\nfor greater effi ciency through low-energy buildings, better\r\nutilisation of combined power and heat and low-carbon\r\nmicro-generation such as solar thermal, photovoltaics,\r\nwind turbines, and ground-source heat pumps.\r\nOne of Europe’s sunniest areas is southern Portugal. A\r\nmajor solar plant, which aims to produce enough energy\r\nto supply 8000 homes, was opened there in early 2007.\r\nThis project endeavours to set a new trend in light of\r\nPortugal’s recent history of intensive, often uncontrolled,\r\nurban development since it joined the European Union 20\r\nyears ago. (The country’s ecological footprint is unusually\r\nhigh for its wealth level.) The new 11MW plant has 52 000\r\nphotovoltaic modules, which will produce 20GW hours of\r\npower each year. Portugal is striving to obtain 45% of its\r\npower from renewable energy by 2010.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 156, 1223988120, 1223988120, 1, 1, 664),
('lightness of  materials', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 157, 1223988120, 1223988120, 1, 1, 664),
('intelligent buildings', '', 2, 7, 'will your home be smart?', 'In 2006, more than 100 homes\r\noffering smart technology\r\nwere built in Seoul, South\r\nKorea, and another 30 000 are\r\nplanned. These smart homes\r\ncan maintain digital control\r\nover air purifi cation, electricity\r\nconsumption, power bills, and\r\nvideo messages.\r\nSource: http://news.bbc.co.uk/1/hi/\r\nprogrammes/click_online/6179868.stm', 'According to the Intelligent Building Group, “An intelligent\r\nbuilding provides a sustainable, responsive, effective\r\nand supportive environment within which individuals and\r\norganisations can achieve their objectives.” Intelligent\r\nbuildings can be high-tech or low-tech. For example,\r\nhigh-tech buildings can form interconnected hubs within\r\ncitywide infrastructures. Modular construction, on the\r\nother hand, can provide low-cost, low-tech housing suited\r\nto the environment.\r\nThe “house of the future” project has investigated the\r\nimplications of environmental, social, and energy-source\r\nchanges on future house design. Passive solar heating,\r\ngreater use of daylight, natural ventilation and natural\r\ncooling systems can be incorporated cost-effectively\r\ninto most buildings. Solar water heating, photovoltaics,\r\nwind turbines, and geothermal energy systems can be\r\nincorporated to utilise resources such as the sun and the\r\nwind to produce clean energy. Ways to collect rainfall and\r\nreduce water use are also being identifi ed. Other forms of\r\nwater conservation include the use of greywater systems\r\nto fi lter and recycle water from bathrooms and washing\r\nmachines for re-use in fl ushing toilets or irrigation.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 158, 1223988120, 1223988120, 1, 1, 664),
('connected communities', '', 2, 8, 'how will this new medium\r\nempower people?', 'The internet provides an\r\nunparalleled medium for sharing.', 'Connectivity technologies are reaching and\r\ninfluencing people’s lives and behaviours\r\nmore rapidly than any previous technology.\r\nThe internet has had an adoption time of six\r\nyears compared to the motorized vehicle,\r\nwhich took us 55 years to accept. Its impact\r\ncrosses social, cultural, and geographic\r\nboundaries, ranging from authoritarian\r\nregimes and less developed nations to social\r\nactivists using SMS ‘smart mobbing’, and the\r\nweb for social actions and charities. The\r\nconnectivity is manifesting itself in modified\r\nmethods of working, expanded asynchronous\r\ncommunities, and a new vocabulary. This is\r\njust the beginning.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 159, 1223988120, 1223988120, 1, 1, 664),
('consumer biotech', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 160, 1223988120, 1223988120, 1, 1, 664),
('customization', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 161, 1223988120, 1223988120, 1, 1, 664),
('resource exploitation', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 162, 1223988120, 1223988120, 1, 1, 664),
('monopolistic control of energy', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 163, 1223988120, 1223988120, 1, 1, 664),
