('climate change', '', 3, 6, 'if cancer doesn’t kill you,\r\nwill warmer weather?', 'In the summer of 2003 the heatwave\r\nin Europe left over 30 000 dead from\r\nheat stress.\r\nSource: UNEP, Impacts of summer 2003 heatwave\r\nin Europe, March 2004', 'An increase in global average temperatures is being linked\r\nto an increase in the severity and frequency of extreme\r\nheatwaves and the morbidity and mortality attributable to\r\nthese events. Research has concluded that an increase in\r\ntemperatures would result in a net increase in\r\ntemperature-related morbidity and mortality. Any\r\nameliorating impact of increasing temperature on winter\r\nmortality rates would not be great enough to offset the\r\nprojected increase in mortality attributed to heat events.\r\nBy 2100, projections suggest that in the US there\r\nwill be approximately 100M more citizens 65 years of\r\nage than in 2000. As a result, the combined share of the\r\npopulation that will be composed of the very young and\r\nolder adults is projected to increase from about 15% to\r\n25%. This anticipated increase suggests, all else equal,\r\nthat the US population will become more vulnerable to\r\nthe health impacts of climate change. In addition, poverty\r\nexacerbates vulnerability to climate-sensitive health\r\nproblems directly by reducing the capacity to adapt to\r\nchanging conditions.', NULL, '35.jpg', NULL, 1, NULL, 'issue', 'active', NULL, 165, 1223988120, 1223988120, 1, 1, 664),
('energy use', '', 3, 8, 'when will buildings\r\nhave to generate\r\nthe energy they need?', 'The 160M buildings in\r\nthe EU use over 40%\r\nof Europe’s energy and\r\ncreate over 40% of its\r\ncarbon dioxide emissions,\r\nand that proportion\r\nis increasing.', 'Nearly 50% of CO2 emissions\r\nin the UK are caused by building,\r\nmaintaining and occupying\r\nbuildings. For emissions in\r\nnon-residential use, heating\r\nfuel is 52%, lighting is 25%\r\nand water heating is 9%.\r\nThe Greenwich branch of\r\nSainsbury’s, part of a UK\r\nsupermarket chain, is designed\r\nto reduce energy consumption\r\nby up to 50% compared to a\r\nstandard store of a similar size\r\nand operation. A daylighting\r\nstudy carried out in 108\r\nAmerican stores concluded that,\r\nall other things being equal,\r\nan average non-skylit store in\r\nthe chain would be likely to\r\nhave 40% higher sales with\r\nthe addition of skylights:\r\nenergy efficiency can have\r\nunexpected side benefits.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 166, 1223988120, 1223988120, 1, 1, 664),
('water', '', 3, 8, 'how long will we\r\ncontinue to flush\r\nour toilets with\r\ndrinking water?', 'Although two-thirds of the\r\nearth’s surface is covered by\r\nwater, only 1% is fresh water.\r\nWithin 30 years, the majority\r\nof the world''s population will\r\nnot have enough potable\r\nwater: ‘water wars’ are very\r\nlikely to occur.', 'Water is a massive issue in driving change in the\r\nworld of economics, politics, and society. It is a\r\nshared resource for many countries: 261 rivers\r\nare shared by two or more countries. Global water\r\nusage is estimated to have doubled since 1960.\r\nThe cleanliness of water is vital and determines\r\nhealth issues and status. By 2025 water shortages\r\ncould affect two out of three people. WaterAid,\r\nwith its partners, uses practical solutions to\r\nprovide safe drinking water to the world’s poorest\r\npeople. So that health benefits are maximised,\r\nit does this through projects that integrate domestic\r\nwater provision, sanitation and hygiene education.\r\nWaterAid works with communities to enable\r\nthem to take ownership of these projects and\r\nto maintain a lasting supply of safe water.\r\nWorld average water use was about 650 m3 per\r\nperson in 2001, ranging from around 1900 m3\r\nper person in North America to around 250 m3 in\r\nAfrica. High income countries used about 1000 m3\r\nper person, twice as much as middle and low\r\nincome countries, on average (see Fig 1).', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 167, 1223988120, 1223988120, 1, 1, 664),
('travel', '', 3, 8, 'how long before our\r\nskies are empty?', 'The Madrid-Seville high\r\nspeed train line reduced rail\r\ntravel time from six hours\r\n30 minutes to two hours\r\n32 minutes. It is now\r\ncomparable to air travel.\r\nThe world’s 16 000\r\ncommercial jet aircraft\r\ngenerate more than 600M\r\ntonnes of CO2 per year.', 'According to the World Tourism Organization,\r\ninternational tourist arrivals in 1995 were\r\n563 million, and are expected to reach\r\n1.6 billion by the year 2020. Short haul\r\npassenger flights, such as UK domestic\r\nand European journeys, make a rather\r\ndisproportionately large contribution to\r\nthe global environmental impacts of air\r\ntransport. These impacts are very much\r\nlarger than those from the rail transport\r\nover the same journey. Air travel produces\r\naround three times more CO2 per\r\npassenger than rail transport. The Royal\r\nCommission on Environmental Pollution\r\nrecommends restricting airport development\r\nin order to encourage greater competition\r\nand increased airfares, thus providing\r\nan economic basis for shifting from rail\r\nto air travel for domestic journeys.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 168, 1223988120, 1223988120, 1, 1, 664),
('sustainability', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 169, 1223988120, 1223988120, 1, 1, 664),
('governance', '', 3, 13, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 170, 1223988120, 1223988120, 1, 1, 664),
('energy prices', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 171, 1223988120, 1223988120, 1, 1, 664),
('globalization', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 172, 1223988120, 1223988120, 1, 1, 664),
('wealth distribution', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 173, 1223988120, 1223988120, 1, 1, 664),
('experience economy', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 174, 1223988120, 1223988120, 1, 1, 664),
('food', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 175, 1223988120, 1223988120, 1, 1, 664),
('excess baggage', '', 4, 3, 'what does wealth leave behind?', 'In his or her lifetime a child born in a\r\ndeveloped country will consume as much as\r\n30-50 children living in a developing country.\r\nSource: UN Environment Programme, Resource kit on\r\nsustainable consumption and production, 2006', 'Although waste is a global concern not all countries\r\nproduce equal quantities of waste. When plotted on\r\na graph there is a relatively good correlation between\r\nthe amount of waste generated by a country and a\r\ncountry’s wealth. In general, it is the more developed and\r\nindustrialised countries that produce the most. The USA\r\nalone, which has less than 5% of the world’s population,\r\nis responsible for 19% of the world’s 1.2bn tonnes of\r\nmunicipal waste, generating over 700kg per capita per\r\nyear. Residents of Australia and Western Europe follow\r\nclose behind and are responsible for 600 – 700kg per year.\r\nThe majority of people in developing countries produce\r\nfar less waste. It is estimated that annual waste generation\r\nis 220kg per resident in Nairobi (Kenya) and 120kg per\r\nresident in Mumbai (India).\r\nNot only does the quantity of waste vary with wealth but\r\nso too does its composition. This is because as income\r\nincreases people gain access to consumer goods that\r\nindicate greater prosperity. With regard to total household\r\nwaste, in a developed country such as the US, 69% of the\r\nwaste includes man-made products such as chemicals,\r\nplastics, paper and metals whereas in a country such as\r\nUganda 82% of the waste is food, vegetable or garden\r\nmatter and can be safely composted.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 176, 1223988120, 1223988120, 1, 1, 664),
('migration', '', 4, 8, 'where will you go?\r\nwhere is your opportunity?', 'Migrants in the European Union are the largest\r\nsingle source of remittances (money wired home).\r\nDuring the 1980s, remittances financed 80%\r\nof the current-account deficit in Botswana.\r\nOne in every 25 people in the world is an\r\ninternational immigrant.', 'The desire for work that is more remunerative is\r\nwhat generally motivates emigration.\r\nEvidence that many migrant workers manage to\r\nobtain better-remunerated work is provided by\r\nthe magnitude of the sums of money sent home\r\nby emigrants: some $130bn was officially sent\r\nhome in 2002, of which $80bn went to developing\r\ncountries. In the Middle East, remittances helped to\r\nfinance the current account deficits, and the external\r\ndebt burden, and also improved the region’s debtservicing\r\ncapacity. For El Salvador and Nicaragua,\r\nthe amount of remittances was at some stage\r\nequivalent to more than 60% of the total foreign\r\ncurrencies obtained through exports of goods and\r\nservices.\r\nClearly, international migration evolves as the\r\neconomic, social and political situation of countries\r\nchanges. Furthermore, given the persistence of\r\neconomic disparities between countries, population\r\nmovements respond to the opportunities available,\r\nbe they in the developed world or in the more\r\nprosperous developing countries.\r\nEurope is now home to the largest number of international\r\nmigrants, followed by Asia and North America.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 177, 1223988120, 1223988120, 1, 1, 664),
('security', '', 4, 11, 'how safe are you?', 'In Lagos 70% of respondents in a\r\ncity-wide survey were fearful of being\r\nvictims of crime, with 90% fearful of\r\nbeing killed in a criminal attack.\r\nSource: UN-HABITAT, Global Report on Global\r\nSettlements 2007, www.unhabitat.org/pmss/\r\ngetPage.asp?page=bookView&book=2432', 'Safety and security covers a wide range of issues\r\nincluding crime, violence, terrorism and war. The fear of\r\ncrime and violence is an issue for both high- and\r\nlow-income countries. In the US and the UK people\r\nrepeatedly rank crime among the top concerns they\r\nhave in everyday life. Crime rates have been increasing\r\nglobally - between 1980 and 2000 the total recorded\r\ncrimes increased from 2300 to 3000 crimes for every\r\n100 000 people. Although rates fell in North America and\r\nWestern Europe, they increased in Latin America and the\r\nCaribbean, Eastern Europe and Africa.\r\nThe causes of crime and violence vary widely. Poverty\r\nhas been cited as a cause of crime and violence\r\nalongside unemployment, inequality, substance\r\nmisuse, intergenerational transmission, the rapid\r\npace of urbanisation, poor urban planning design and\r\nmanagement, growth in youthful population and the\r\nconcentration of political power. In Malawi the risk of\r\nburglary goes up in the “hungry season”, which is when\r\npeople are less likely to have food.\r\nThe poor are disproportionately more affected by\r\nterrorism and war due to their lack of options in dealing\r\nwith such risks. War has serious implications for poverty\r\nas it threatens life, property and the overall social and\r\neconomic development of a country.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 178, 1223988120, 1223988120, 1, 1, 664),
('end of capitalism', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 179, 1223988120, 1223988120, 1, 1, 664),
('mass customization', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 180, 1223988120, 1223988120, 1, 1, 664),
('employment', '', 4, 7, 'can cities provide enough jobs?', 'Around 85% of all new employment opportunities\r\nworldwide are created in the informal economy.\r\nSource: International Labour Organization Global employment\r\ntrends for youth, 2004', 'Employment opportunity is a key factor driving\r\nurbanisation, attracting people from rural to urban areas\r\nand spurring migration. In 2005 there were more than\r\n191M international migrants in the world, equating to one\r\nperson in 35.\r\nIn many developing countries more than half of the\r\neconomically active population is employed in the informal\r\nsector. This is characterised by local resources and smallscale,\r\nfamily operations. But it is also associated with a\r\nlack of legal protection, no minimum wages, low standards\r\nof security and hygiene and no environmental controls.\r\nSquatter sectors can be uncomfortable for city authorities,\r\nespecially as they do not pay taxes. Nor do they take\r\npart in any permit or licensing process. And yet they\r\nhave become a signifi cant part of many city economies.\r\nSome thrive economically, employing each other in\r\ntheir unlicensed businesses, and selling each other all\r\nmanner of goods and services. Informal settlements are\r\nalso the scene of innovation and enormous economic\r\nresourcefulness. Mumbai accounts for one-sixth of India’s\r\nentire GDP yet half of its 12M residents are squatters. Its\r\nactual impact on the economy is probably greater still,\r\nbecause GDP fi gures don’t typically refl ect the full value of\r\nthe “underground” economy.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 181, 1223988120, 1223988120, 1, 1, 664),
('surveillance', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 182, 1223988120, 1223988120, 1, 1, 664),
('asianization', '', 5, 8, 'when will learning\r\nMandarin or\r\nHindi become\r\ncompulsory?', '60% of the world’s population\r\nlives in Asia.\r\n32% of the world’s languages\r\nare from Asia. There are 874M\r\nnative Chinese speakers; 355M\r\npeople speak Hindi; 207M people\r\nspeak Bengali.\r\nChina is now the third largest\r\nimporter of developing country\r\nexports after the US and the\r\nEuropean Union.', 'Asia has always held the majority of\r\nthe world’s population. Its geo-political\r\ninfluence has waxed and waned over\r\nthe past 5000 years; and is again on\r\nthe rise. “Globalization” of the world\r\neconomy has moved inexorably forward\r\nin the past decade. The economies of\r\nAsian countries such as China, Malaysia,\r\nand Thailand are booming. The large\r\ntrade deficit of the United States\r\n($531bn), and the efforts by many Asian\r\nexporters with large current account\r\nsurpluses to prevent their currencies\r\nfrom appreciating against the dollar,\r\nhave resulted in large accumulations of\r\ninternational reserves in Asia. India has\r\nthe seventh largest reserves, ahead of\r\nmost high-income countries. Japan has\r\nthe largest reserves, followed by China.\r\nOf the 10 economies with the largest\r\nreserves, seven are in Asia.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 183, 1223988120, 1223988120, 1, 1, 664),
('digital communities', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 184, 1223988120, 1223988120, 1, 1, 664),
('infrastructure', '', 5, 7, 'who should pay?', 'More than a quarter of the developing world’s\r\nurban population lacks adequate sanitation.\r\nSource: UN-HABITAT Urban Indicators Programme Phase III, 2005', 'Infrastructure refers to all basic requirements needed\r\nfor the proper functioning of a community. Main\r\nservices include water, electricity, telecommunications,\r\nand transportation, as well as health, education, and\r\nsanitation. Until the 1990s, most developing countries\r\nrelied on public sector monopolies to fi nance and operate\r\ntheir infrastructure. But in the late 1980s countries such as\r\nBrazil, Argentina and Nigeria began turning to the private\r\nsector to take over the operation and development of\r\ninfrastructure, with mixed results.\r\nRapid population growth can severely hinder the capacity\r\nof poorer cities to provide adequate infrastructure\r\nfor its inhabitants. Strategic pro-poor investment\r\nby governments in services and the fi nancial and\r\ninstitutional strengthening of local authorities can all help\r\nto develop living conditions. Most importantly, there\r\nis growing consensus that improvements undertaken\r\ncooperatively and locally among citizens, community\r\ngroups, businesses and local authorities have the best\r\nchance of success. Ten years ago urban services in\r\nSomolu (a metropolitan area of Lagos with a population\r\nof one million) were in a state of neglect with widespread\r\ncorruption. The Somolu Local Authority embraced\r\nintegrative management practices involving businesses\r\nand the local community, which have resulted in dramatic\r\nimprovements in sanitation, roads and drainage.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 185, 1223988120, 1223988120, 1, 1, 664),
('access to finance', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 186, 1223988120, 1223988120, 1, 1, 664),
('impact  awareness', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 187, 1223988120, 1223988120, 1, 1, 664),
('political representation', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 188, 1223988120, 1223988120, 1, 1, 664),
