('Migration', '', 1, 8, 'where will you go?\r\nwhere is your opportunity?', 'Migrants in the European Union are the largest\r\nsingle source of remittances (money wired home).\r\nDuring the 1980s, remittances financed 80%\r\nof the current-account deficit in Botswana.\r\nOne in every 25 people in the world is an\r\ninternational immigrant.', 'The desire for work that is more remunerative is\r\nwhat generally motivates emigration.\r\nEvidence that many migrant workers manage to\r\nobtain better-remunerated work is provided by\r\nthe magnitude of the sums of money sent home\r\nby emigrants: some $130bn was officially sent\r\nhome in 2002, of which $80bn went to developing\r\ncountries. In the Middle East, remittances helped to\r\nfinance the current account deficits, and the external\r\ndebt burden, and also improved the region’s debtservicing\r\ncapacity. For El Salvador and Nicaragua,\r\nthe amount of remittances was at some stage\r\nequivalent to more than 60% of the total foreign\r\ncurrencies obtained through exports of goods and\r\nservices.\r\nClearly, international migration evolves as the\r\neconomic, social and political situation of countries\r\nchanges. Furthermore, given the persistence of\r\neconomic disparities between countries, population\r\nmovements respond to the opportunities available,\r\nbe they in the developed world or in the more\r\nprosperous developing countries.\r\nEurope is now home to the largest number of international\r\nmigrants, followed by Asia and North America.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 205, 1242289011, 1242289011, 1, 1, 664),
('ICT infrastructure', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 206, 1242289149, 1242289149, 1, 1, 664),
('Social media', '', 2, 6, 'how many communities are you in?', '44% of US Internet users have contributed their\r\nthoughts and their fi les to the online world.\r\nSource: www.pewinternet.org, February 2004', 'Social media are the online tools and platforms that\r\npeople use to share opinions, insights, experiences,\r\nand perspectives with each other. Social media can\r\ntake many different forms, including text, images,\r\naudio, and video. Popular ones include blogs,\r\nmessage boards, podcasts, wikis and vlogs.\r\nMySpace, YouTube, Facebook, Shutterfl y, Bebo\r\nand Flickr, are examples of some that have become\r\nextremely popular among younger digitally literate\r\ngenerations. MySpace is one of the top sites on\r\nthe Web. As of August 2005 it had racked up 9.4bn\r\npageviews - more than Google - and new users are\r\nsigning up at the rate of 3.5M a month. The site hosts\r\n12% of all ads on the Web, more than any other.\r\nIn 2003 the Pew Internet & American Life Project found\r\nthat more than 53M American adults had used the\r\nInternet to publish their thoughts, respond to others,\r\npost pictures, share fi les, and otherwise contribute\r\nto the explosion of content available online. 21% of\r\nInternet users say they have posted photographs to\r\nWebsites. Content creators are also more likely to be\r\nstudents—20% of all content creators are thought to\r\nbe full or part-time students.', NULL, '42.jpg', '42back.jpg', 1, NULL, 'issue', 'active', NULL, 207, 1242289162, 1242289162, 1, 1, 664),
