('Environmental refugees', '', 3, 6, 'will you need to fl ee your home?', 'The UN says that as many as 50M people could\r\nbe considered environmental refugees by 2010\r\ndue to deforestation, sea-level rise, expanding\r\ndeserts, and catastrophic weather events.\r\nSource: Food and Agriculture Organization of the United Nations\r\nwww.fao.org/worldfoodsummit', 'The most signifi cant change in warfare, from the\r\nperspective of the environment, is the fact that it is no\r\nlonger limited to designated fi eld and clearly identifi able\r\ncombatants. Instead, wars may rage in urban streets,\r\nvillage squares, on cultivated land, or along highways.\r\nBecause confl icts are no longer cordoned off in\r\nspecifi ed combat zones, and are now played out in\r\neveryday human environments, the environmental health\r\nconsequences of war increase exponentially. The Red\r\nCross says environmental disasters already displace more\r\npeople than war.\r\nEnvironment-related migration has been most acute in\r\nSub-Saharan Africa, but also affects millions of people\r\nin Asia and India. Europe and the US face increased\r\npressure from people driven from north Africa and Latin\r\nAmerica by deteriorating soil and water conditions.\r\nThe invasion of modern warfare into urban areas means\r\nmillions of people can be rapidly displaced. Some of these\r\npeople become refugees in other countries, but many\r\nothers stay in-country and become internally displaced\r\npersons (IDPs). According to the UN High Commissioner\r\nfor refugees about 2.1M people had fl ed Afghanistan by\r\nthe end of 2003, making it the country incurring the largest\r\nnumber of refugees.', NULL, '32.jpg', '32back.jpg', 1, NULL, 'issue', 'active', NULL, 212, 1242289339, 1242289338, 1, 1, 664),
('Deforestation', '', 3, 4, 'how important are trees?', '“In the next 24 hours, deforestation will release\r\nas much CO2 into the atmosphere as 8 million\r\npeople fl ying from London to New York.”\r\nSource: Daniel Howden, Deforestation: the hidden cause of\r\nglobal warming, The Independent, 14 May 2007\r\nwww.commondreams.org/archive/2007/05/14/1175/', 'Over the last few hundred years, human beings have\r\ncleared forests on a massive scale to make way for\r\nagriculture. When forests are cleared, the trees are burnt,\r\nconstituting emissions of new CO2 to the atmosphere.\r\nAny new trees or plants planted will reabsorb some of\r\nthis CO2, but will take decades or longer to sequester the\r\ncarbon originally held in the lost biomass.\r\nAlmost 20% (8 GtCO2/year) of current anthropogenic\r\ngreenhouse gas emissions are from deforestation.\r\nDeforestation emissions are highly concentrated in just a\r\nfew countries with 50% accounted for by Indonesia and\r\nBrazil alone. The main causes are the economic drivers of\r\ninternational agri-business, for example, the demand for\r\npalm oil, which is used extensively in food and cosmetics.\r\nSince 1800, around one third of total carbon emissions\r\nhave been from land-use changes, in particular\r\ndeforestation (Fig 1). This places an upper bound\r\non the level of carbon sequestration that could be\r\nachieved if all the forests cleared over that period could\r\nbe re-established. Curbing new deforestation, on the\r\nother hand, is a highly cost-effective way of reducing\r\ngreenhouse gas emissions and has the potential to offer\r\nsignifi cant reductions fairly quickly. It also helps preserve\r\nbiodiversity and protect soil and water quality.', NULL, '9.jpg', '9back.jpg', 1, NULL, 'issue', 'active', NULL, 213, 1242289358, 1242289358, 1, 1, 664),
('Droughts and desertification', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 214, 1242289381, 1242289380, 1, 1, 664),
('Low carbon solutions', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 215, 1242289396, 1242289396, 1, 1, 664),
('Water access', '', 3, 5, 'where would you get water\r\nif there were no taps?', 'Children are 12% more\r\nlikely to attend school\r\nif water is available\r\nwithin a 15 minute walk\r\nrather than an hour. The\r\nweight of water carried\r\nby women in Africa and\r\nAsia is commonly 20kg\r\neach day, which is roughly\r\nequivalent to the average\r\nUK airport luggage\r\nallowance.\r\nSource: www.wateraid.org', 'The World Health Organization defi nes reasonable water\r\naccess as the availability of at least 20 litres of water per\r\nperson per day from a source within 1km of the user’s\r\ndwelling. Currently an estimated 1.1bn people lack access\r\nto such a water supply. In lower-income countries poor\r\nwater quality is often compounded by the high price of\r\nwater from street water vendors.\r\nThe estimated economic benefi ts of proper access to\r\nwater are signifi cant; the biggest gains are for those who\r\nmove from no service at all to basic services. In Africa and\r\nAsia women are the most affected as they are the ones\r\ngenerally responsible for water collection; in rural\r\nAfrica this can mean having to walk fi ve miles or more to\r\nthe nearest water source.\r\nA child born in the developed world uses 30 to 50 times\r\nas much water as a child in the developing world. In\r\nareas poorly served with water and sanitation, the child\r\nmortality rate is multiplied by up to 20 compared to areas\r\nwith adequate water and sanitation services. Poor people\r\nin the developing world pay on average 12 times more per\r\nlitre of water than fellow citizens connected to municipal\r\nsystems.\r\n03', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 216, 1242289410, 1242289410, 1, 1, 664),
('Natural resources', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 217, 1242289425, 1242289425, 1, 1, 664),
('Food security', '', 4, 11, 'how do you feed\r\nyour family?', 'Of Africa’s poor, 70% live\r\nin rural areas and depend\r\non agriculture for food\r\nand a livelihood.\r\nSource: Rural Poverty Portal\r\nwww.ruralpovertyportal.org/\r\nenglish/regions/africa/index.htm', 'The Food and Agriculture Organization (FAO) describes\r\nfood security as when all people, at all times, have access\r\nto suffi cient, safe and nutritious food to meet their dietary\r\nneeds and food preferences for an active and healthy life.\r\nBetween 2001 and 2003, FAO estimated that there were\r\n854M undernourished people worldwide. At the same\r\ntime there were more than 1bn overweight adults with at\r\nleast 300M of them obese.\r\nFactors infl uencing food security include the diversion\r\nof land use to non-food uses, for example, biofuels\r\nand other export-oriented crops. These crops are often\r\nintensively grown using signifi cant application of fertilisers\r\nand pesticides. This, coupled with a mono-crop system,\r\nresults in soil erosion and the loss of biodiversity. In some\r\ncountries the best lands have been used for growing\r\ncash crops leaving marginal lands for growing food.\r\nDeforestation - currently at 20 000 hectares per day - is\r\nbeing driven by factors including changing diets resulting\r\nin an increase in demand for meat-based products and\r\nfor biofuels. The 2008 Gallagher review of biofuels for the\r\nUK government called for a slowdown in the growth of\r\nbiofuels and for policy to be directed at preventing the\r\ndiversion of land for the growing of food to the growing of\r\nbiofuel crops.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 218, 1242289459, 1242289459, 1, 1, 664),
('Volatile commodity prices', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 219, 1242289512, 1242289512, 1, 1, 664),
('Trade', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 220, 1242289533, 1242289533, 1, 1, 664),
('Attracting investment', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 221, 1242289566, 1242289566, 1, 1, 664),
('Infrastructure', '', 4, 7, 'who should pay?', 'More than a quarter of the developing world’s\r\nurban population lacks adequate sanitation.\r\nSource: UN-HABITAT Urban Indicators Programme Phase III, 2005', 'Infrastructure refers to all basic requirements needed\r\nfor the proper functioning of a community. Main\r\nservices include water, electricity, telecommunications,\r\nand transportation, as well as health, education, and\r\nsanitation. Until the 1990s, most developing countries\r\nrelied on public sector monopolies to fi nance and operate\r\ntheir infrastructure. But in the late 1980s countries such as\r\nBrazil, Argentina and Nigeria began turning to the private\r\nsector to take over the operation and development of\r\ninfrastructure, with mixed results.\r\nRapid population growth can severely hinder the capacity\r\nof poorer cities to provide adequate infrastructure\r\nfor its inhabitants. Strategic pro-poor investment\r\nby governments in services and the fi nancial and\r\ninstitutional strengthening of local authorities can all help\r\nto develop living conditions. Most importantly, there\r\nis growing consensus that improvements undertaken\r\ncooperatively and locally among citizens, community\r\ngroups, businesses and local authorities have the best\r\nchance of success. Ten years ago urban services in\r\nSomolu (a metropolitan area of Lagos with a population\r\nof one million) were in a state of neglect with widespread\r\ncorruption. The Somolu Local Authority embraced\r\nintegrative management practices involving businesses\r\nand the local community, which have resulted in dramatic\r\nimprovements in sanitation, roads and drainage.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 222, 1242289596, 1242289596, 1, 1, 664),
