('smart metering', '', 2, 5, 'how much water did you\r\nuse yesterday?', 'In England and Wales only 30% of dwellings have a meter.\r\nSmart meters could monitor variations in demand at\r\ndifferent times. They could also allow a variety of tariff\r\nstructures to be used, for example charging more for very\r\nhigh use during peak demand periods when the availability\r\nof water might be most pressing.\r\nSource: Water UK, Water resources, April 2007\r\nwww.water.org.uk/home/news/archive/water-resources/metering-apr-06', 'Smart metering technology provides real time feedback\r\non use and cost. In many countries water meters have\r\nbeen installed to all domestic dwellings, not necessarily to\r\nreduce demand but simply as a method of charging.\r\nDespite these benefi ts some consumer representatives\r\nand social commentators are critical on the grounds\r\nthat lower income customers may limit their use to save\r\nmoney at the expense of proper health or hygiene.\r\nMetering has a cost that must be assessed against\r\nbenefi ts if metering policy is to be sustainable.\r\nBeing more aware of how much water you use and\r\npaying for it on that basis is seen by many people as one\r\nof the best ways of reducing demand. According to the\r\nUK water regulator, Ofwat, when people pay for water\r\nindirectly they don’t know that an average bath costs\r\nabout 15 pence to fi ll, a toilet fl ush about 1.5p, a machine\r\nwash about 11p and an hour using a hosepipe about\r\n95p. Smart data loggers developed by Scottish Water’s\r\nsmart metering service allow users to record, monitor\r\nand evaluate their water consumption. These smart data\r\nloggers are connected to utility meters and communicate\r\nusing the mobile phone network or radio communication\r\nsignals. This technology makes it possible for users to\r\naccess their fl ow data from water, electricity and gas\r\nmeters on a desktop computer.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 327, 1245824853, 1245824853, 1, 1, 664),
