('waste', '', 3, 8, 'where does your waste go?', 'The average dustbin in\r\ndeveloping countries\r\ncontains enough\r\nunrealized energy for 500\r\nbaths, 3500 showers or\r\n5000 hours of television.\r\nAbout 2.25bn tonnes of waste\r\nwere generated in Western\r\nEurope between 1998 and\r\n2001. Its largest sources\r\nincluded the marketing and\r\npackaging industries.', 'Waste creation is closely linked to Gross Domestic\r\nProduct (GDP). Almost everything we do creates waste,\r\nand as we grow wealthier we produce more waste than\r\never before. This is also being fuelled by developing\r\ncountries as they become wealthier and adopt many\r\nof the characteristics of well-developed countries.\r\nBy 2020, the Organisation for Economic Cooperation\r\nand Development (OECD) estimates we could be\r\ngenerating 45% more waste than we did in 1995.\r\nMost of what we throw away is either burnt in\r\nincinerators, or dumped into landfill sites (67%).\r\nEach year the EU throws away 1.3 billion tonnes of\r\nwaste - some 40 million tonnes of it hazardous;\r\n3.5 tonnes of solid waste for every man, woman\r\nand child.\r\nIn developing countries, municipalities spend up to\r\n20-50% of their available recurrent budget on solid\r\nwaste management. Furthermore, 30-60% of all\r\nthe urban solid waste is uncollected, and less than\r\n50% of the population is served. In some cases,\r\n80% of the collection and transport equipment is out\r\nof service or in need of repair. Consequently, open\r\ndumping with open burning is the norm.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 351, 1245825463, 1245825463, 1, 1, 664),
