('safety ', '', 1, 10, 'can you feed your kids\r\nwith confidence?', 'More than half of US states do not allow the\r\npurchase of unprocessed milk, even direct from the\r\nfarmer. Feedlots, however, are free to give six times\r\nmore antibiotics to their livestock purely as growth\r\npromoters than are used in human medicine.\r\nSources: C Tudge, So Shall We Reap, 2003, p161,\r\nC Ness, State’s tough new raw milk standards upset consumers, farmers, 2007', 'Large-scale food processing has simplified and improved\r\nfood safety by allowing centralised inspection of globallysourced\r\nproducts. However, if large facilities fail to detect\r\ncontaminants, they can quickly distribute disease among\r\nconsumers around the world.\r\nSince food is processed in such diverse, large volumes,\r\nperfect safety control is impossible and disease outbreaks\r\nare inevitable. The average four-ounce burger patty\r\ntoday contains meat from 55 animals, and some include\r\ntissue from more than 1000. US inspectors only have on\r\naverage 1.75 seconds with each processed chicken, and\r\nonly 2% of all US food imports are checked before use.\r\nFood regionalisation is the only sure way to contain\r\noutbreaks, but regulators are hesitant to obstruct\r\nglobal supply chains. In the case of avian flu, UN policy\r\nrecommendations have focused solely on wild bird\r\nsequestration even though migratory bird patterns do\r\nnot align with the sequence of flu outbreaks. Despite this\r\nevidence, sixteen countries have passed laws requiring\r\nthat all poultry be caged, though dense confinement is\r\nlikely to be a primary cause of vulnerability.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 368, 1245977137, 1245977137, 1, 1, 664),
('communication', '', 1, 8, 'how many languages\r\nwill you need to know?', 'Fluency in three to five\r\nlanguages is now common\r\namong affluent ‘Generation X’\r\nprofessionals in Europe.', 'In Europe, the under-20 cohort is remaining in school longer\r\nand taking longer to enter the workforce. The drive to learn\r\nincludes a strong tendency to become fluent in other\r\nlanguages, to facilitate travel, and to work throughout the\r\nEuropean Union. 77% of EU students can speak a foreign\r\nlanguage well enough to take part in a conversation.\r\nIt is estimated that between 50% and 90% of the world’s\r\n6809 languages could be extinct by the end of the century.\r\nWhat will happen when automated translators become readily\r\navailable and human translators are no longer necessary?', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 369, 1248139155, 1248139155, 1, 1, 664),
('education for all', '', 1, 8, 'is the world on\r\nthe ‘rite trak’?', 'Children worldwide complete an\r\naverage of 10.3 years of education. A\r\nchild in sub-Saharan Africa can expect\r\nonly 0.3 years of pre-primary schooling,\r\ncompared to 1.6 years in Latin America\r\nand the Caribbean, and 2.3 years in\r\nNorth America and Western Europe.', 'About 103M children of primary\r\nschool age were not enrolled in\r\nschool in 2001 around the world.\r\nClearly, enrolment ratios are not\r\nincreasing quickly enough for\r\nuniversal enrolment to be achieved\r\nin the short or even medium term.\r\nSome 96% of out-of-school children\r\nlive in developing countries. Sub-\r\nSaharan Africa, South and West Asia\r\ntogether account for almost 75%\r\nof unenrolled children. About 57%\r\nof these children are girls, and the\r\nproportion is 60% or higher in the\r\nArab States, South and West Asia.\r\nA survey of 35 (17.2%) of the world’s\r\ncountries showed low primary school\r\nenrolments, highly unequal gender\r\nratios, widespread illiteracy, and high\r\ndrop-out rates. This means that many\r\nchildren never reach the 5th grade of\r\nprimary school.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 370, 1248139178, 1248139178, 1, 1, 664),
('fear', '', 1, 8, 'what are you\r\nafraid of?', 'People tend to focus their fears about crime\r\non being attacked by strangers, yet violence at\r\nthe hands of family and friends is far likelier. During\r\n2003, about seven in 10 female rape or sexual\r\nassault victims stated that the offender was\r\nan intimate, other relative, friend, or acquaintance.', 'In Switzerland, a man was roughly twice as\r\nlikely to be murdered in the early 1880s as\r\nhe is today. German murder rates were\r\nhigher in the late 19th century than they are\r\nnow. Finland had a particularly violent past:\r\nthe chance of being murdered in parts of\r\nthe country at the turn of the 19th century\r\nwas higher than it is in many American\r\ncities today. In America, four out of 10\r\nviolent crimes are committed by relations\r\nor acquaintances of the victim.\r\nIn Germany, only one murdered woman in\r\n10 is killed by a stranger; almost half are\r\nmurdered by relatives. The fear of crime\r\nmay be powerful even where the risks are\r\nnegligible: in Britain, a recent study by the\r\nCountryside Commission found that\r\nwalkers often avoid woods and parks that\r\nare virtually crime-free, because they worry\r\nabout being attacked. Polls in America,\r\nBritain, and mainland Europe show that\r\nwomen and the elderly feel particularly\r\nunsafe while out at night.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 371, 1248139195, 1248139205, 1, 1, 664),
('future households', '', 1, 8, 'why are we choosing\r\nto live alone?', 'One-third of all households in Western\r\nEurope are single-person households;\r\nthey spend 13% more per person\r\nthan two-adult households.', 'Single-person households in Western Europe\r\neach spend an average of €3022 per year\r\non food, drink, and personal care. Single,\r\nnever-married 35-49 year olds spend almost\r\n€4000 per year on food, drink, and personal\r\ncare. By 2007 the single-person household\r\nmarket will be worth over €900bn. Trading\r\nup to better quality goods is common among\r\n25-60 year olds who live alone.\r\nEuropean females who live alone outspend\r\nmales on both drugs and medical supplies\r\n(102% and 73% more, respectively).\r\nHaving either listened to Mum (or been one),\r\nthey also outspend men by 39% on fresh\r\nfruits and by 42% on fresh vegetables.\r\nWomen also spend 58% more than men\r\non maintenance, repairs, and insurance.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 372, 1248139279, 1248139279, 1, 1, 664);
INSERT INTO `card` (`name`, `safe_name`, `category_id`, `topic_id`, `question`, `factoid`, `description`, `image`, `card_front`, `card_back`, `origin_event_id`, `uri`, `type`, `status`, `params`, `id`, `ctime`, `mtime`, `owner`, `group`, `perms`) VALUES
('hunger', '', 1, 10, 'why are some still\r\nstarving?', 'Between 35% and 60% of the agriculture\r\nindustry in the Gaza strip was wrecked during\r\nIsrael’s Operation Cast Lead in December 2008,\r\nreducing the overall available food supply in the\r\narea by 25%.\r\nSource: Peter Beaumont, Gaza Food Crisis, 2009\r\nwww.guardian.co.uk/world/2009/feb/01/gaza-food-crisis', 'The world is increasing its food surplus each year, but the\r\nhungry population is larger than in 1995. Though food\r\nproduction has risen from 2400 to over 2800 kcal per\r\nperson since 1970, one in six people still lacks sufficient\r\nfood. People are not hungry because there is a shortage\r\nof food; they are hungry because they cannot access\r\nfood.\r\nSurpluses that could feed the hungry are often used\r\nto increase the weight and value of livestock in affluent\r\nnations. In some cases, up to 90% of calorie surplus is reintegrated\r\nby the food industry into established systems.\r\nFood supplies that do reach or remain in hungry nations\r\nare frequently obstructed by disaster. In 2008, Haiti\r\nsuffered from floods that destroyed 60% of its crops\r\nand 245 000 livestock units, costing the country 15%\r\nof its GDP. A quarter of the hunger increase in Sub-\r\nSaharan Africa between 1990 and 2005 occurred in the\r\nDemocratic Republic of the Congo, which has been\r\nplagued by persistent war. 79% of its population is\r\ncurrently under-nourished.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 373, 1248140318, 1248140318, 40, 40, 664),
('water access', '', 1, 5, 'where would you get water\r\nif there were no taps?', 'Children are 12% more\r\nlikely to attend school\r\nif water is available\r\nwithin a 15 minute walk\r\nrather than an hour. The\r\nweight of water carried\r\nby women in Africa and\r\nAsia is commonly 20kg\r\neach day, which is roughly\r\nequivalent to the average\r\nUK airport luggage\r\nallowance.\r\nSource: www.wateraid.org', 'The World Health Organization defi nes reasonable water\r\naccess as the availability of at least 20 litres of water per\r\nperson per day from a source within 1km of the user’s\r\ndwelling. Currently an estimated 1.1bn people lack access\r\nto such a water supply. In lower-income countries poor\r\nwater quality is often compounded by the high price of\r\nwater from street water vendors.\r\nThe estimated economic benefi ts of proper access to\r\nwater are signifi cant; the biggest gains are for those who\r\nmove from no service at all to basic services. In Africa and\r\nAsia women are the most affected as they are the ones\r\ngenerally responsible for water collection; in rural\r\nAfrica this can mean having to walk fi ve miles or more to\r\nthe nearest water source.\r\nA child born in the developed world uses 30 to 50 times\r\nas much water as a child in the developing world. In\r\nareas poorly served with water and sanitation, the child\r\nmortality rate is multiplied by up to 20 compared to areas\r\nwith adequate water and sanitation services. Poor people\r\nin the developing world pay on average 12 times more per\r\nlitre of water than fellow citizens connected to municipal\r\nsystems.\r\n03', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 375, 1248140407, 1248140407, 40, 40, 664),
('population distribution', '', 1, 8, 'how will you share\r\nthe earth with\r\nnine billion neighbours?', 'In 1950, 68% of the\r\nworld''s population was in\r\ndeveloping countries, with\r\n8% in least developed\r\ncountries. By 2030, it is\r\nexpected that 85% of the\r\nworld''s population will be\r\nin developing countries,\r\nwith 15% in LDCs.\r\nThe world population\r\nreached 6.1bn in 2000.\r\nIt is projected to rise at an\r\nannual rate of 1.2% to\r\nmore than 9bn in 2050.', '‘Population dynamics’ is one of the key\r\nfactors to consider when thinking about\r\nglobal development. In the past 50 years,\r\nthe world has experienced an unprecedented\r\nincrease in population due almost entirely\r\nto growth in developing countries; 90%\r\nin urban areas.\r\nMost future population growth will be in\r\ncountries that have relatively large numbers\r\nof young people and where large families\r\nare still the norm. Sub-Saharan Africa and\r\nwestern Asia are the fastest growing\r\nregions of the world. In contrast, much of\r\nthe industrialized world is experiencing\r\nmuch slower growth or even population\r\ndecline. Fertility - average births per\r\nwoman - ranges from 1.2 in Italy to 8.0\r\nin Niger. Rapid growth of the developing\r\ncountries’ populations, particularly in the\r\nnext 50 years, poses many economic,\r\nsocial, and environmental challenges for\r\nthe entire global community.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 376, 1248140433, 1248140433, 40, 40, 664),
('skills', '', 1, 11, 'do you have the education\r\nyou need?', 'Nearly 1 in 6 people entered the 21st century\r\nunable to read a book or sign their names.\r\nSource: UNICEF, www.unicef.org/sowc99/sowc99e.pdf', 'The skills gained through formal education increase the\r\nprobability that people will lead more productive lives.\r\nThe 1948 Universal Declaration of Human Rights formally\r\nrecognises education as a human right. Subsequent\r\ninternational agreements have reaffi rmed this right\r\nincluding the Education for All goals established in\r\nJomtien (Thailand) in 1990, the 2000 World Education\r\nForum in Dakar (Senegal) and the United Nations General\r\nAssembly Special Session on Children in 2002. However,\r\naccording to UNICEF, 90M children were still not enrolled\r\nin school in 2005/2006. According to research by the\r\nEducation Policy and Data Centre (EPDC), it is most\r\ncommonly children from poor families living in neglected\r\nand rural regions, especially girls, who are out of school.\r\nThe relationship between education and poverty goes\r\nbeyond issues of access and is affected signifi cantly by\r\nthe type and quality of education received. In England,\r\nonly a third of children in poorer areas show proper\r\nlevels of development after a year in school. In the most\r\ndisadvantaged areas in England, 33% of pupils were\r\nreported to be achieving early learning goals compared\r\nto 50% in the rest of England. Skills in solving everyday\r\nproblems such as the ability to form social networks,\r\nlearning throughout life, communication, and working\r\nin teams are increasingly recognised as important for a\r\nsuccessful life.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 377, 1248140448, 1248140448, 40, 40, 664),
('social capital', '', 1, 11, 'how useful is your network?', 'The US Bureau of Labor Statistics\r\nestimates that 70% of all jobs in\r\nthe US are found through personal\r\ncontacts.\r\nSource: The Importance of Networking and\r\nRelationship Building\r\nwww.esquiregroup.com/jobs_career_24.cfm', 'Social capital is the ability of individuals to secure benefi ts\r\nby virtue of membership to social networks or other social\r\nstructures. Social capital can include institutions such as\r\ngovernment and the rule of law as well as the networks\r\nand norms that govern interactions among individuals,\r\nhouseholds and communities. Social capital includes\r\nboth hierarchical and non-hierarchical associations and\r\nis related to culture and class structures. Research has\r\nidentifi ed three roles of social capital, namely, the sharing\r\nof knowledge, minimising exploitation and facilitating\r\ncollective action to address common issues.\r\nSocial capital can provide protection from exploitation\r\nthrough the familiarity embedded in the networks.\r\nThrough collective action, community services can be\r\nprovided where these are limited or non-existent, for\r\nexample, community responses to crime in the form of\r\nneighbourhood watches. Social capital is also important\r\nfor providing safety nets for young people and can be vital\r\nfor breaking the cycle of intergenerational poverty through\r\nthe presence of role models.\r\nSocial capital can also serve to exclude the poor. Culture,\r\nsocial hierarchies, ethnicity and language can exclude\r\nindividuals from opportunities such as jobs, business\r\ncontracts and access to particular services.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 378, 1248140477, 1248140477, 40, 40, 664),
('engineering seed', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 379, 1248140510, 1248140510, 40, 40, 664),
('biomimetics', '', 2, 8, 'will buildings\r\nbecome organic?', '‘We are learning, for instance, how to\r\nharness energy like a leaf, grow food like a\r\nprairie, build ceramics like an abalone, selfmedicate\r\nlike a chimp, compute like a cell,\r\nand run a business like a hickory forest.’\r\n[Janine Benyus]', 'Life science scholar and writer Janine Benyus has\r\nobserved a shift from the ‘hard’ disciplines of\r\nphysics and chemistry towards a biologyorientated\r\nstate of innovation. Biomimetics is the\r\nfusion of bio-science and technology that studies\r\nnature’s models and takes inspiration from its\r\ndesigns and processes. This innovative method of\r\ndesign has the potential to create more sustainable\r\nproducts and processes. Benyus notes that the\r\npaths to biomimicry include quietening human\r\ncleverness, listening to nature, echoing nature and\r\nprotecting the wellspring of good ideas through\r\nstewardship.\r\nNew products include lotus-effect paint, inspired\r\ndirectly by the dirt-repellent leaves of the lotus\r\nplant, and painless needles, inspired by the mosquito\r\nsting, inserted and left in the bloodstream of\r\ndiabetics to monitor sugar levels.\r\nWe are familiar with LCDs on digital watches and\r\ncalculators that need ambient light to function,\r\nbut are not vivid in bright sunlight. In 1996, two\r\nresearchers from MIT developed new forms of\r\nilluminations known as iMoD displays (now retailed\r\nby QUALCOMM). These can be viewed in bright\r\nsunlight and a much wider array of environments\r\nusing the physics of light interference (found in\r\nbutterfly wings).\r\nExtensive research has been done on the gecko’s\r\nability to climb on walls and ceilings. Results show\r\nthat the bonding is due to intermolecular attraction,\r\nknown as Van der Waal forces, between the tiny\r\nhairs on the gecko’s foot and the surface it is\r\nclimbing on. This has led to scientists beginning to\r\ndevelop new residue-free sticking tape.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 380, 1248140526, 1248140526, 40, 40, 664),
('decarbonisation', '', 2, 4, 'can we ever be carbon free?', 'It is estimated that stabilising greenhouse\r\ngas emissions at between 450 – 550 parts\r\nper million CO2 will be required to avoid\r\ndangerous climate change. Ultimately\r\nstabilisation – at whatever level – requires\r\nannual emissions be brought down to more\r\nthan 80% below current levels.\r\nSource: Sir Nicholas Stern, The Stern Review, 2006\r\nwww.hm-treasury.gov.uk/independent_reviews/stern_review_\r\neconomics_climate_change/sternreview_index.cfm', 'Decarbonisation is the process of decoupling energy\r\nsupply and economic growth from greenhouse gas\r\nemissions. If emissions increase year on year, a\r\n“stabilisation triangle” can be created by comparing that\r\ntrajectory with one that remains at today’s level (Fig 1).\r\nIt is diffi cult to fi nd a single existing technology to close\r\nthis gap. However, Pacala & Socolow have put forward\r\na useful framework that breaks the challenge down\r\ninto a number of manageable chunks, which they term\r\n“wedges”. A wedge is defi ned as any energy effi ciency\r\nmeasure or energy technology that reduces emissions by\r\n1 GtC/year in 50 years time.\r\nFor the example in Fig 1, seven wedges would be needed\r\nto stabilise emissions at current levels for the next 50\r\nyears. Pacala & Socolow identifi ed fi fteen possible\r\noptions capable of delivering a single wedge using\r\nexisting technologies, which were classifi ed into several\r\ncategories: energy effi ciency (4 possible wedges); cleaner\r\nfossil fuels (1 wedge); carbon capture and storage\r\n(3 wedges); nuclear energy (1 wedge); renewable energy\r\n(4 wedges); and carbon sequestration via natural sinks\r\n(2 wedges).', NULL, '23.jpg', '23back.jpg', 12, NULL, 'issue', 'active', NULL, 381, 1248140540, 1248140540, 40, 40, 664),
('research and development', '', 2, 11, 'are we asking the right\r\nquestions?', 'Developed countries represent nearly 90% of\r\nglobal pharmaceutical sales; however of the\r\n14M global deaths due to infectious diseases,\r\n90% occur in developing countries.\r\nSource: World Health Organization\r\nwww.who.int/gb/ebwha/pdf_fi les/WHA56/ea56r27.pdf', 'Research and Development (R&D) is a key contributor to\r\neconomic growth and social progress. It is important for\r\ndeveloping the “best” ways of meeting our basic needs\r\nwithin our given environmental constraints. R&D has been\r\nuseful in the health sector for developing life-saving drugs.\r\nIn 2003, the Resolution of the Fifty-Sixth World Health\r\nAssembly on Intellectual Rights, Innovation and Public\r\nHealth indicated that too little R&D was directed towards\r\naddressing poverty-related diseases, many of which\r\nare tropical. Less than 1% of new drugs marketed by\r\npharmaceutical companies in recent years have been for\r\ntropical diseases.\r\nThe World Trade Organization’s agreement on Trade-\r\nRelated Aspects of Intellectual Property Matters (TRIPS),\r\nthrough a patent system, provides the owner of an\r\ninvention with the legal means to prevent others from\r\nselling it for a period of about 20 years. In the 1990s this\r\nled to a number of WTO disputes around the production\r\nof generic drugs. In the late 1990s, South Africa and Brazil\r\nfor example, put in place legislation which would allow\r\nthe production of generic drugs, including HIV anti-virals,\r\nin their countries. This led to disputes with the US, which\r\naccused these countries of violating TRIPS.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 382, 1248140567, 1248140567, 40, 40, 664),
('consumption impacts', '', 3, 6, 'how big is your footprint?', 'In 2001 humanity’s ecological footprint was\r\n2.5 times larger than in 1961, and exceeded\r\nthe Earth’s biological capacity by about 20%.\r\nSource: WWF, The Living Report 2004', 'The ecological footprint was originally conceived as a\r\nsimple method for comparing the sustainability of\r\nresource use among various populations. The\r\nconsumption of these populations is converted into a\r\nsingle index: the land area that would be needed to\r\nsustain that population indefi nitely. The degree of\r\nunsustainability is calculated as the difference between\r\navailable and required land. In this model, unsustainable\r\npopulations are populations with a higher ecological\r\nfootprint than available land.\r\nConsumption is divided into fi ve categories: food,\r\nhousing, transportation, consumer goods, and\r\nservices. Land is divided into eight categories: energy\r\nland, degraded or built land, gardens, cropland, pastures\r\nand managed forests, and “land of limited availability”\r\n(untouched forests and non-productive areas).\r\nThe Living Planet Index (LPI), measures overall trends in\r\npopulations of wild species around the world. It provides\r\nan indication of the state of the world’s natural\r\nenvironment. Together with the ecological footprint the\r\nLPI gives us important information about the state of the\r\nworld’s ecosystems and the human pressures affecting\r\nthem. Between 1970 and 2000 the LPI has declined by\r\napproximately 40%.', NULL, '34.jpg', '34back.jpg', 12, NULL, 'issue', 'active', NULL, 383, 1248140597, 1248140597, 40, 40, 664),
('food security', '', 3, 11, 'how do you feed\r\nyour family?', 'Of Africa’s poor, 70% live\r\nin rural areas and depend\r\non agriculture for food\r\nand a livelihood.\r\nSource: Rural Poverty Portal\r\nwww.ruralpovertyportal.org/\r\nenglish/regions/africa/index.htm', 'The Food and Agriculture Organization (FAO) describes\r\nfood security as when all people, at all times, have access\r\nto suffi cient, safe and nutritious food to meet their dietary\r\nneeds and food preferences for an active and healthy life.\r\nBetween 2001 and 2003, FAO estimated that there were\r\n854M undernourished people worldwide. At the same\r\ntime there were more than 1bn overweight adults with at\r\nleast 300M of them obese.\r\nFactors infl uencing food security include the diversion\r\nof land use to non-food uses, for example, biofuels\r\nand other export-oriented crops. These crops are often\r\nintensively grown using signifi cant application of fertilisers\r\nand pesticides. This, coupled with a mono-crop system,\r\nresults in soil erosion and the loss of biodiversity. In some\r\ncountries the best lands have been used for growing\r\ncash crops leaving marginal lands for growing food.\r\nDeforestation - currently at 20 000 hectares per day - is\r\nbeing driven by factors including changing diets resulting\r\nin an increase in demand for meat-based products and\r\nfor biofuels. The 2008 Gallagher review of biofuels for the\r\nUK government called for a slowdown in the growth of\r\nbiofuels and for policy to be directed at preventing the\r\ndiversion of land for the growing of food to the growing of\r\nbiofuel crops.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 384, 1248140623, 1248140623, 40, 40, 664),
('potable water', '', 3, 11, 'do you have enough water?', 'People categorised as lacking access\r\nto clean water use about 5 litres a day\r\n- one-quarter of the recommended\r\ndaily requirement and one-tenth of\r\nthe average daily amount used in rich\r\ncountries to fl ush toilets alone.\r\nSource: Human Development Report 2006\r\nhttp://hdr.undp.org/en/media/hdr06-complete.pdf', 'Access to drinking water is a human right. In November\r\n2002, the United Nations Committee on Economic, Social\r\nand Cultural Rights affi rmed that “the human right to\r\nwater is indispensable for leading a life in human dignity\r\nand a prerequisite for the realisation of other human\r\nrights”. Yet according to the 2006 Human Development\r\nReport, some 1.1bn people in developing countries have\r\ninadequate access to water.\r\nWomen and children in Africa and Asia walk on average\r\n6km daily to collect water for their family’s needs. This\r\nhas implications for gender equality, education and\r\nproductivity. The time spent collecting water could be\r\ndirected to other activities including food production,\r\nschooling, childcare and wage employment.\r\n“Of course I wish I were in school. I want to\r\nlearn to read and write…. But how can I?\r\nMy mother needs me to get water.”\r\nYeni Bazan, aged 10 - El Alto, Bolivia\r\nThe UK Government defi nes water poverty as spending\r\nmore than 3% of disposable income on water bills.\r\nIn 2006, nearly 10% of UK households were in water\r\npoverty.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 385, 1248140646, 1248140646, 40, 40, 664),
('resource depletion', '', 3, 3, 'who will pay our debts to nature?', 'The global consumption of key raw materials is rising\r\nfast. In the 20 year period ending 1994, the world\r\npopulation increased by 40% but the consumption\r\nof cement increased by 70% and the consumption of\r\nplastics by 200%.\r\nSource: UN Environment Programme, Vital waste graphics, 2004', 'Growing consumption leads to a greater use of raw\r\nmaterials. Unless we consume recycled products growing\r\nconsumption inevitably leads to a larger mountain of\r\nwaste. Between 1960 and 1995 world consumption of\r\nminerals rose 2.5 fold, metal use 2.1 fold, wood products\r\n2.3 fold and synthetics such as plastics 5.6 fold. The\r\nincreasing demand for paper is putting pressure on the\r\nworld’s forests. The US is the biggest paper consumer at\r\n331kg per person per year. Virgin wood stocks destined\r\nfor paper production account for 19% of the worlds total\r\nwood harvest which is expected to rise to 50% by 2050.\r\nThe Living Planet Index is one indicator that has shown\r\nglobal environmental decline. It measures the health\r\nof forests, oceans, freshwater systems, and other\r\nnatural systems. Consumption of many raw materials\r\nsuch as metals could be largely independent of the\r\nconsumption of goods and services. About 50% of\r\nlead comes from recycled sources as does a third\r\nof aluminium, steel and gold. But today only 13% of\r\ncopper is from recycled sources, down from 20% in\r\n1980. The share of paper fi bre originating from recycled\r\nfi bre has only grown modestly from 20% in 1921 to\r\n38% in the present day. This small increase is in the\r\nface of far greater increase in paper consumption.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 386, 1248140665, 1248140665, 40, 40, 664),
('costing externalities', '', 4, 3, 'how much would you pay\r\nfor a plastic bag?', 'The average plastic bag takes 1 second to manufacture,\r\nis 20 minutes in use and takes 100-400 years to degrade\r\nnaturally.\r\nSource: UN Environment Programme, Vital waste graphics 2, 2006', 'Although plastic bags didn’t come into widespread use\r\nuntil the early 1980s, around 4-5 trillion are currently\r\nproduced globally every year. Most of these bags are\r\nused only once before being thrown away causing\r\ndamaging effects on the environment. In the US it is\r\nestimated that 100bn bags are thrown away every year\r\nwith only 0.6% being recycled. Not only do they add\r\nto waste in landfi ll as they have very limited recycling\r\nvalue but they have been blamed for fl ooding in India\r\nand Bangladesh where thousands of bags clog up the\r\ndrainage system.\r\nAs a result, there is a growing international movement to\r\neither charge people for every bag they use or ban them\r\naltogether. This can be termed “costing the externalities”\r\nwhich involves factoring in the negative environmental\r\nimpact into the price of an item. The Irish Republic has\r\nlevied a 15 cents (10p) charge on plastic bags since 2002,\r\na policy that reduced usage by 95%. Similar success\r\nwas experienced in South Africa where bags were made\r\nmore durable and more expensive to discourage disposal\r\ngenerating a 90% reduction in usage. Other European\r\ncountries that charge for bags in supermarkets include\r\nAustria, Denmark, Germany, Sweden, Finland, Belgium\r\nand the Netherlands.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 387, 1248140699, 1248140699, 40, 40, 664),
('mitigation vs adaption', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 388, 1248140721, 1248140721, 40, 40, 664),
('wealth gap', '', 4, 8, 'how soon will it be before\r\nChinese and Indian\r\nincomes reach that of\r\nthe OECD countries?', 'In the last five years, urban\r\ndisposable incomes in China\r\nhave risen by an average of\r\n8.6% a year, compared to only\r\na 3.8% growth in rural areas.', 'The Human Development Index (HDI) measures\r\nthe average achievements in a country based on\r\nthree criteria:\r\n- life expectancy at birth\r\n- adult literacy rate & education enrolment\r\n- GDP per capita.\r\nThe HDI is increasing in all regions (apart from\r\nsub-Saharan Africa) but the disparity between\r\nregions continues to be high. Fig 1 shows the\r\nglobal disparities in HDI calculated on the basis\r\nof data on life expectancy from the UN (2003),\r\non adult literacy rates from UNESCO Institute of\r\nStatistics (2003), and on GDP per capita from the\r\nWorld Bank (2004).\r\nWhat of the wealth gap within OECD countries?\r\nRecent research by Roger Burrows for the Joseph\r\nRowntree Foundation, released in 2005, has pinpointed\r\nthe role of the Internet in defining neighbourhood\r\nincome levels. It is suggested that a new generation\r\nof internet information services, enabling house\r\nhunters to select their ''ideal'' neighbourhood, have\r\nthe potential to widen the divide between the\r\nrichest and poorest places in Britain and the US.\r\nThe report warns that sophisticated new Internetbased\r\nNeighbourhood Information Systems (IBNIS)\r\ncould lead to a more segregated society by not\r\nonly guiding buyers to the best schools or lowest\r\ncrime figures, but also helping them choose areas\r\nwith the kind of existing residents they would most\r\nwant as neighbours.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 389, 1248140765, 1248140765, 40, 40, 664),
('monetary assistance', '', 4, 11, 'how effective is aid?', 'US$50bn of Overseas Development Assistance\r\n(ODA) was given by G7 countries in 2003. Of\r\nthis, only $16bn (or 10% of the UN national\r\nincome target for ODA) was actually available to\r\ndeveloping countries.\r\nSource: Action Aid, Real Aid - An Agenda for Making Aid Work\r\nwww.actionaid.org.uk/doc_lib/69_1_real_aid.pdf', 'Since 1960 Sub-Saharan African countries have received\r\nUS$650bn in aid from OECD Development Assistance\r\nCommittee (DAC) countries. However, DAC countries\r\ncount a wide range of fi nancing items as Overseas\r\nDevelopment Assistance (ODA), including costs linked to\r\nprogram administration, emergency and food assistance,\r\ntechnical cooperation and debt relief.\r\nSince 1990, the share of aid genuinely available for\r\ndevelopment has been declining while at the same time\r\nthe share of debt forgiveness grants and emergency\r\nfood aid have been increasing. The administrative costs\r\nfor aid also increased from an average of 5% to nearly\r\n8% of assistance, mainly due to the proliferation of\r\norganisations and countries involved in delivering aid.\r\nOnly 2 organisations and 10 countries provided aid to\r\nAfrica in 1960, but by 2004 these numbers had increased\r\nto 16 organisations and 31 countries.\r\nThe tying of aid to donor country exports or fi rms also\r\nreduces the value of aid. Tied aid is estimated to be\r\n11-30% less valuable than untied aid. The UN estimates\r\nthat tied aid reduced the value of bilateral aid sent to Africa\r\nby US$1.6-2.3bn (out of a total of $17bn) in 2003. Taking\r\nall this into account it is estimated that less than one\r\nquarter of bilateral aid and 38% of total aid is genuinely\r\nprovided as fi nancing for development projects.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 390, 1248140788, 1248140788, 40, 40, 664),
('developing world', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 391, 1248140818, 1248140818, 40, 40, 664),
('empowerment', '', 5, 11, 'are you in control of\r\nyour life?', 'In 2005, the International Labour\r\nOrganization (ILO) estimated that between\r\n5-6M children were forced labourers; that is\r\n40-50% of all forced labourers.\r\nSource: ILO, www.ilo.org/wcmsp5/groups/public/---\r\ndgreports/---dcomm/documents/publication/kd00012.pdf', 'Empowerment refers broadly to the expansion of\r\nfreedom of choice and action. The four key elements\r\nof empowerment are access to information, inclusion/\r\nparticipation, accountability, and local organisational\r\ncapacity. The poor are particularly voiceless in dealings\r\nwith the state and markets. It is those with the most\r\nassets, including health, education, money, land and\r\ninformation, which tend to have a greater voice in\r\ndecision-making. However, it is usually the poor who\r\nare disproportionately affected by uninformed decisions\r\nand bad policies. This is especially the case when\r\ngovernments decide to go to war. Most forced internal\r\ndisplacement in the last decade was caused by internal\r\narmed confl icts. In 2007, there were 26M Internally\r\nDisplaced Persons (IDPs) worldwide. Governments\r\nwere responsible for forced displacement in 21 out of 28\r\ncountries with new displacement.\r\nModern-day slavery is a manifestation of the lack of\r\nempowerment which comes with being poor. The\r\nInternational Labour Organization (ILO) estimates that\r\nthere are 12.3M forced labourers worldwide; researchers\r\nhave suggested that the fi gure might be closer to 27M.\r\nPrivate agents are responsible for 75% of forced labour\r\n- this includes bonded labour and forced domestic and\r\nagricultural work. Another 20% of cases of modern-day\r\nslavery are state imposed.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 392, 1248140844, 1248140843, 40, 40, 664),
('global governance', '', 5, 8, 'what will be\r\nthe birthplace\r\nof the first global\r\npresident?', 'The United Nations has grown\r\nfrom 51 member countries at\r\nits foundation in 1945 to 191 in\r\n2002 (Taiwan and the Vatican\r\nCity do not have membership).\r\nIn 1996 the UN-supported\r\nCommission on Global\r\nGovernance called for a new\r\nglobal ethic based on a set of\r\nresponsibilities and rights that\r\nwould encourage co-operation\r\nand collaboration in a ‘global\r\nneighbourhood’.', 'Several organizations known as “specialized agencies”\r\nare linked to the UN through cooperative agreements.\r\nThese agencies, among them the World Health\r\nOrganization and the International Civil Aviation\r\nOrganization, are autonomous bodies created by\r\ninter-governmental agreement. They have wide-ranging\r\ninternational responsibilities in the economic, social,\r\ncultural, educational, health and related fields. Some\r\nof them, like the International Labour Organization and\r\nthe Universal Postal Union, are older than the UN itself.\r\nExpenditures of the UN system on operational activities\r\nfor development—mostly for economic and social\r\nprogrammes to help the world’s poorest countries—\r\namount to around US$6bn a year. This is equal to 0.75%\r\nof world military expenditures of over US$800bn.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 393, 1248140861, 1248140861, 40, 40, 664),
('grain belts', '', 5, 4, 'who will feed the hungry?', 'One in six countries in the world face\r\nfood shortages this year because of\r\nsevere droughts that could become semipermanent\r\nunder climate change.\r\nSource: John Vidal and Tim Radford, One in six countries\r\nfacing food shortage, The Guardian, 30 June 2005\r\nwww.guardian.co.uk/climatechange/\r\nstory/0,12374,1517831,00.html', 'Some of the major grain areas feed the rest of the world\r\nthrough a substantial export market. Fig 1 shows the history\r\nof export volumes by the larger wheat exporting countries,\r\nthese volumes corresponding to around at least half of their\r\nproduction. The graphs show the substantial variation from\r\nyear to year both of harvest and export volume.\r\nLow levels of warming in mid-to-high latitudes may improve\r\nthe conditions for crop growth by extending the growing\r\nseason and/or opening up new areas for agriculture. These\r\ninclude the US, Europe, Australia, Siberia and some parts\r\nof China. Benefi cial effects on agriculture also depend on\r\nthe size of the “carbon fertilisation” effect of stimulating\r\nphotosynthesis and decreasing water requirements. An\r\n8-15% increase in yield for a doubling of carbon dioxide is\r\nestimated for wheat, rice and soybean. However improved\r\nyield is only expected for moderate global warming of 2\r\nor 3°C. Higher temperatures are anticipated to negate\r\nbenefi ts.\r\nThere is a history of international agreements on grains\r\nover the 20th century in response to episodes of shortage\r\nand surplus with their associated high and low prices. The\r\nunpredictable effects of climate change on the “bread\r\nbaskets” will test international trade relations.', NULL, '12.jpg', '12back.jpg', 12, NULL, 'issue', 'active', NULL, 394, 1248140885, 1248140885, 40, 40, 664),
('strife', '', 5, 8, 'what are we fighting for?', 'A quarter of the world’s\r\nmilitary armed conflicts of\r\nrecent years have involved\r\na struggle for natural\r\nresources.\r\nThe US military budget\r\nis almost as much as that\r\nof the rest of the world.', 'In 2004 world military spending reached\r\nUS$975bn. According to research by\r\nStockholm International Peace Research\r\nInstitute (SIPRI), the average annual rate of\r\nincrease in world military expenditure over the\r\n10-year period 1995-2004 was 2.4% in real\r\nterms. This average encompasses two distinct\r\ntrends: first, the post-cold war reduction in\r\nmilitary spending which culminated in 1998;\r\nsecond, an increasing trend since 1998,\r\naccelerating to an annual average rise of\r\naround 6% in real terms over the three-year\r\nperiod 2002-2004. In particular, military\r\nspending in the US has increased since 2002\r\nthrough supplementary appropriations on top\r\nof the regular budget. Those allocated to the\r\nDepartment of Defence for the financial years\r\n2003-2005 amounted to around US$238bn,\r\nexceeding the combined military spending of\r\nAfrica, Latin America, Asia (except Japan but\r\nincluding China) and the Middle East in 2004;\r\nthat is, of the entire developing world.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 395, 1248140898, 1248140898, 40, 40, 664),
('infrastructure', '', 5, 7, 'who should pay?', 'More than a quarter of the developing world’s\r\nurban population lacks adequate sanitation.\r\nSource: UN-HABITAT Urban Indicators Programme Phase III, 2005', 'Infrastructure refers to all basic requirements needed\r\nfor the proper functioning of a community. Main\r\nservices include water, electricity, telecommunications,\r\nand transportation, as well as health, education, and\r\nsanitation. Until the 1990s, most developing countries\r\nrelied on public sector monopolies to fi nance and operate\r\ntheir infrastructure. But in the late 1980s countries such as\r\nBrazil, Argentina and Nigeria began turning to the private\r\nsector to take over the operation and development of\r\ninfrastructure, with mixed results.\r\nRapid population growth can severely hinder the capacity\r\nof poorer cities to provide adequate infrastructure\r\nfor its inhabitants. Strategic pro-poor investment\r\nby governments in services and the fi nancial and\r\ninstitutional strengthening of local authorities can all help\r\nto develop living conditions. Most importantly, there\r\nis growing consensus that improvements undertaken\r\ncooperatively and locally among citizens, community\r\ngroups, businesses and local authorities have the best\r\nchance of success. Ten years ago urban services in\r\nSomolu (a metropolitan area of Lagos with a population\r\nof one million) were in a state of neglect with widespread\r\ncorruption. The Somolu Local Authority embraced\r\nintegrative management practices involving businesses\r\nand the local community, which have resulted in dramatic\r\nimprovements in sanitation, roads and drainage.', NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 396, 1248140910, 1248140910, 40, 40, 664),
('ubiquitous computing', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 13, NULL, 'issue', 'active', NULL, 397, 1248317099, 1248317099, 41, 41, 664),
('famine', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 12, NULL, 'issue', 'active', NULL, 398, 1248391945, 1248391945, 40, 40, 664),
('Urban governance', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 11, NULL, 'issue', 'active', NULL, 399, 1254348448, 1267094098, 42, 42, 664),
('ethical food', '', 1, 10, 'what do you refuse to eat?', 'For the average American, one meatless day\r\nper week reduces greenhouse gas emissions\r\nas much as switching from a typical sedan to\r\nan ultra-efficient hybrid.\r\nSource: Gidon Eshel and Pamela Martin, Diet, Energy and\r\nGlobal Warming, May 2005, p15, http://geosci.uchicago.\r\nedu/~gidon/papers/nutri/nutri3.pdf', 'The collective buying power of ethical consumers alters\r\nthe form and conduct of conventional food systems. This\r\ncan result in extra costs for producers and increased\r\nprices. In nations that have well-established ethical food\r\nnorms, such as Halal Muslim nations, poor consumers\r\ncould begin to pay a premium for their convictions as\r\ncheaper, conventional foods spread around the world.\r\nThis would result in a new ethical dilemma; provide more\r\nfood for one’s family or hold true to personal convictions.\r\nReligious ethics still have a significant effect on the global\r\nfood industry. 24% of the world’s population is Muslim,\r\nfollowing a halal diet and Nestlé is now the world’s largest\r\nHalal manufacturer, capturing US$3bn of the US$580bn\r\nmarket. In 2007, 3984 new food products in the US\r\ncarried the kosher distinction, almost double that of any\r\nother ethical label. Although a kosher diet is associated\r\nwith the Jewish religion,16% of growing US kosher\r\npurchases are by Muslims who lack adequate halal\r\nsupply.\r\nOther ethical foods are rapidly gaining popularity\r\nin wealthy nations. Fair trade products were worth\r\nUS$3.5bn in 2007. Global sales of organic food and drink\r\nare expected to reach US$70.2bn by 2010, showing 19%\r\ngrowth in 2007 alone.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 400, 1264473024, 1264472820, 1, 1, 664),
('farmers', '', 1, 10, 'who will grow your food?', 'In England, for every farmer under the age\r\nof 35, there are ten over the age of 65. This\r\nratio has more than doubled since 1993.\r\nSource: EU Farm Structure Survey, 2003\r\nhttps://statistics.defra.gov.uk/esg/publications/FFS1/\r\ndefault.asp', 'Over the past 50 years farm labour has fallen from\r\n67% to 41% of the global workforce. In the US\r\nand Western Europe, farming now provides less\r\nthan 2% of employment opportunities. This trend\r\nreflects the substitution of cheaper energy inputs\r\nfor expensive labour inputs. As mechanisation\r\ndisplaces farmers, the global food supply becomes\r\nincreasingly vulnerable to energy shortages.\r\nModern farmers are profiting less from their labour.\r\nUS farmers only took home 19% of the food shelf\r\nprice in 2006, down from 42% in 1951. UK farm\r\nshare has fallen by 22% since 1988. In 2002, 93%\r\nof US farm households depended on off-farm\r\nincome sources for roughly 80% of their earnings.\r\nThose farmers unable to find alternative sources\r\nof income have often had to forfeit their property\r\nand way of life. The share of landless agricultural\r\nworkers in India increased 1.25% annually during\r\nthe 1990s. From 1997 to 2005, the suicide rate\r\namongst Indian farmers was 40% higher than that\r\nof the general population. In the UK, the farmer\r\nsuicide rate is increasing faster than that of other\r\noccupations by an average of 3.6% per year.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 401, 1264473111, 1264472906, 1, 1, 664),
('affluent taste', '', 1, 10, 'does wealth improve\r\nyour diet?', 'China’s annual meat consumption increased from\r\n16kg per person in 1983 to over 52kg in 2002.\r\nAbsolute meat consumption has quadrupled.\r\nSource: World Resources Institute, EarthTrends: Environmental\r\nInformation, 2007, http://earthtrends.wri.org', 'As transitioning nations like China and India increase their\r\nwealth, their people, who represent more than a third of\r\nthe world’s population, are changing their eating habits.\r\nIncreased income has led to less direct consumption of\r\nstaple crops and a greater intake of processed foods and\r\nanimal-based products. This large-scale dietary change\r\nis propagating food-related illnesses due to excessive fat\r\nand calorie intake. The average height of Chinese children\r\nbetween the ages of three and eighteen rose 3.3cm\r\nbetween 1992 and 2002, and malnutrition fell by 50%.\r\nDuring the same period, however, obesity increased to the\r\nextent that China is home to now one in five members of\r\nthe world’s overweight population.\r\nGlobal animal-product consumption increased by 30%\r\nbetween 1993 and 2003. China, which until 1996 was a\r\nsoy net exporter, is now responsible for 40% of world soy\r\nimports to feed its growing livestock population. Since\r\nanimals only convert a fraction of their feed into food,\r\nanimal-based calories require many times more energy,\r\nwater, and nutrient resources to produce than most\r\nplant-based calories.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 402, 1264473128, 1264472924, 1, 1, 664),
('convenience', '', 1, 10, 'is cooking a waste of time?', 'In the UK, ready meals are used in 77% of\r\nhouseholds and 28% use them more than\r\nonce a week.\r\nSource: Food Standards Agency, The Ready Meals Market,\r\n2003, www.food.gov.uk/news/newsarchive/2003/jun/\r\nreadymealsmarket', 'People around the world are spending less time\r\npurchasing, preparing, and enjoying food.\r\nUS families spend an hour less per week eating meals\r\ntogether than a decade ago. This trend towards\r\nconvenience poses a threat to cultural transfer and\r\nfamily communication as it displaces traditional meals.\r\nConvenience foods have increased as non-traditional\r\nfamilies have become more common, doubling their\r\nshare among US families since 1980. Dual-income\r\nfamilies, which have quadrupled in the US since\r\n1950, are also more likely to buy prepared meals.\r\nGlobally, ready-meal grocery sales – a useful metric for\r\nmeasuring food convenience growth – are expected\r\nto increase to US$61.7bn by 2012, a 17.8% rise since\r\n2007.\r\nLife-style changes and increased wealth are also\r\naffecting where food is consumed. In the US, a 10%\r\nincrease in income typically leads to a 4.6% rise in\r\neating out but only a 1.3% rise in grocery purchases.\r\nThe 2007 US Time Use Survey revealed that one in\r\nnine driving trips involved eating or drinking, and TV\r\nviewers enjoyed a snack for a third of their viewing\r\ntime.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 403, 1264473190, 1264472985, 1, 1, 664),
('satellite sensing', '', 2, 10, 'can we farm better\r\nfrom above?', 'Satellites can identify and measure crop\r\ndeficiencies before they are visibly apparent\r\non the ground and navigate equipment with\r\ncentimetre-scale accuracy to distribute precise\r\ninput quantities where they are most needed.\r\nSource: Satellite Imaging Corporation, Agriculture Crop\r\nManagement and Production Improved by Satellite Remote\r\nSensing Technology and Geographic Information Systems, 2008', 'Spectral and radar data collected from satellites and\r\nsurveillance planes can help farmers detect crop needs\r\nand address them efficiently. In addition to conserving\r\nresources, early detection can also improve production\r\nconsistency and food security.\r\nSpectral imagery measures levels of plant chlorophyll,\r\nwhich absorbs visible red light and reflects near-infrared\r\nlight, to detect crop stress before it becomes visually\r\napparent. Satellites can also control farm equipment\r\nwith 2.5cm accuracy by using local signal-correcting\r\nstations. Accurate control enables large-scale farmers to\r\napply chemicals only in line with the furrow where seed is\r\nplanted. Corn farmers in the US have claimed as much as\r\n40% chemical use reduction and 8% yield increase from\r\nefficient planting.\r\nGovernments have a strong interest in developing satellite\r\nsensing technologies for agriculture. The US Department\r\nof Agriculture and NASA have invested US$17M in the\r\nAg20/20 program to develop agricultural imaging and\r\nguidance technology. Image comparison with previous\r\nseasons helps politicians and businesses to plan and\r\nnegotiate trade agreements with added confidence.\r\nCurrently 20% of farms in North America already use\r\nsatellites for basic guidance, and nearly 5% use it for\r\nautomated steering.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 404, 1264473237, 1264473032, 1, 1, 664),
('leftovers', '', 2, 10, 'what happens after\r\nthe sell-by date?', 'Seventeen million tonnes of food are being\r\nploughed into Britain’s landfill sites every year. If\r\nsold in shops, this discarded food would sell for\r\naround £18bn.\r\nSource: BBC News, Supermarket Landfills, www.bbc.co.uk/\r\ninsideout/yorkslincs/series7/supermarket_landfills.shtml', 'Over half of all harvestable food never reaches our\r\nstomachs. What begins as 4600 daily kilocalories (kcal)\r\nper person emerges as 2000 kcal, which is only just\r\nenough to feed an adult female in the UK (1940 kcal\r\nper day). Annual food loss for the average American\r\nrepresents over 600 litres of water waste and energy loss\r\nequivalent to 327 gallons of gasoline.\r\nAnaerobic Digestion (AD) may well provide the most\r\neffective way of recovering retail and consumer food\r\nwaste. Biogas (~60% methane and ~40% CO2) is\r\nextracted by bacterial digestion using the same process\r\nthat occurs naturally in landfills. By capturing methane\r\nfrom 82% of its food, the UK could power 164 000\r\nhomes and eliminate a major source of greenhouse\r\ngas emissions. AD is already used effectively in treating\r\nsewage waste and animal manure, and Sweden operates\r\n7000 cars, nearly 800 buses, and a train with biogas.\r\nWhile other renewable and waste-recovery technologies\r\ncan provide power, anaerobic digestion of food waste\r\ncan also produce nutrient-rich fertiliser. UK food waste\r\ncould provide compost equivalent in weight to the nation’s\r\nfertiliser use in 2005, strengthening soils and reducing\r\ndependency upon scarce, mined nutrients.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 405, 1264473275, 1264473071, 1, 1, 664),
('agri-investment', '', 5, 10, 'is food the strongest\r\ncurrency?', 'Though the UN World Food Programme is\r\nstruggling to feed 5.6M Darfur refugees,\r\nSudan has agreed to let Egypt grow and\r\nexport 2M tonnes of wheat within its borders.\r\nSources: Grain Briefing, Seized! The 2008 land grab for food\r\nand financial security, 2008\r\nhttp://www.grain.org/m/?id=215', 'Import-dependent nations are investing in arable land\r\noverseas because trade relationships have become\r\nunreliable during recent food shortages. By acquiring land\r\nabroad, importing nations can guarantee access to food\r\nin times of crisis, but their increased security inherently\r\nmakes exporting nations more vulnerable.\r\nThough the UN World Food Programme feeds millions\r\nof its people, Sudan is negotiating leases to surrender\r\naround 800 000 hectares of its arable land to importdependent\r\nGulf states. Libya is now growing wheat on\r\n247 000 hectares of Ukranian land, and Japanese firms\r\nhave secured US$1bn of agricultural land in the US. In\r\nexchange for leasing away their land, exporting nations\r\nreceive capital, a surge in local employment, and rapid\r\nagricultural development if land has been underutilised.\r\nAgri-investment in previously under-developed land\r\ncould rapidly increase productivity and boost global food\r\nsupply. In the event of a food shortage, however, hungry\r\nlocal farmers working leased land would have to send\r\naway their harvest. ‘Land grab’ also introduces potential\r\nfor international conflict in countries like Sudan, which\r\nare constantly plagued with strife. Investing nations\r\ndependent upon food in unstable countries, will, in all\r\nlikelihood, seek to defend their crops overseas.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 406, 1264473541, 1264473336, 1, 1, 664),
('labelling', '', 5, 10, 'do you know enough\r\nto choose?', 'Around two-thirds of processed food products in\r\nthe US contain genetically-modified (GM) inputs. In\r\n2004, only a third of Americans believed they had ever\r\npersonally consumed GM food.\r\nSource: www.choicesmagazine.org/2005-4/GMOs/2005-4-01.htm', 'Food labelling increases regulation costs but enables\r\nconsumers to determine which foods are healthy,\r\nsafe, and ethical. In 1994, the US estimated that its\r\nnew mandatory food labelling program would reduce\r\nhealthcare costs by between US$4.4bn and US$26bn for\r\na maximum initial US$2.3bn investment. Today labels are\r\non 90% of US packaged goods and are used by 70% of\r\nconsumers. According to the US healthy eating index,\r\nthis has led to a noticeable improvement in their diet.\r\nEthical labelling allows consumers and producers to agree\r\nupon the value of food system behavioural change. Tesco\r\nis conducting a trial with greenhouse-gas-emission labels\r\nin the UK to understand the value consumers assign\r\nto sustainably-supplied foods. Compulsory labelling of\r\ngenetically modified (GM) products in the EU has revealed\r\nthat many European consumers do not favour GM foods.\r\nUS surveys indicate that half of Americans would also\r\navoid GM products if they were aware of them.\r\nMislabelling distorts consumer choice and can undermine\r\necological conservation efforts. From 1988 to 1997, the\r\nUS National Seafood Inspection Laboratory reported that\r\n37% of tested fish were labelled as an incorrect species.\r\nA Stanford study among 77 Pacific Red Snapper samples\r\nfound that 60% were mislabelled and 50% were actually\r\noverfished species.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 407, 1264473554, 1264473349, 1, 1, 664);
INSERT INTO `card` (`name`, `safe_name`, `category_id`, `topic_id`, `question`, `factoid`, `description`, `image`, `card_front`, `card_back`, `origin_event_id`, `uri`, `type`, `status`, `params`, `id`, `ctime`, `mtime`, `owner`, `group`, `perms`) VALUES
('safety', '', 5, 10, 'can you feed your kids\r\nwith confidence?', 'More than half of US states do not allow the\r\npurchase of unprocessed milk, even direct from the\r\nfarmer. Feedlots, however, are free to give six times\r\nmore antibiotics to their livestock purely as growth\r\npromoters than are used in human medicine.\r\nSources: C Tudge, So Shall We Reap, 2003, p161,\r\nC Ness, State’s tough new raw milk standards upset consumers, farmers, 2007', 'Large-scale food processing has simplified and improved\r\nfood safety by allowing centralised inspection of globallysourced\r\nproducts. However, if large facilities fail to detect\r\ncontaminants, they can quickly distribute disease among\r\nconsumers around the world.\r\nSince food is processed in such diverse, large volumes,\r\nperfect safety control is impossible and disease outbreaks\r\nare inevitable. The average four-ounce burger patty\r\ntoday contains meat from 55 animals, and some include\r\ntissue from more than 1000. US inspectors only have on\r\naverage 1.75 seconds with each processed chicken, and\r\nonly 2% of all US food imports are checked before use.\r\nFood regionalisation is the only sure way to contain\r\noutbreaks, but regulators are hesitant to obstruct\r\nglobal supply chains. In the case of avian flu, UN policy\r\nrecommendations have focused solely on wild bird\r\nsequestration even though migratory bird patterns do\r\nnot align with the sequence of flu outbreaks. Despite this\r\nevidence, sixteen countries have passed laws requiring\r\nthat all poultry be caged, though dense confinement is\r\nlikely to be a primary cause of vulnerability.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 408, 1264473573, 1264473368, 1, 1, 664),
('self-sufficiency', '', 5, 10, 'could you grow your own?', 'San Francisco’s 100-mile foodshed provides\r\nover three times the calories needed to feed\r\nits regional population, but only 0.75% of food\r\nconsumed in 2002 was purchased locally.\r\nSource: E Thompson Jr, A M Harper, S Kraus, Think Globally,\r\nEat Locally: San Francisco Foodshed Assessment, 2008,\r\nwww.farmland.org/programs/states/ca/Feature%20Stories/\r\nSan-Francisco-Foodshed-Report.asp', 'Agricultural trade has improved and diversified diet in\r\nimporting countries, but foreign food investment has\r\ndiverted funds and led to less domestic food production.\r\nWhen India, Egypt, Indonesia and Vietnam cut off their\r\nrice exports during the 2008 shortage, the Philippines -\r\nthe world’s leading rice importer - could not provide for\r\nitself. Its government had to request that fast-food outlets\r\nserve half rice portions to cut demand.\r\nGovernments have financially supported domestic\r\nagriculture to protect against shortages. Over the past five\r\ndecades, the world’s largest governments have paid for\r\nbetween 30% and 60% of their annual food production.\r\nUnder normal conditions, subsidies and tariffs lead to\r\nfood surpluses. Since nations can only healthily eat a fixed\r\nnumber of calories, governments struggle to find ways\r\nto donate excess food without competing with farmers in\r\ndeveloping nations. Growing meat demand has provided\r\nan essential sink for over-production since animals eat\r\nmuch more food than they produce.\r\nMunicipal food self-sufficiency is also gaining attention.\r\nSan Francisco has a “foodshed” study that estimates its\r\n100-mile supply, and London established the “London\r\nFood” board to promote food sustainability to 2016.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 409, 1264473589, 1264473384, 1, 1, 664),
('crop diversion', '', 5, 10, 'should food be reserved\r\nfor eating?', 'Though corn-based plastic is\r\ncompostable, it will not degrade\r\nnaturally in a landfill for 100 to 1000\r\nyears, roughly the same amount of\r\ntime as conventional plastics.\r\nSource: Elizabeth Royte, Corn Plastic to the\r\nRescue, Aug 2006, www.smithsonianmag.com/\r\nscience-nature/plastic.html?c=y&page=1', 'Cultivated food is increasingly being used as an alternative\r\nto crude oil, which depends upon foreign supply. The US\r\nDepartment of Agriculture projects it will use 35% of its\r\ncorn to produce ethanol by 2018. In Brazil, sugar-cane\r\nethanol has displaced 40% of its gasoline. Food-fuel\r\ngrowth has been achieved largely through increasing\r\nsubsidies, which in 2006 reached US$11bn.\r\nSubsidies have also made material manufacture from\r\nfood cost-effective. Natureworks is increasing the market\r\nfor its corn-based compostable plastic by 45% annually.\r\nThe company claims it would use other renewable\r\nmaterial, but corn is the most plentiful and inexpensive\r\nsource available. Numerous other small manufacturers\r\nhave unveiled soy and corn-based products from\r\nundergarments to containers.\r\nMeeting global plastic demand with corn would require\r\ntwo thirds of the world harvest. Filling up an SUV takes\r\nthe same amount of corn needed as to feed one person\r\nfor an entire year. Though crop diversion promotes energy\r\nindependence and can improve fuel efficiency, exhausting\r\nlimited soil, water, and land resources for non-food\r\npurposes threatens both current and future food supply.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 410, 1264473603, 1264473398, 1, 1, 664),
('livestock', '', 3, 10, 'who gets fed first?', 'Farm animals consume the equivalent of\r\nat least an extra 2bn people.\r\nBy 2050, livestock will be consuming\r\nmore food than was consumed by the\r\nentire human population in 1970.\r\nSource: Colin Tudge, So Shall We Reap, 2003, p 78', 'Though livestock can increase and improve food supply\r\nsustainably, rapid demand increase has distorted its\r\npositive role in food production. Ruminants, such as\r\ncattle and goats, transform inedible grass into milk and\r\nmeat, and pigs turn a variety of by-products into useful\r\nprotein. However, resource-intensive, crop-based feeding\r\noperations are displacing traditional grazing to service the\r\n22bn animal population that is growing 3% each year.\r\nThe United Nations estimates that 72% of poultry, 61%\r\nof eggs, and 55% of pig meat are raised intensively on\r\n“landless” farms. Rather than using waste or grass for\r\nfeed, these operations use a mix of cultivated staple\r\ncrops. A single kilogram of meat grown in this manner\r\nrequires between 2.1kg (poultry) and 10kg (beef) of feed\r\ngrain and between 3500 litres (poultry) and 100 000 litres\r\n(beef) of water. Fifty-four calories of fossil fuel are needed\r\nto produce one calorie of beef protein.\r\nLivestock feed inefficiency reduces global post-harvest\r\nfood availability by around 30%. The UN assigns a fifth\r\nof global greenhouse gas emissions to livestock. In\r\n2004, farm animals generated 36% more waste than\r\nall global artificial fertiliser applications combined. Of all\r\nthe deforested land in the Amazon, 70% is covered by\r\nlivestock pasture, and much of the remainder is occupied\r\nby animal feed crops.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 411, 1264473619, 1264473414, 1, 1, 664),
('diversity', '', 3, 10, 'how many varieties\r\nhave been lost?', 'Seventy-five percent of the genetic\r\ndiversity of agricultural crops has been\r\nlost since 1900.\r\nSource: www.fao.org/docs/eims/upload/230149/\r\nWSSD02_en.pdf', 'While early civilisations consumed around 1500 species,\r\n75% of the human diet today is provided by just nine\r\nspecies. Though diversity provides useful ecological\r\ncontrol and higher overall land productivity, farmers\r\nincreasingly favour monoculture crops to benefit from\r\nindustrial economies of scale. Over 75% of US farms\r\nharvest two or fewer crops each year. Selective planting\r\nin the US has already eliminated 97% of original fruit and\r\nvegetable varieties.\r\nLoss of genetic material makes crop species susceptible\r\nto disease, soil and climate change, and pestilence.\r\nEcological controls must be replaced with chemical\r\ncrop protection inputs to sustain output. Pesticide\r\nand herbicide use has increased from US$11.7bn to\r\nUS$31.2bn annually since 1980. These chemicals kill both\r\npests and their natural predators, increasing dependency\r\non chemical inputs. The pesticides cause US$8bn in\r\nenvironmental and human health costs each year.\r\nInternational concern about the decline of food species\r\nhas led to international support for a centralised seed\r\nbank. Norway built the Svalbard Global Seed Vault over\r\n70 metres into a mountainside to collect and freezeprotect\r\na complete set of food genetics.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 412, 1264473632, 1264473427, 1, 1, 664),
('fishing', '', 3, 10, 'when will all fish be farmed?', 'Almost 80% of the world’s fisheries are fullyor\r\nover-exploited, depleted, or in a state\r\nof collapse. Worldwide about 90% of large\r\npredatory fish stocks are already gone.\r\nSource: FAO, State of world aquaculture, 2006', 'Fish provides over 15% of global protein intake and\r\nsupplies 33M tonnes of fish meal and oil for animal feed\r\nand other uses. Taken collectively, fish is the most eaten\r\nsource of live protein. Rapid demand growth has stressed\r\nwild fish populations and has created a booming market\r\nfor farmed fish.\r\nOverfishing has led to a decline in total wild fish capture\r\nsince 1990. Sonar technology has made it easier to\r\nexploit large fish in deep water, depleting their numbers.\r\nSmaller varieties are also threatened as large trawlers drag\r\nthe ocean floor at up to a mile depth, pulling in up to 400\r\ntonnes of fish at once. Between 6.8M and 27M tonnes of\r\nfish are accidentally caught in these nets and discarded,\r\nincluding an estimated 100M sharks and rays.\r\nFarmed fish output has doubled in the past decade\r\nand now represents 47% of all fish production. China\r\nmanages 65% of the world’s fish farms and thus is\r\ninfluential in mitigating their environmental impact.\r\nScotland’s salmon farms generate as much nitrogen\r\nsewage as half its national population (3.2M people).\r\nCarnivorous farmed fish like tuna have also contributed\r\nto overfishing, since they require around 20kg of wild fish\r\nfeed to produce one kilogram of meat.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 413, 1264473645, 1264473440, 1, 1, 664),
('soil depletion', '', 3, 10, 'is our best farmland\r\nnow in the ocean?', 'The US lost 1.75bn pounds of topsoil\r\ndue to erosion in 2003. Over half of its\r\nwater-based eroded material terminates in\r\nthe Gulf of Mexico, creating an oxygendepleted\r\ndead zone that covers up to\r\n7000 square miles of ocean.\r\nSources: www.nrcs.usda.gov/technical/nri/2003/\r\nnri03eros-mrb.html, http://serc.carleton.edu/microbelife/\r\ntopics/deadzone/', 'Soil is the nutrient reservoir that fuels all crop and livestock\r\ngrowth. Modern food production annually extracts\r\nroughly 270M tonnes of nitrogen and phosphorous\r\nfrom soil, in addition to other critical nutrients, and does\r\nnot redistribute them effectively. Animal feedlots and\r\nurban centres concentrate soil nutrients and often burn\r\nor discard surplus as waste, while other soil becomes\r\nstarved of fertility.\r\nErosion is responsible for 40% of all soil nutrient loss\r\nand is primarily caused by overgrazing (49%) and\r\nunsustainable agricultural practices (24%). By removing\r\norganic residues from the soil, farmers and ranchers leave\r\nnutrients vulnerable to runoff. Africa loses eight million\r\ntonnes of minerals per year to crop extraction and erosion,\r\nand 75% of its farm land has become severely depleted.\r\nNitrogen runoff causes excessive algae growth in rivers\r\nthat can starve downstream fish of oxygen.\r\nIrrigation with poor drainage has contributed to high salt\r\ncontent in soil and has reduced average output by 24%\r\nfrom the world’s expanding irrigated farm land. Alberta\r\nestimates that nearly 650 000 hectares of its prairie\r\nsuffers from salination, and the affected land produces on\r\naverage 25% less food per hectare than farmland with\r\nnormal salinity.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 414, 1264473656, 1264473452, 1, 1, 664),
('supermarkets', '', 4, 10, 'what does your weekly\r\npurchase say about you?', 'Eighty-five percent of the UK adult population\r\nhas a supermarket loyalty card, and more\r\nthan 50% owns more than one.\r\nSources: Chris Jacobs, Have Loyalty Cards Peaked?\r\nwww.the-logic-group.com/Downloads/\r\nhaveloyaltycardspeaked.pdf', 'Large supermarkets control 52% of world food sales\r\nand over 75% in the US alone. Since so many people\r\nnow pass through their doors, supermarkets can market\r\nnew products and services with little or no additional\r\nadvertising investment. Customers can insure their homes\r\nand families, receive financial advice, and take out a loan\r\nwhile shopping for food.\r\nSupermarkets also use their consumer access to record\r\nshopper behaviour with voluntary loyalty cards. This\r\ndata influences strategies such as discount schemes\r\nand the location of products with the aim of boosting\r\nsales. Because they are not advertised, supermarketbrand\r\nproducts can be sold cheaply. As their market\r\nshare grows, brand manufacturers must increase\r\ntheir advertising budget to compete, which makes\r\nsupermarket-brand goods comparatively less expensive.\r\nGlobal supermarket-brand sales grew by 6% in 2004,\r\ncomprising 16% of all global retail sales and 38% in the\r\nUK.\r\nSupermarkets that sell both food and non-food products,\r\nor hypermarkets, have more than tripled their share of US\r\nfood sales since 1996. To minimise inventory cost, they\r\nsell fewer product types on a massive scale. Through\r\nits low-cost strategies, Walmart alone is responsible for\r\ndriving down US food prices by 9.1% since 1985.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 415, 1264473672, 1264473467, 1, 1, 664),
('fast-food outlets', '', 4, 10, 'where is your nearest take-away?', 'The community in low-income South Los Angeles\r\nis 57% more obese than the city average. To help\r\nwith the problem, the city passed a one-year ban\r\non new standalone fast-food outlets, which make\r\nup 73% of its current eateries.\r\nSource: Christina Hoag, Los Angeles to Vote on Fast Food Ban, 29\r\nJuly 2008, www.huffingtonpost.com/2008/07/29/los-angeles-tovote-\r\non-fa_n_115620.html', 'In the US more is spent eating outside the home than\r\non groceries, and nearly half of restaurant spending is\r\non fast-food. The American trend has spread to the UK\r\nwhere 45% of people – 1% more than in the US – say\r\nthey like the taste of fast food too much to give it up.\r\nIn 2003, the number of fast-food outlets increased globally\r\nby an average of 20%. In 2009, China expects $66bn in\r\nfast-food sales, a 16% increase from 2008, and India’s\r\nmarket for quick-service restaurants is increasing by 40%\r\neach year.\r\nLarge fast-food chains can dramatically influence supply\r\nchain behaviour. In 2004, “Apple Dippers” instantly made\r\nMcDonald’s the largest US apple consumer. The following\r\nyear Washington growers increased their Cameo variety\r\nproduction by 58% to suit McDonald’s preferences.\r\nMcDonald’s is also the world’s second largest purveyor of\r\npoultry and purchases 4.1% of US beef. When Pizza Hut\r\nintroduced “stuffed crust” pizza, it immediately became\r\nresponsible for 50% of string cheese demand.\r\nItaly has opposed the spread of fast food and other\r\nfood convenience trends. The Slow Food movement,\r\nwhich protects food heritage and today boasts 100 000\r\nmembers in 132 countries, was founded in reaction to the\r\narrival of McDonalds in Rome.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 416, 1264473687, 1264473482, 1, 1, 664),
('supply chain', '', 4, 10, 'is your food better\r\ntravelled than you?', 'Global trade in both food and agricultural\r\nproducts more than doubled in value\r\nbetween 2000 and 2007, reaching US$913bn\r\nand US$1.1trillion respectively.\r\nSource: World Trade Organization, Merchandise Trade by\r\nProduct, 2008, pp 48, 54, www.wto.org/english/res_e/statis_\r\ne/its2008_e/its08_merch_trade_product_e.pdf', 'Global supply chains connect minimum-cost producers\r\nand processors with their target consumers. Since about\r\n75% of world food sales are processed items, food\r\nusually makes at least one stop on its way to your plate,\r\nno matter how close the plate may be to the producer.\r\nDawnfresh in Scotland ships its scampi to China to be\r\nhand-shelled before returning the product 5000 miles to\r\nbe processed and sold. Though environmentally-taxing,\r\nshipping can greatly reduce overall cost - Norwegian cod\r\ncosts US$1.36 per pound to process locally, but US$0.23\r\nper pound to process in Asia.\r\nThough processed food trade is often profitable,\r\nnon-processed goods travel much more frequently, in part\r\nbecause they face lower tariffs; 6% of processed goods\r\nare traded, but 16% of basic commodities cross borders.\r\n50% of vegetables and 95% of fruit eaten in the UK\r\ncomes from abroad, yet over half of these imports could\r\nbe sourced locally.\r\nFood represents nearly 30% of goods transported\r\non Britain’s roads. The resulting congestion costs the\r\nUK economy £5bn, and accidents, emissions, and\r\ninfrastructure wear account for another £4bn.\r\nThe £26.2bn made by agriculture and the food and drink\r\nindustry thus includes £9bn in transit subsidy, paid mostly\r\nby the taxpayer.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 417, 1264473700, 1264473496, 1, 1, 664),
('cheap calories', '', 4, 10, 'does food price represent\r\nits real value?', 'Food related ill health is responsible for about 10%\r\nof sickness and mortality in the UK and costs the\r\nNational Health Service about £6bn annually.\r\nSource: M Rayner, P Scarborough, The burden of food related ill\r\nhealth in the UK, 2005, www.ncbi.nlm.nih.gov/pubmed/16286493', 'In the Western world, the most affordable calories are\r\noften the most processed, most advertised, and least\r\nnutritious. Subsidies – especially for corn and soy – have\r\nmade commodity foods artificially cheap. Since it is so\r\naffordable, corn is now used to make at least 25% of\r\nsupermarket items, most commonly as a cost-reducing\r\nsweetener.\r\nCheap calories have contributed towards poor nutrition\r\nand obesity in low-income communities. In order to\r\neconomise, the poor are prone to purchase high-energy/\r\ndensity foods, like snacks and sweets, that rely heavily\r\nupon subsidised calories. Since consumers tend to eat\r\nsimilar volumes of food regardless of their energy content,\r\nthe cheapest, energy-dense diets lead to overeating and\r\nobesity. The US estimates it now pays US$117bn each\r\nyear for diet-related social losses.\r\nIn the US, less than 30% of the 30.5M school lunches\r\nserved daily meet the nutritional requirements set out\r\nby the US Department of Agriculture. In 2008, schools\r\nreceived only US$2.57 per subsidised lunch, so they were\r\nforced to find cheap rather than healthy calorie sources.\r\nUnhealthy school menus penalise poor children, who are\r\nlargely dependent upon subsidised meals.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 418, 1264473716, 1264473512, 1, 1, 664),
('power players', '', 4, 10, 'who controls the global\r\nfood supply?', 'Seventy-five percent of all human food\r\nis grain-based; three companies (Cargill,\r\nArcher Daniels Midland and Bunge) control\r\nabout 90% of the global grain trade.\r\nSource: Peter O’Driscoll, Part of the Problem: Trade,\r\nTransnational Corporations, and Hunger, 2005', 'The path food takes between farmer and retailer is dominated by a small number of privately owned\r\ncompanies. Since they are private and do not sell directly\r\nto the consumer, most multinational agribusinesses are\r\nlightly regulated and lack public accountability.\r\nCargill is the largest US private company and arguably the\r\nmost powerful agribusiness, employing 160 000 people\r\nin 67 countries. In addition to its many international\r\nholdings, the company owns almost 40% of US grain\r\nelevators and 60% of distribution ports. Since they\r\nproduce such high food volume, multinationals like Cargill\r\noften prefer the traceability and certainty associated with\r\nfarmer production contracts. In concentrated commodity\r\nmarkets, however, contracts can suppress prices and\r\ndrive out small producers. Over 60% of US farms that\r\nsell over US$500 000 of food per annum are now under\r\ncontract.\r\nLarge multinational firms lead to longer supply chains.\r\nThough Cargill is a US firm, it is the largest poultry\r\nproducer in Thailand and meat exporter in Argentina. Its\r\nsubsidiaries grow soy in Brazil that feed UK Sun Valley\r\npoultry that will supply McDonald’s Chicken McNuggets\r\nthroughout Europe.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 419, 1264473728, 1264473524, 1, 1, 664),
('fertiliser', '', 2, 10, 'are we chemically\r\ndependent?', 'Almost half of nitrogen used to grow\r\nfood is synthetic, meaning nearly half the\r\nworld’s calories are made available by\r\nmeans of artificial fertiliser.\r\nSource: Colin Tudge, So Shall We Reap, 2003, p 196', 'Since the Second World War the spread of synthetic\r\nfertiliser, created by pulling nitrogen from the air, has\r\ndrastically increased crop yield. Today, artificial fertiliser\r\nhelps feed nearly half the world’s population while\r\ncontributing to much less than 1% of global fossil fuel use.\r\nSub-Saharan Africa has not yet benefitted from artificial\r\nfertilisers, leaving it heavily dependent upon food aid.\r\nPoor infrastructure has been one major contributing\r\nfactor. Fertiliser prices in Nigeria, Malawi, and Zambia are\r\nover 150% higher than those in the US, mostly because\r\ndomestic transportation costs are so high.\r\nIn recent years diminishing yield return from fertiliser has\r\nrapidly increased its use and, as a result, raised concern\r\nabout its supply. Phosphorous, the scarcest of the\r\nessential fertilisers, will only be available for another 80\r\nyears at current extraction rates. Restoring healthy nutrient\r\ncycles, rather than discarding or burning fertile waste,\r\nwould help stabilise fertiliser supplies. Global human\r\nexcrement utilisation would provide nearly one third of all\r\n2006 fertiliser requirements.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 420, 1264473747, 1264473543, 1, 1, 664),
('hydroponics', '', 2, 10, 'do we really need soil?', 'Sandia National Laboratory in New Mexico uses\r\nhydroponic technology to grow livestock forage\r\nusing 99% less water and 99.5% less land area\r\nthan conventional methods.\r\nSource: Sandia National Laboratory, 8 Sept 2004\r\nwww.sandia.gov/news-center/news-releases/2004/genscience/\r\ngreenhouse.html', 'Hydroponic systems replace soil with a steady flow of\r\nfertilised water. The substitution makes it possible to grow\r\nfood where soil is unavailable or of poor quality, such as in\r\nbuildings or deserts. Such systems, however, usually rely\r\non manufactured chemicals that provide only a subset of\r\ncomplete soil nutrient content.\r\nIn 2003, Toronto determined that if food were grown on\r\n0.6% of its rooftops, the city would add US$5.5M worth\r\nof locally produced fruits and vegetables annually to its\r\ncity supply and reduce transit-induced smog conditions\r\nby up to 10%. Columbia University has designed\r\nsustainable, hydroponic “vertical farms” to realise urban\r\nfarming potential. Their farm high-rise supplies its own\r\nfertiliser with in-building fish farming and, in theory, can\r\nreuse all source water not taken up into food.\r\nSince hydroponic fertility is essentially inexhaustible,\r\nfarmers can grow produce all year and can boost annual\r\nyield far beyond conventional methods. Non-seasonal\r\nproduce sells for a higher price and helps recover\r\ninvestment in hydroponics. Seasonal variation requires\r\nclimate-controlled greenhouse cultivation. In the case of\r\ntomatoes, this can increase energy use by 30% or more\r\nin colder climates.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 421, 1264473762, 1264473557, 1, 1, 664),
('public opinion', '', 5, 4, 'do you believe in global warming?', '“Should the public come to\r\nbelieve that the scientifi c\r\nissues are settled, their\r\nviews about global warming\r\nwill change accordingly.\r\nTherefore, you need to\r\ncontinue to make the lack of\r\nscientifi c certainty a primary\r\nissue.”\r\nSource: Leaked memo from Frank Luntz\r\nto President George W Bush, 2002\r\nwww.luntzspeak.com/memo4.html', 'A strong international consensus now exists among\r\nscientists that human-made climate change is a reality\r\nand warrants serious action. This is endorsed by the\r\nIPCC, representing the UN, and by the major national\r\nscience academies, including those of the G8 nations,\r\nBrazil, China and India. Nonetheless, the view that a high\r\nlevel of uncertainty and disagreement exists in the science\r\nof global warming remains prominent. Formerly known as\r\n“scepticism”, this view is often now termed “denial”.\r\nThere are many possible motivations for climate change\r\ndenial, but a powerful driver has been the political\r\nview that fossil fuel consumption and, by association,\r\neconomic growth, should not be restricted to mitigate\r\nclimate change (real or not). A powerful and infl uential\r\nlobby espousing this view emerged in the 1980s and\r\n1990s supported by oil and coal industry interests. It was\r\nparticularly strong in the US and Australia.\r\nHowever, there are indications that public opinion\r\nis shifting. A US opinion poll in 2006 found climate\r\nchange had moved from sixth to fi rst place in the list of\r\nkey environmental concerns (Fig 1) and an increasing\r\nmajority felt scientifi c evidence was now suffi ciently\r\nstrong to warrant action. But, when asked, only 34% of\r\nrespondents believed that most scientists agree with one\r\nanother on global warming (Fig 2).', NULL, '15.jpg', '15back.jpg', 1, NULL, 'issue', 'active', NULL, 422, 1264474295, 1264474090, 1, 1, 664),
('sea level rise', '', 5, 4, 'where else could you live?', 'Tuvalu in the South Pacifi c is an island\r\nnation made up of coral atolls standing\r\nless than 4.5 metres above sea level.\r\nIts government has made requests\r\nto Australia and New Zealand to\r\nunconditionally accept its population\r\nof 12 000 people if rising sea levels\r\nmake evacuation necessary, so far\r\nwithout success.\r\nSource: A citizen’s guide to climate refugees,\r\nFriends of the Earth Australia\r\nwww.safecom.org.au/foe-climate-guide.htm', 'Over the 20th century mean sea level (MSL) rose by\r\n0.17m, due to a combination of thermal expansion of\r\nthe warmer oceans and fresh water input from melting\r\nland ice (sea ice makes no contribution because it is\r\nalready fl oating). The rate of increase accelerated over the\r\ncentury to around 3mm per year in the last decade. The\r\nlatest IPCC projections from climate models for MSL are\r\na further increase of 0.18-0.59m over the 21st century.\r\nHowever, these projections do not include the effect of\r\ndynamic changes in ice fl ow which could destabilise\r\nthe Greenland and Western Antarctic ice sheets. Each\r\ncontains enough water to raise MSL by about 7m. If all the\r\npolar ice were to melt MSL would rise by 85m.\r\nAround 10% of the world’s population lives in coastal\r\nareas less than 10m above sea level and so is vulnerable\r\nto sea level rise (Fig 1). These populations are also at\r\nrisk of increased storm surge fl ooding from the more\r\nintense tropical cyclones, hurricanes and typhoons\r\nexpected under global warming. In 2005 the Atlantic\r\nregion experienced a record-breaking hurricane season\r\nassociated with unusually warm waters in the Gulf of\r\nMexico. In August of that year, Hurricane Katrina fl ooded\r\nNew Orleans and many of the small towns along the\r\nMississippi and Louisiana coasts. A million people were\r\nevacuated. One year later, 375 000 had still not returned\r\nhome.', NULL, '14.jpg', '14back.jpg', 1, NULL, 'issue', 'active', NULL, 423, 1264474311, 1264474106, 1, 1, 664),
('equity', '', 5, 4, 'who sets your carbon quota?', '“The Parties should protect the\r\nclimate system... on the basis\r\nof equity and in accordance\r\nwith their common but\r\ndifferentiated responsibilities\r\nand respective capabilities.”\r\nSource: United Nations Framework\r\nConvention on Climate Change,\r\n(UNFCCC) Article 3\r\nhttp://unfccc.int/essential_background/\r\nconvention/background/items/2853.php', 'Carbon emissions from different countries or groups\r\nof countries (Fig 1) can be expressed in terms of total\r\nemissions (the area of the bars in Fig 1) or in terms of\r\nthe emissions per member of population (per capita\r\nemissions) (the height of the bars in Fig 1). While certain\r\nregions of the world have broadly similar total emissions,\r\nfor example North America and East Asia, there are wide\r\ndisparities in per capita emissions. The USA has one of\r\nthe highest per capita emissions rates in the world, at\r\naround 25 tonnes of CO2 (tCO2) per capita, whereas in\r\nChina, a rapidly developing nation, emissions are currently\r\naround 5 tCO2 per capita. In the world’s poorest nations,\r\nemissions are typically below 1 tCO2 per capita.\r\nIt has been argued that disparities in per capita emissions,\r\nwhich broadly speaking refl ect disparities in national\r\nwealth, are particularly unjust, since the poorest nations\r\nare likely to suffer most from the physical impacts of\r\nclimate change. Because of this, the UNFCCC places\r\nthe heaviest burden for fi ghting climate change on\r\nthe developed nations. Contraction and Convergence\r\nis one framework that aims to achieve this objective.\r\nHere, countries agree to reach a common level of per\r\ncapita emissions (convergence) which is then reduced\r\n(contraction) suffi ciently to stabilise atmospheric CO2 at a\r\nsafe level.', NULL, '13.jpg', '13back.jpg', 1, NULL, 'issue', 'active', NULL, 426, 1264474372, 1264474167, 1, 1, 664),
('international co-operation', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 425, 1264474349, 1264474144, 1, 1, 664),
('tipping points', '', 3, 4, 'where will you be the day\r\nafter tomorrow?', '“We have a window of only 10-15 years\r\nto take the steps we need to avoid\r\ncrossing catastrophic tipping points.”\r\nSource: Tony Blair and Jan Peter Balkenende, extract\r\nfrom open letter to EU leaders, October 2006\r\nwww.number10.gov.uk/fi les/pdf/Vanhanen.pdf', 'In the past, natural climate changes have sometimes\r\noccurred slowly over millennia, but at other times rapidly\r\non timescales as short as years and decades. These\r\nabrupt climate changes are thought to take place when\r\nthe climate system reaches a “tipping point” beyond\r\nwhich change is rapid and irreversible. Tipping points\r\nhappen because of strong amplifying feedbacks in the\r\nclimate system. Both rapid cooling and rapid warming\r\ntipping points are thought possible.\r\nA cooling tipping point popularised by Hollywood in the\r\nfi lm “The Day After Tomorrow” is a shutdown of of the\r\nNorth Atlantic ocean circulation which keeps northern\r\nEurope warmer than it would otherwise be (Fig 1). This\r\ntype of tipping point is thought to have caused abrupt\r\ncooling episodes during the last Ice Age but climate\r\nmodels indicate it to be unlikely in today’s warmer climate.\r\nSudden warming tipping points appear more probable\r\nfrom where we are today. Possibilities include additional\r\nCO2 released from warmer oceans and burning forests;\r\nadditional methane released from thawing tundra and\r\nhydrates on the ocean fl oor; and sudden loss of sea-ice\r\nleading to stronger absorption of sunlight by the darker\r\nocean surface. A consequence of the last scenario might\r\nalso be rapid disintegration of the polar ice shelves leading\r\nto catastrophic sea-level rise.', NULL, '10.jpg', '10back.jpg', 1, NULL, 'issue', 'active', NULL, 427, 1264474387, 1264474182, 1, 1, 664),
('ocean acidification', '', 3, 4, 'will marine life survive?', 'Phytoplankton are critical in the marine food chain.\r\nWhen one type (coccolithophore) bloomed in place\r\nof a diatom type in Bristol Bay in 1997, the number of\r\nsockeye salmon in migration was so low – an estimated\r\n5 million to 12 million animals failed to appear – that the\r\nfi shery was declared a “commercial failure”.\r\nSource: National Marine Fisheries Service, 1998\r\nwww.royalsoc.ac.uk/document.asp?tip=0&id=3249', 'The oceans are an important reservoir for CO2,\r\nabsorbing about 30% of CO2 from human activities in\r\nthe last 200 years. The higher level of dissolved CO2\r\nis believed to have already changed pH in surface\r\nwaters by 0.1 more acidic. If global emissions of CO2\r\ncontinue to rise on current trends, the average pH\r\nof the oceans could fall by 0.5 units (equivalent to a\r\nthreefold increase in the concentration of hydrogen\r\nions) by the year 2100. This pH is probably lower than\r\nhas been experienced for hundreds of millennia and,\r\ncritically, this rate of change is probably one hundred\r\ntimes greater than at any time over this period.\r\nThere is convincing evidence to suggest that\r\nacidifi cation will inhibit the process of calcifi cation,\r\nby which animals such as corals and molluscs make\r\nshells and plates from calcium carbonate. The tropical\r\nand subtropical corals are expected to be among the\r\nworst affected, with implications for the stability and\r\nlongevity of the reefs that they build.\r\nCoccolithophores, a type of phytoplankton, are the\r\nmost productive calcifying organisms on Earth. Data\r\nsuggests a reduction in their calcifi cation by 5–25%\r\nin response to a doubling of atmospheric CO2. These\r\nand other calcifying organisms are a major food source\r\nfor fi sh and other animals.', NULL, '8.jpg', '8back.jpg', 1, NULL, 'issue', 'active', NULL, 428, 1264474402, 1264474197, 1, 1, 664),
('mass extinction', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 429, 1264474415, 1264474210, 1, 1, 664),
('the big thaw', '', 3, 4, 'are polar bears the new poster boys?', '“Polar bears are one of nature’s ultimate survivors, able to live\r\nand thrive in one of the world’s harshest environments. But we are\r\nconcerned the polar bears’ habitat may literally be melting.”\r\nSource: Dirk Kempthorne, US Secretary of the Interior, in Science Daily, 31 December 2006\r\nwww.sciencedaily.com/releases/2006/12/061231100753.htm', 'One of the most tangible impacts of global warming is the\r\nwidespread disappearance of land and sea ice. Nearly\r\nall of the world’s mountain glaciers are in accelerating\r\nphases of retreat. With more than one-sixth of the Earth’s\r\npopulation relying on glaciers and seasonal snow packs\r\nfor their water supply in summer, the consequences of\r\nthese changes for future water availability are likely to be\r\nsevere.\r\nTemperatures in the Arctic have been rising at twice the\r\nrate of the global average. The Arctic summer sea ice\r\nhas declined in extent by a third since the1950s and on\r\ncurrent trends will be almost gone by 2050 (Fig 1). This\r\nchange accelerates global warming as more of the sun’s\r\nheat is absorbed by the darker ocean surface. Another\r\nconcern is the effect on the Arctic ecosystem.\r\nPolar bears are almost completely dependent upon\r\nsea ice for their sustenance. As the ice area declines,\r\nthe bears will be increasingly at risk of malnutrition and\r\nexhaustion as they are forced to swim ever increasing\r\ndistances between the ice fl oes. In January 2007, the\r\nUS Fish and Wildlife Service proposed a rule to list the\r\npolar bear as a threatened species under the Endangered\r\nSpecies Act. Some saw this as a softening of the US\r\ngovernment’s stance on global warming.', NULL, '6.jpg', '6back.jpg', 1, NULL, 'issue', 'active', NULL, 430, 1264474428, 1264474224, 1, 1, 664),
('business opportunity', '', 4, 4, 'is your business climate ready?', '2005 was a record year for investment in the\r\nrenewable energy sector at US$38bn, 27% up on the\r\nprevious year.\r\nSource: Renewables Global Status Report 2006, REN21, 18 July 2006\r\nwww.ren21.net/globalstatusreport/g2006.asp', 'Solar hot water capacity grew by 23% in China in 2005\r\nand reached record levels across Europe. Opportunities\r\nin business are increasing in response to climate change\r\nmitigation measures. These include investment in non-fossil\r\nenergy generation and energy-effi ciency technologies.\r\nThe renewable industry has captured investors’ attention\r\nin the past year more than ever before. So-called “feed-in”\r\npolicies for the purchase of power from renewable sources\r\nare an infl uential driver. The number of countries with these\r\npolicies has increased to 41.\r\nOpportunities in business also arise from adaptation to\r\nthe physical impacts of climate change. The Northwest\r\nPassage is a sea route connecting the Atlantic and Pacifi c\r\nOceans through the Arctic Archipelago of Canada. Some\r\nbelieve that within as little as a decade or two, ships from\r\nEurope could be regularly travelling to the Pacifi c through\r\nthis new route, avoiding the Panama Canal and cutting up\r\nto 6000 miles - and the resultant time and fuel costs - from\r\ntheir journeys. Other already existing sea routes, such as\r\nthe so-called “Arctic Bridge” between Canada and Russia,\r\nare likely to be operational for a longer part of the year.\r\nSome regional authorities and corporations are spending\r\nmillions of dollars developing new infrastructure in sea ports\r\nthat could benefi t.', NULL, '5.jpg', '5back.jpg', 1, NULL, 'issue', 'active', NULL, 431, 1264474445, 1264474240, 1, 1, 664),
('carbon finance', '', 4, 4, 'will carbon be the currency\r\nof the future?', 'The international carbon market grew in value to an\r\nestimated US$30bn in 2006, three times greater than\r\nthe previous year. The volume of carbon traded was\r\n1.6GtCO2.\r\nSource: The World Bank, State and Trends of the Carbon Market, 2007\r\nhttp://carbonfi nance.org/docs/Carbon_Trends_2007-_FINAL_-_May_2.pdf', 'Once targets for greenhouse gas emissions have been\r\nagreed upon, expressed as an equivalent amount of CO2,\r\ncarbon takes on a value and carbon trading becomes\r\npossible. The value of carbon in this market is determined\r\nby the relative cost to a party of achieving a given reduction\r\nin emissions compared to the cost of paying someone else\r\nto achieve the same reduction elsewhere. The rationale is\r\nthat either way the same net reduction is achieved.\r\nThe largest segment of the carbon market currently is\r\nattributable to the Kyoto Protocol. It includes “cap-andtrade”\r\ngroupings of industrial emitters and project based\r\nmechanisms, the largest being the Clean Development\r\nMechanism (CDM) which funds decarbonisation projects\r\nin the developing world. Another growing market is the\r\nvoluntary carbon offsets market in which individuals and\r\ncompanies can voluntarily offset part of their emissions\r\nby paying private companies or NGOs to administer\r\ndecarbonisation and sequestration schemes.\r\nCarbon trading potentially plays an important role in\r\nclimate change mitigation because it creates fi nance for\r\ndecarbonisation. It has, however, been criticised for not\r\ndelivering real results.', NULL, '4.jpg', '4back.jpg', 1, NULL, 'issue', 'active', NULL, 432, 1264474460, 1264474256, 1, 1, 664),
('insurance', '', 4, 4, 'does your policy have\r\na climate change premium?', 'Estimated economic losses of over\r\nUS$170bn were caused by the three\r\nlarge hurricanes of 2005 (Katrina,\r\nWilma and Rita). Only around one\r\nthird of these losses were insured.\r\nSource: Swiss Re, Sigma No 2/2006: Natural\r\ncatastrophes and man-made disasters, 2005\r\nwww.swissre.com', 'Many people rely on insurance as a way of providing the\r\neconomic means to cope with extreme or unexpected\r\nweather. As such, insurance provides a reactive measure\r\nto adapt to the physical impacts of climate change.\r\nResearch by the insurance industry has found that\r\nthe frequency and severity of extreme weather events\r\nhas increased in recent years leading to an increase in\r\nclaims (Fig 1). This trend is set to continue under climate\r\nchange. Insured losses from the three major storm types\r\n(hurricanes, windstorms and typhoons) are projected to\r\nincrease by two thirds to an average of US$27bn per\r\nannum by 2080 in today’s money.\r\nThe insurance industry is highly aware of the changing\r\nnature of climate risks and it is becoming increasingly\r\ndiffi cult to get cover for certain types of weather related\r\ndamage. For risks such as fl ooding, cover may not be\r\navailable in high-risk areas or may be prohibitively costly.\r\nIn the absence of insurance cover, other measures will\r\nbe required to provide the economic means to adapt to\r\nclimate change.', NULL, '3.jpg', '3back.jpg', 1, NULL, 'issue', 'active', NULL, 433, 1264474475, 1264474270, 1, 1, 664),
('geoengineering', '', 2, 4, 'could we control the climate?', 'The dust and ash thrown into the atmosphere from\r\nthe Mount Pinatubo eruption in 1991 refl ected\r\nenough sunlight back into space to cool the Earth\r\nby around 0.5°C for a year or two afterwards.\r\nSource: Richard A Kerr, Pollute the planet for climate’s sake?,\r\nScience, 314, 20 Oct 2006\r\nwww.sciencemag.org/cgi/content/summary/314/5798/401a', 'It is now understood that over the industrial period\r\nhuman beings have inadvertently altered the climate.\r\nAs a result, thoughts are turning to how climate-scale\r\nprojects could reverse or slow global warming, so-called\r\n“geoengineering”. The two inadvertent modifi cations that\r\nhuman beings have imposed on the climate system are\r\nthe increase in greenhouse gases and a reduction in the\r\namount of sunlight received at the Earth’s surface due\r\nto aerosol pollution. The fi rst effect is warming and the\r\nsecond is cooling. Proposed methods of geoengineering\r\nalter one of these two effects.\r\nProposals to reduce the concentration of greenhouse\r\ngases focus on increasing the uptake into natural stores.\r\nCarbon sequestration by tree planting is one possibility.\r\nAnother is to intensify the uptake of the ocean absorbtion\r\nby increasing the primary productivity of marine life. This\r\nis done by adding nutrients to the ocean to stimulate\r\nplankton growth. Approaches to reduce the amount of\r\nreceived sunlight include: putting mirrors in orbit around\r\nthe Earth to create a “refl ective shield”; seeding clouds\r\nabove the ocean using ocean spray; and artifi cially\r\npolluting the upper atmosphere with sulphur dioxide\r\naerosols (which mimics the effect of volcanic eruptions).\r\nThere are substantial barriers to the implementation\r\nof all of these approaches, including high cost and\r\nenvironmental side-effects.', NULL, '25.jpg', '25back.jpg', 1, NULL, 'issue', 'active', NULL, 434, 1264474579, 1264474374, 1, 1, 664),
('sequestration', '', 2, 4, 'can we put the carbon back?', 'Since the start of the industrial\r\nrevolution human beings have released\r\naround 400 gigatonnes of extra carbon\r\ninto the atmosphere from burning fossil\r\nfuels that were stored in the Earth’s\r\ncrust and from land use activities such\r\nas the removal of forests.\r\nSource: Christopher L Sabine, Global Carbon Cycle,\r\nEncyclopaedia of Life Sciences, John Wiley & Sons,\r\n2006', 'Atmospheric CO2 levels could still be stabilised while\r\ncontinuing to use fossil fuels if the CO2 produced by\r\nburning these fuels can be prevented from entering the\r\natmosphere. This is called carbon sequestration.\r\nCarbon Capture and Storage (CCS), a type of\r\nsequestration, is a method to prevent carbon from fossilfuel\r\npowered power stations entering the atmosphere.\r\nThe carbon dioxide is removed from the exhaust stream\r\nof the power station, liquefi ed, and then injected into\r\nporous rock strata, for example an aquifer or disused\r\noil fi eld. It has been estimated that the deep aquifers in\r\nthe world’s sedimentary basins alone have a potential\r\ntotal storage capacity of between 1000 and 10 000 GtC,\r\nor between 100 and 1000 years of CO2 emissions at\r\npresent-day rates.\r\nOther methods of carbon sequestration include the\r\nenrichment of soil carbon and the planting of trees. Soils\r\nenriched with charcoal (so-called “terra preta” soils) can\r\ncontain 2.5 times as much carbon as normal soil (around\r\n100tC/ha*). Tree planting for carbon sequestration is more\r\ncontroversial as sequestration occurs slowly, fi nishes\r\nwhen the forest is mature, and is non-permanent. The\r\ncarbon sequestered can readily return to the atmosphere\r\nif a tree dies, is used for fuel or is lost in forest fi re.', NULL, '24.jpg', '24back.jpg', 1, NULL, 'issue', 'active', NULL, 435, 1264474589, 1264474384, 1, 1, 664),
('paleoclimatology', '', 2, 4, 'does the Earth remember\r\npast climates?', '“Average Northern Hemisphere\r\ntemperatures during the second half\r\nof the 20th century were very likely\r\nhigher than during any other 50-year\r\nperiod in the last 500 years and likely\r\nthe highest in at least the past 1300\r\nyears.”\r\nSource: IPCC, Fourth Assessment Report,\r\nClimate Change 2007: The Physical Science Basis\r\nhttp://ipcc-wg1.ucar.edu/wg1/wg1-report.html', 'The global coverage of ship and land based\r\nmeteorological stations is only suffi cient to infer a global\r\naverage temperature from around 1850. Nevertheless,\r\ninformation about climate further back in the past can be\r\nobtained from climate proxies – aspects of the physical\r\nworld that retain a memory of the climate conditions when\r\nthey were formed. Examples are: rocks; organic debris\r\nin ocean sediments; trapped bubbles of air in ice sheets;\r\nocean corals and tree rings. The technology to determine\r\nage and infer climate properties from such proxies has\r\nadvanced rapidly over the last few decades.\r\nSince the end of the dinosaur period, around 65M\r\nyears ago, the climate cooled and the polar ice sheets\r\ndeveloped (Fig 1). It used to be thought that this was a\r\nrelatively slow and smooth cooling, but new analyses from\r\nocean sediment cores indicate that a number of warming\r\nand cooling events occurred within this trend. Ice cores\r\nprovide a higher resolution record of the more recent\r\npast. In the mid-1990s an ice core was recovered from\r\nthe Vostok station in Antarctica that covered four ice-age\r\ncycles. It clearly showed the close coupling between\r\ngreenhouse gases and temperature (Fig 2). In 2004 a new\r\nice core was recovered from Antarctica that stretches\r\nback over 650 000 years.', NULL, '22.jpg', '22back.jpg', 1, NULL, 'issue', 'active', NULL, 436, 1264474605, 1264474400, 1, 1, 664),
('climate modelling', '', 2, 4, 'have you heard today’s forecast?', '“After so much hard reasoning, may\r\none play with a fantasy? Imagine a\r\nlarge hall like a theatre, the walls of\r\nwhich are painted to form a map of\r\nthe globe. A myriad of computers\r\nare at work upon the weather of the\r\npart of the map where each sits.”\r\nSource: Lewis Fry Richardson, 1922', 'Climate models are used to make quantitative\r\nprojections of future climate change under different\r\nscenarios for greenhouse gas emissions. The most\r\nsophisticated climate models are “global circulation\r\nmodels” (GCMs). These simulate the physics and\r\nchemistry of the global climate system, including\r\natmospheric and oceanic circulation patterns, effects of\r\nclouds, land and sea ice, and the effects of greenhouse\r\ngases and aerosols in the atmosphere. This concept\r\nwas fi rst put forward by the British physicist\r\nLewis Fry Richardson in 1922. His vision was not\r\nrealised until the advent of super-computers in the latter\r\ndecades of the 20th century. Climate GCMs use some of\r\nthe largest super-computers in the world.\r\nThe Intergovernmental Panel on Climate Change (IPCC)\r\nreviews the science and projections of climate models.\r\nIn 2007 it concluded that global temperatures will\r\nincrease by between 1.1 and 6. 4°C. This range\r\narises partly because of uncertainty regarding future\r\nemissions of greenhouse gases and partly from scientifi c\r\nuncertainties in the models (Fig 1). Projections for global\r\ntemperature vary across the globe, with projected\r\nchanges at the poles being very much larger than the\r\ntropics (Fig 2). Climate models also predict changes in\r\nother climate variables, such as rainfall, snow and frost,\r\nwind speeds and sea level rise.', NULL, '21.jpg', '21back.jpg', 1, NULL, 'issue', 'active', NULL, 437, 1264474629, 1264474424, 1, 1, 664);
INSERT INTO `card` (`name`, `safe_name`, `category_id`, `topic_id`, `question`, `factoid`, `description`, `image`, `card_front`, `card_back`, `origin_event_id`, `uri`, `type`, `status`, `params`, `id`, `ctime`, `mtime`, `owner`, `group`, `perms`) VALUES
('personal carbon', '', 1, 4, 'are you a carbon consumer?', '“The granny next door doesn’t drive and\r\ndoesn’t do much air travel. So she has spare\r\ncarbon points that she can sell. At the end of\r\nthe year she fi nds herself better off.”\r\nSource: Speech by the Rt Hon David Miliband MP - “The\r\ngreat stink: towards an environmental contract” at the Audit\r\nCommission annual lecture, Wednesday, 19 July 2006\r\nwww.defra.gov.uk/corporate/ministers/speeches/davidmiliband/\r\ndm060719.htm', 'A nation’s carbon dioxide emissions result from the sum\r\nof its citizens’ individual carbon footprints. These can be\r\ndivided into two areas. The primary footprint arises from\r\nthe direct use of fossil fuels, for transport and heating\r\nand lighting homes. The secondary footprint arises from\r\ngoods and services whose provision used fossil fuel.\r\nIn developed nations such as the UK, a typical carbon\r\nfootprint is split approximately equally between primary\r\nand secondary footprints.\r\nA mechanism to help reduce the size of an individual’s\r\ncarbon footprint is the concept of personal carbon trading.\r\nDifferent types of scheme put forward include Tradable\r\nEnergy Quotas (TEQs), Domestic Tradable Quotas (DTQs)\r\nand Personal Carbon Allowances (PCAs). Each operates\r\non the same basic principle: individuals are given a quota\r\nfor their carbon emissions and any surplus or excess can\r\nbe traded on an open market. The system is controlled by\r\nan independent body that regulates, sets the emissions\r\ncap and quotas, and maintains the markets. One way\r\nof implementing the system is that individuals have a\r\n“carbon card” which stores their carbon credit status and\r\nneeds to be swiped whenever a fuel purchase is made. In\r\nthe future you might be forfeiting carbon credits as well as\r\npaying for fuel in cash.', NULL, '20.jpg', '20back.jpg', 1, NULL, 'issue', 'active', NULL, 438, 1264474642, 1264474437, 1, 1, 664),
('aviation', '', 1, 4, 'are you a high fl yer?', 'One person fl ying a return trip between Europe\r\nand New York generates around 2 tonnes of\r\nCO2. This is approximately the amount an\r\naverage European generates at home for heating\r\nand electricity in one year.\r\nSource: Greenskies, 2005\r\nwww.aef.org.uk/downloads/Factsheetclimate.pdf', 'In 2002 the world’s commercial jet aircraft generated\r\nnearly 0.5 GtCO2, around 2% of total anthropogenic CO2\r\nemissions. Emissions from aviation have risen by 45%\r\nsince 1990, a trend that is expected to continue, with\r\nsome estimates projecting that aviation will account for\r\n15% of total anthropogenic CO2 emissions by 2050. In\r\naddition to emitting CO2, jet engines also produce water\r\nvapour and nitrogen oxides (NOx) that have strong global\r\nwarming impacts when emitted high in the atmosphere.\r\nThe global warming impacts are estimated to be at least\r\ntwo to four times greater than the CO2 emissions alone.\r\nAir travel is not the only mode of transport with growing\r\nemissions. Since 1990, emissions from the transport\r\nsector as a whole have grown by 27%. They now stand\r\nat around 6.2 GtCO2, with road transport being by far\r\nthe largest contributor at around 74% of the total. Air\r\ntravel is the most carbon intensive form of transport, due\r\nto its highly energy intensive vehicles (aircraft) and the\r\namplifi cation effect of the non-CO2 emissions. Carbon\r\nemissions per km travelled from air travel are typically\r\nseveral times larger that those from alternative modes of\r\ntransport available for short haul distances such as train or\r\ncoach (Fig 1).', NULL, '19.jpg', '19back.jpg', 1, NULL, 'issue', 'active', NULL, 439, 1264474657, 1264474452, 1, 1, 664),
('mega droughts', '', 1, 4, 'can we survive without rain?', 'The Murray-Darling river basin is Australia’s primary\r\nagricultural area. In April 2007 the government\r\nannounced there would be “insuffi cient water available to\r\nallow any allocation for irrigation” from the river system if\r\nthe record breaking drought continued.\r\nSource: Water contingency planning in the southern Murray-Darling\r\nbasin. Joint statement by the Prime Minister and the Premiers of New\r\nSouth Wales, Victoria and South Australia. April 2007\r\nwww.murrayirrigation.com.au/fi les/3290950.pdf', 'One of the largest concerns for human societies is the\r\npossibility of increasingly frequent droughts adversely\r\naffecting agricultural production and drinking water\r\nsupplies. A warmer atmosphere sucks moisture from\r\nthe land. Changes in ocean surface temperatures can\r\nalso affect the location of rain-bands and the monsoon\r\ncycles. Climate change models indicate that severe\r\ndroughts are likely to become more frequent in a\r\nwarmer world.\r\nArchaeological and paleoclimatic evidence indicates\r\nthat droughts lasting several years to decades, socalled\r\n“mega droughts”, have been a feature of the\r\nEarth’s climate over the last 10 000 years. Over human\r\nhistory a number of civilisations may have collapsed\r\nbecause of the onset of mega droughts, including early\r\nMesopotamian civilisations and the Maya in Central\r\nAmerica. More recently, the region of Africa bordering\r\nthe south of the Sahara, the Sahel, has experienced\r\na prolonged period of low rainfall since the 1970s, the\r\ncause of several disastrous famines (Fig 1). Since 2003\r\nAustralia has been in the grip of a severe drought,\r\npossibly the fi rst mega drought to hit a modern\r\nindustrialised nation (Fig 2).', NULL, '16.jpg', '16back.jpg', 1, NULL, 'issue', 'active', NULL, 443, 1264474696, 1264474491, 1, 1, 664),
('passive design', '', 1, 4, 'will you cope without air conditioning?', 'In January 2006 the Spanish government\r\nintroduced a working hours directive, which\r\nprevents public sector employees from\r\ntaking a traditional afternoon siesta.\r\nSource: J Ward Anderson and Jennifer Green, Shaking\r\nSpain out of the siesta, 23 April 2006\r\n(c) 2006, The Washington Post. Reprinted with permission.\r\nwww.washingtonpost.com/wp-dyn/content/\r\narticle/2006/04/22/AR2006042201123.html', 'Traditionally Europeans have relied on low-energy\r\n“passive” methods of cooling buildings: solar control\r\n(keeping out the heat of the sun using shades, blinds and\r\nshutters); ventilation (maximising ventilation in the cooler\r\nparts of the day); and thermal mass (storing “coolth” in the\r\nbuilding fabric from night ventilation).\r\nSurveys carried out around the world indicate people\r\ncan be comfortable in the workplace at temperatures up\r\nto around 32°C, depending on the local climate and if\r\nthey are able to take “adaptive actions” such as altering\r\nclothing and opening windows (Fig 1). Historically, even\r\nthese measures were not enough to ensure comfort all the\r\ntime. Siestas were taken in the afternoon and vacations in\r\nthe hottest month of the year. These traditions have faded\r\nwith the development of modern European lifestyles.\r\nAir conditioned buildings are typically designed to\r\ndeliver 22 – 24°C, a design target passive measures\r\ncannot always guarantee. Air conditioning has become\r\na ubiquitous approach to dealing with warm weather\r\nthroughout the world. Japan and the US have seen\r\nwidespread take up of this technology (Fig 2). Air\r\nconditioning is becoming increasingly widespread in\r\nEurope, a trend set to accelerate due to hotter summers\r\nunder global warming.', NULL, '18.jpg', '18back.jpg', 1, NULL, 'issue', 'active', NULL, 441, 1264474669, 1264474465, 1, 1, 664),
('disease', '', 1, 4, 'could you recognise the rash\r\npreceding Lyme disease?', 'The World Health Organization estimates that\r\nthe warming and precipitation trends due to\r\nanthropogenic climate change of the past 30 years\r\nalready claim over 150 000 lives annually.\r\nSource: Patz et al, Impact of regional climate change on human health,\r\nNature, 17 November 2005\r\nwww.nature.com/nature/journal/v438/n7066/abs/nature04188.html', 'Parasitic diseases are likely to become more widespread\r\nand/or severe as the planet warms and moistens. There\r\nis much evidence of associations between climatic\r\nconditions and infectious diseases.\r\nMalaria is the deadliest, most disabling and most\r\neconomically-damaging mosquito-borne disease\r\nworldwide. It is of great public health concern, and seems\r\nlikely to be the vector-borne disease most sensitive to\r\nlong-term climate change. Malaria varies seasonally in\r\nhighly endemic areas, and the link between the disease and\r\nextreme climatic events has long been studied in India.\r\nWest Nile virus is an urban-based, mosquito-borne\r\ninfection, affl icting humans, horses and more than 138\r\nspecies of birds. Present in the US, Europe, the Middle\r\nEast and Africa, recent warm winters and spring droughts\r\nhave played a role in amplifying this disease.\r\nLyme disease is the most widespread vector-borne\r\ndisease in the US and can cause long-term disability. It is\r\nspreading in North America and Europe as winters warm,\r\nand models project that warming will continue to shift the\r\nsuitable range for the deer ticks that carry this infection.', NULL, '17.jpg', '17back.jpg', 1, NULL, 'issue', 'active', NULL, 442, 1264474681, 1264474476, 1, 1, 664),
('international relations', '', 5, 11, 'how independent\r\nis your country?', 'In 1996, the total value of losses to\r\nBurundi two months after sanctions\r\nwere imposed on it by its neighbours,\r\nwas estimated to be at US$165M. The\r\nsanctions had resulted in a reduction\r\nof food production by 30% and a\r\ndecline in industrial growth by 10%.\r\nSource: UN, www.un.org/News/Press/docs/\r\n1996/19961017.gaef2724.html', 'Economic, trade and diplomatic sanctions are\r\nmanifestations of international relationships which can\r\nhave adverse effects on poverty. Sanctions have been\r\nimposed on at least 185 countries since the Second\r\nWorld War. They can be effective, but in some situations\r\ncan serve to exacerbate the problems of the poor.\r\nAcademics estimate that sanctions work in one-third of\r\ncases. They were, for example, effective in South Africa\r\nresulting in the fall of the apartheid regime, and against\r\nSlobodan Milosevic, which hastened the end of the\r\nBosnian war. However, trade and economic sanctions\r\ncan lead to reduced economic growth, increased\r\nunemployment, infl ation, scarcity of goods and reduction\r\nin the availability of key services. In the short-term, these\r\nimpacts can be very pronounced. In already fragile\r\nstates, sanctions can serve to worsen the depth and\r\nlength of suffering of the poor. In 2003, the US imposed\r\ntrade sanctions on Myanmar which is estimated to have\r\ncost Myanmar US$365M a year. It resulted in higher\r\nunemployment and the reduction of already low wages\r\nacross all sectors. As another example, if the EU, through\r\nsanctions, withdrew Sri Lanka’s privileges in terms of duty\r\nfree access to EU markets, 100 000 people in the apparel\r\nindustry would lose their jobs.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 444, 1264475121, 1264474916, 1, 1, 664),
('representation', '', 5, 11, 'who acts on your behalf?', 'The UN notes that for women to be\r\nadequately represented in their country, at\r\nleast 30% of parliamentary seats should\r\nhave a female representative. Only twenty\r\nout of the 192 UN members - including\r\nRwanda, Mozambique and Burundi - have\r\nreached or exceeded the 30% mark.\r\nSource: Human Security Brief 2007\r\nwww.humansecuritybrief.info/fi gures/Figure_2.10.xls\r\n-win-469063.html', 'Representation is the process of ensuring that individuals\r\nhave their views expressed within the main decisionmaking\r\nmachinery of their country, town, village or\r\ncommunity. Representation can be considered in four\r\nways – formalistic, symbolic, descriptive and substantive.\r\nFormalistic representation encompasses the institutions\r\nand processes involved in identifying representatives as\r\nwell as how they are held accountable, while symbolic\r\nrepresentation identifi es the role of the representative\r\nin terms of those being represented. Descriptive\r\nrepresentation describes the extent to which the\r\nrepresentative resembles those being represented, and\r\nsubstantive representation relates to the actual actions\r\ntaken by the representative for the represented.\r\nMillions of women around the world are being denied\r\neffective representation for reasons including the low\r\nnumbers of female politicians, judges and employers.\r\nThis has implications for meeting the Millennium\r\nDevelopment Goals as approximately 70% of the world’s\r\n1.2bn people who are estimated to live in poverty are\r\nwomen and children. Without effective representation,\r\nwomen face discrimination and are placed in a position\r\nwhere they are unable to meet their needs and those of\r\ntheir children. In Japan, female workers earn just 51%\r\nof the wages of their counterparts, while only one in fi ve\r\nmanagers in Italy is a woman.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 445, 1264475147, 1264474943, 1, 1, 664),
('disaster managment', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 446, 1264475184, 1264474980, 1, 1, 664),
('stewardship', '', 3, 11, 'does ownership matter?', 'Over the past 30 years, tree planting on\r\nat least 7.4M acres in Niger has slowed\r\ndesertifi cation. This is due to collective\r\naction by poor farmers and a change in\r\ntenure policies that allows landholders to\r\nown trees.\r\nSource: World Resources Institute; June 2007 Monthly\r\nUpdate: The Importance of Tenure in Sustainable\r\nDevelopment, http://earthtrends.wri.org/updates/nod', 'The poor have limited access to capital, and therefore\r\ndepend on land and natural resources for a number of\r\ntheir needs. These resources are ideal as a source of\r\nincome because they are renewable, widely dispersed\r\nand often found in common property areas where\r\nthe poor can access them freely. More than 1.3bn\r\npeople depend on fi sheries, forests, and agriculture for\r\nemployment. Poverty is often viewed as a driver of land\r\nand natural resource dilapidation. The poor are more\r\nvulnerable to being forcibly moved from common or\r\nancestral lands to marginal lands, where environmental\r\ndegradation is already acute. They therefore bear a\r\ndisproportionate share of the burden of environmental\r\ndecline.\r\nLack of secure tenure is one of the reasons why the poor\r\nare particularly at risk of eviction and loss of access to\r\nenvironmental resources. This limits the incentive for\r\neffi cient resource management. The World Resources\r\n2005 report highlights a number of case studies which\r\ndemonstrate the importance of ownership. For example,\r\ncontrol over restoring 700 000 local acres of denuded\r\nforests and grazing lands was given by the Tanzanian\r\ngovernment to the Sukuma people. This has resulted in\r\nhigher household incomes, improved diets, as well as\r\nincreased populations of tree, bird and mammal species.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 447, 1264475205, 1264475000, 1, 1, 664),
('sanitation', '', 3, 11, 'do you have access\r\nto a toilet?', 'Four out of 10 people around the world\r\nhave no access to improved sanitation.\r\nThey are obliged to defecate in the\r\nopen or use unsanitary facilities, with a\r\nserious risk of exposure to sanitationrelated\r\ndiseases.\r\nSource: Sanitation Challenge - Turning Commitment\r\ninto Reality, www.who.int/water_sanitation_health/\r\nhygiene/sanchallengecomp.pdf', 'Access to sanitation is a basic human right. The Joint\r\nMonitoring Programme (JMP) for water and sanitation of\r\nthe World Health Organization (WHO) and UNICEF has\r\ndefi ned improved sanitation as any of the following:\r\n• connection to a public sewer\r\n• connection to a septic system\r\n• pour-fl ush latrine\r\n• simple pit latrine\r\n• ventilated improved pit latrine\r\nAccording to the WHO/UNICEF JMP on Water Supply\r\nand Sanitation, there are currently 2.5bn people worldwide\r\nwho lack access to improved sanitation. This is linked\r\nto poverty along fi ve main dimensions, including health,\r\neducation, gender, social inclusion and productivity.\r\nDiarrhoeal diseases account for more deaths amongst\r\nchildren in developing countries than HIV/AIDS, measles\r\nand malnutrition. The health effects of poor sanitation\r\nhave implications for income generation and productivity\r\nas it contributes to loss of work days. It is estimated\r\nthat 443M school days are missed each year due to\r\nsickness from diarrhoeal diseases. Poor sanitation has a\r\ndisproportionate effect on the schooling of girls. The UN\r\nestimates that half of girls who stop attending primary\r\nschool in Africa do so because of the lack of toilets.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 448, 1264475223, 1264475019, 1, 1, 664),
('markets', '', 4, 11, 'which countries will you\r\nbuy from today?', 'In the Windward Islands in the Caribbean,\r\nthose employed in the export of bananas to\r\nthe UK fell from 25 000 to 5000 over the period\r\nbetween 1995 and 2004. This declining trend\r\nis mainly due to a deterioration of preferential\r\naccess to EU markets.\r\nSources: FAO Banana Statistics, www.fao.org/es/ESC/\r\ncommon/ecg/192/en/BAN_STAT_06.pdf; Banana Link\r\nwww.bananalink.org.uk/content/view/59/19/lang.en', 'International trade is equivalent to over 50% of the GDP\r\nof the Least Developed Countries (LDCs) as a group. They\r\nare mainly engaged in the production of low-cost primary\r\nproducts for export such as coffee, which is one of the\r\nmost important commodities for developing countries. In\r\n2004 global exports of coffee exceeded US$9bn and the\r\nsector employed more than 25M people. In 2006/7\r\nCôte D’Ivoire produced 1.3M tonnes of cocoa - the\r\ngreatest proportion of global production of cocoa. In\r\nDominica, 20% of workers are in the agricultural sector\r\nand Dominica’s primary agricultural exports include\r\ntobacco, bananas, vegetables, citrus and copra. For\r\nmany of these products, prices are determined on volatile\r\ninternational markets.\r\nThe share of global imports and exports accounted for by\r\nleast developed countries fell from 0.8% in 1980 to 0.4%\r\nby 2000. Increased competition amongst developing\r\ncountries to supply the limited number of developed\r\ncountry markets can set in motion what is known as the\r\n“race to the bottom”. By competing with each other they\r\ncontinuously push the price of their own products down.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 449, 1264475249, 1264475044, 1, 1, 664),
('financial services', '', 4, 11, 'who would lend you money?', 'About 21% of borrowers using Grameen Bank\r\n(a microfi nance institution in Bangladesh) and\r\n11% of borrowers using the Bangladesh Rural\r\nAdvancement Committee (a microfi nance NGO)\r\nmanaged to lift their families out of poverty within\r\nfour years of participation in microfi nance.\r\nSource: Asian Development Bank, www.adb.org/Documents/\r\nPolicies/Microfi nance/microfi nance0100.asp?p=policies', 'Financial services can be grouped into four categories:\r\ntransaction banking, savings, credit and insurance. Lack\r\nof access to these fi nancial services limit the ability of the\r\npoor to accumulate assets, manage risk and engage in\r\nentrepreneurial activity.\r\nIn diffi cult times the poor may be forced to sell assets\r\nto maintain a minimum level of consumption. This act\r\nkeeps the poor trapped in a cycle of poverty as they are\r\nunable to build up their asset base and progressively\r\nlift themselves out of poverty. Access to credit enables\r\nentrepreneurs to acquire basic inputs for business activity.\r\nSmall entrepreneurs typically pay very high real interest\r\nrates which is indicative of the potential high returns from\r\ntheir investments.\r\nThe poor typically have no defence against shocks such\r\nas illness, unemployment, or poor harvests. Financial\r\ninstruments, such as low-cost insurance, can provide\r\nthe poor with protection against such risk and limit the\r\nneed to rely on alternatives such as depleting assets,\r\npulling children out of school or using loan sharks. The\r\nworldwide unbanked market is estimated to be in excess\r\nof 2bn people. In Latin America and the Caribbean 14.5%\r\nof poor households have a savings account and 3.3%\r\nhave access to credit. In the UK and US over 10% of the\r\npopulation is “unbanked”.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 450, 1264478462, 1264478257, 1, 1, 664),
('collection', '', 5, 3, 'is your waste collected?', 'In Dar es Salaam only 25%\r\nof waste is collected and in\r\nKarachi, Pakistan, only 40%.\r\nIn Nairobi waste collection\r\nhas fallen from 90% to 30%\r\nbetween 1978 and 1998.\r\nSource: www.orionsociety.org/pages/\r\nom/06-2om/Davis.htm\r\nwww.countercurrents.org/hrwhelan190204.\r\nhtm', 'Waste collection is a basic public service performed by\r\nmany countries. A signifi cant number of people however\r\ndo not receive this service. Even in the developed world\r\nnot everyone is served by waste collection services, for\r\nexample in Greece the rate is only 85%.\r\nIn the developing world waste collection is a signifi cant\r\nproblem as governments are fi nding it increasingly diffi cult\r\nto keep up with the volume as populations increase\r\nand more people move into urban areas. Slums are of\r\nparticular concern as their confi guration often means that\r\nwaste collection is impossible. UN researchers estimate\r\nthat there were at least 921M slum dwellers in 2001 and\r\nmore than 1bn in 2005.\r\nIn Dhaka, Bangladesh, 10M people generate 3500 tonnes\r\nof waste a day, which is beyond what the municipality can\r\ndeal with. In the slums where 30% of the population live\r\nthere is no municipal waste collection. Accumulating piles\r\nof waste leads to the spread of fl y-borne diseases such\r\nas typhoid, dysentery, diarrhoea and cholera. Storms can\r\nalso wash waste into the water source. It is estimated that\r\ninternationally 6000 people die every day from preventable\r\nwater-borne diseases.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 451, 1264478483, 1264478278, 1, 1, 664),
('minimisation', '', 5, 3, 'is zero waste achievable?', 'In the developed world waste generation grew by\r\n20% between 1980 and 2000 and is expected to\r\nhave increased by a further 30% by 2020.\r\nSource: Rob Bowden, Sustainable world – waste, 2004', 'When devising a waste management strategy most\r\ngovernments use the waste hierarchy. This prioritises\r\nwaste reduction and prevention, then its reuse and\r\nrecycling/composting and energy recovery, followed by\r\nfi nal disposal as a last option. Although on paper it is\r\nstated that waste minimisation is the top priority most\r\ncountries have failed to achieve in this area and the focus\r\nremains on recycling. The average resident of an OECD\r\ncountry produces 560kg of municipal waste per year.\r\nEven for countries seen as leaders in environmental policy,\r\nsuch as Norway, reducing waste fl ows is a continuing\r\nchallenge. In 2002 the average Norwegian generated\r\n354kg of waste, 7% more than the previous year.\r\nWaste minimisation can be achieved through either\r\nchanging the manufacturing process or reducing\r\nconsumption. Improved technology means that many\r\nproducts can now be made thinner and lighter, a\r\nprocess called “light weighting”. For example, a steel\r\ndrinks can produced in 1998 was 30% lighter than one\r\nmanufactured in 1993 and aluminium cans which once\r\nweighed almost 100g in 1935 now weigh only 15g.\r\nComposting, the natural breakdown of organic waste into\r\na nutrient rich soil is another method of minimising waste\r\nsent to landfi ll. In the UK, 38% of municipal waste is\r\nthought to be organic and less than 3% is composted.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 452, 1264478493, 1264478288, 1, 1, 664),
('exportation', '', 5, 3, 'who gets your trash?', '90% of waste exported in 2000\r\nwas classifi ed as hazardous. Up\r\nto 75% of the electronic waste\r\nshipped to Africa for reuse is\r\nunusable and ends up being\r\ndumped and burned.\r\nSource: UN Environment Programme, Vital\r\nwaste graphics 2, 2006 and The Basel\r\nAction Network, Digital dump: exporting\r\nre-use and abuse to Africa, 2005', 'Waste, including extremely hazardous materials, is\r\nroutinely transported across the globe. China is the\r\nworld’s biggest waste importer receiving 4bn tonnes of\r\nplastic waste, 12bn tonnes of waste paper and 10bn\r\ntonnes of scrap iron and steel in 2004. Within Europe,\r\nGermany is the biggest waste importer receiving\r\napproximately 4.15M tonnes of waste in 2003 with 98%\r\noriginating in Western Europe. The Basel Convention\r\nreported an increase in hazardous waste movement from\r\n2M to 8.5M tonnes between 1993 and 2001. Of the 99\r\nreporting countries in 2003, 62 exported and 37 imported\r\nhazardous waste.\r\nExport of hazardous waste to the developing world\r\nis of particular concern and the Basel Convention\r\nwas adopted in 1989 to try and combat this problem.\r\nHowever, inspection of 18 European seaports in 2005\r\nfound 47% of waste destined for export was illegal. In\r\nthe US, 50 - 80% of E-waste collected for recycling is\r\nexported with the majority being sent to Asia where it\r\noften arrives unusable. Electronic devices are a complex\r\nmixture of hundreds of materials including toxic heavy\r\nmetals such as lead, mercury, cadmium and beryllium and\r\nhazardous chemicals such as bromide fl ame retardants.\r\nThese substances cause serious pollution and put\r\nworkers at risk when they are dismantled.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 453, 1264478506, 1264478301, 1, 1, 664),
('producer responsability', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 454, 1264478521, 1264478316, 1, 1, 664),
('livelihood opportunity', '', 4, 11, 'how do you make\r\nends meet?', 'In 2003, the Indian Diaspora (20M, over 135\r\ncountries) sent home a combined amount\r\nequivalent to some US$15bn, or more than\r\nrevenues generated by India’s thriving software\r\nindustry.\r\nSource: Human Habitat – Migration: Remittances: Facts and\r\nFigures, October 2006', 'Livelihood opportunity refers to the “choices” people\r\nhave in generating income to meet their basic needs. This\r\nincludes a range of activities such as entrepreneurship,\r\ninformal and formal employment. Article 23 and 24 of\r\nthe Declaration of Human Rights establish livelihood\r\nopportunity as a basic human right. Article 23 (1)\r\nspecifi cally notes the human right to work, free choice of\r\nemployment, and protection from unemployment. Global\r\nunemployment is most severe amongst young people\r\naged 15 to 24 and women. In 2007, 74% of male over-\r\n15-year-olds were working compared to 49% of women.\r\nIn the UK almost one in seven children live in households\r\nwhere no one works.\r\nFor years people have sought employment outside their\r\nhome countries thereby expanding their opportunities.\r\nRemittances are transfers of money by foreign workers to\r\ntheir home countries. They are not a new phenomenon.\r\nSpain, Italy and Ireland were heavily dependent on\r\nremittances during the 19th and 20th centuries. In the\r\ncase of Spain, they amounted to 21% of its current\r\naccount income in 1946. Today, remittances constitute\r\nthe second largest fi nancial infl ow to many developing\r\ncountries, exceeding international aid. Estimates show\r\nthat remittance fl ows to developing countries were\r\nUS$251bn in 2007, up 11% from 2006.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 455, 1264478524, 1264478319, 1, 1, 664),
('polluted waters', '', 3, 3, 'do you swim in the ocean?', 'In the EU 17% of coastal waters and 70% of inland waters fall\r\nbelow safe standards for recreational bathing.\r\nSource: Rob Bowden, Waste recycling and reuse: Our impact on the planet, 2003', 'A wide variety of different waste materials are dumped\r\ndirectly into the oceans. The most toxic of these include\r\ndredged materials, industrial wastes, sewage effl uent,\r\nash from special incinerator ships and radioactive waste.\r\nDredging constitutes 80% of such wastes and can be\r\ncontaminated with heavy metals such as cadmium,\r\nmercury and also hydrocarbons and organocholorides.\r\nOther wastes fi nd their way into the water system when\r\nthey are absorbed by rainwater passing through the soil\r\nor as run off from streets, fi elds and buildings. Disposing\r\nof waste in water was once thought to be safe. It was\r\nassumed it would become harmless when diluted and\r\nspread over a wide area. It was also a popular option\r\nbecause it was cheaper and less viable than treating\r\nwaste on land.\r\nRubbish dumped in the sea is a hazard to boats and\r\ndivers and most importantly poses a threat to marine\r\nwildlife. It is estimated that 90% of marine rubbish found\r\non coasts worldwide is related to drinks such as bottles,\r\ncaps, straws and cans. Plastics make up 60% of sea\r\nrubbish and cause the most problems killing an estimated\r\n100 000 marine mammals and turtles each year. Seabirds\r\nare also at danger from plastics with an estimated\r\n700 000 to 1M killed worldwide every year.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 456, 1264478537, 1264478333, 1, 1, 664),
('cost of living', '', 4, 11, 'can you afford the basics?', 'In Nairobi, residents connected to\r\nmunicipal supplies pay on average\r\n30 cents per cubic metre of water,\r\nwhile the poor have to pay private\r\nvendors up to six times that price.\r\nSource: UN Chronicle Online Edition, 2001\r\nwww.un.org/Pubs/chronicle/2001/issue1', 'Within a modern economy people usually have to pay for\r\ntheir basic needs. Poverty lines represent the minimum\r\namount of income necessary to afford an “acceptable”\r\nstandard of living. This would include adequate food,\r\nwater, energy, clothes, shelter, education and healthcare.\r\nThe World Bank has recently revised the global poverty\r\nline to US$1.25 a day.\r\nAn increase in the cost of living has a direct effect on the\r\nnumber of people classifi ed as poor with many being\r\npushed deeper or falling into poverty. The UK charity\r\nElizabeth Finn Care gives grants to help counteract\r\npoverty. Between March and April 2008 requests for\r\ngrants from the charity increased 400 per cent. This rise\r\nwas attributed to increasing costs of fuel, food and other\r\nbasic needs.\r\nActionAid estimates that the rise in commodity prices\r\nsince 2006 has directly pushed 760M people into risk of\r\nhunger. In 2007 the price of rice in Haiti increased 50%\r\nforcing families to resort to consuming “mud cakes”,\r\nwhich have traditionally been consumed by impoverished\r\npregnant women seeking calcium. The UN’s Food and\r\nAgriculture Organization predicts Haiti’s food import bill\r\nwill leap 80% in 2008, the fastest in the world.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 457, 1264478544, 1264478339, 1, 1, 664),
('methane', '', 3, 3, 'is your garbage warming\r\nthe planet?', 'Methane, the gas produced through the decomposition of\r\norganic waste in landfi ll sites, has a global warming potential\r\n23 times higher than carbon dioxide.\r\nSource: Methane UK Environmental Change Institute, University of Oxford, 2006', 'When waste biodegrades in the absence of air in a landfi ll\r\nsite both methane and carbon dioxide are generated. In\r\nEurope, 60-70% of municipal waste is biodegradable\r\nand 65% of this is sent to landfi ll. In the UK landfi ll sites\r\nare responsible for 22% of UK methane which has a\r\nglobal warming potential 23 times that of carbon dioxide.\r\nIt is estimated that one tonne of biodegradable waste\r\ngenerates 200 – 400m³ of landfi ll gas.\r\nGreenhouse gases (GHGs) are produced at every stage in\r\nthe production process from the extraction of raw materials,\r\ntransport, manufacturing, use, to fi nal treatment of waste\r\nand its disposal. Waste prevention is the most important\r\nmanagement technique in terms of GHGs as it prevents\r\nemissions at every stage in a product’s life cycle. Although\r\nrecycling and composting do not avoid greenhouse gases,\r\nif managed well both options offer signifi cant advantages.\r\nWhilst recycling demands energy the associated\r\ngreenhouse gases are often much lower in comparison to\r\nthose offset from both the production of raw materials and\r\nthe disposal of materials to landfi ll. For example copper\r\nrecycling reduces average energy requirements by 85%\r\nand plastic recycling by 80%. Composting also reduces\r\ngreenhouse gases as it is largely aerobic and produces\r\ncarbon dioxide instead of methane.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 458, 1264478550, 1264478345, 1, 1, 664),
('long-term persistence', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 459, 1264478567, 1264478362, 1, 1, 664),
('manufacturing', '', 2, 11, 'should a machine\r\ndo your job?', '“I can make any car. Ask me. A Mercedes\r\nBenz? I need the engine but the body I\r\ncan build it. It would take me two or three\r\nweeks to complete it, if you bring the\r\nengine and chassis.”\r\nSource: Frank Darko, Ghanaian mechanic', 'In developed countries the importance of manufacturing\r\nas an employer has been rapidly declining since the\r\n1970s in favour of the services sector. This has been\r\ndue to a number of factors, including the shifting of\r\nmanufacturing to newly industrialising countries and the\r\nadoption of advanced machinery that reduces the need\r\nfor large workforces. In 2006 and 2007, global productivity\r\ngrew around 26% whilst employment only grew by about\r\n16.6%. In areas where manufacturing was the main\r\nincome earner and which have failed to move to a new\r\neconomy based on other sectors, entire neighbourhoods\r\ncurrently face multiple forms of deprivation.\r\nIn developing countries large- to micro-scale\r\nmanufacturing continues to be an important income\r\nand employment generator. Micro-scale manufacturing\r\nincludes metal shops, home-based textile production,\r\ncraft products and repair shops. These businesses\r\ntypically employ less than ten people and are usually\r\nsingle-person or family-led. Capital investment is\r\nimportant for expansion and accessing new markets.\r\nHowever, the adoption of advanced technology by a few\r\nhigh-income companies can serve to squeeze smaller\r\nproducers out of the market.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 460, 1264478568, 1264478363, 1, 1, 664),
('unseen impact', '', 3, 3, 'what’s the true weight of\r\nyour diamond?', 'The amount of material involved in producing a diamond is\r\nequal to 53M times its own weight.\r\nSource: DTI, Key technology area: Sustainable production and consumption\r\nwww.dti.gov.uk/fi les/fi le27991.pdf', 'The products we buy are responsible for vast amounts of\r\nwaste before they enter our homes. Waste is generated\r\nin the extraction of raw materials, the manufacture\r\nof products and as packaging when products are\r\ntransported. This hidden waste associated with products\r\nor materials is often termed the “ecological rucksack”\r\nand as an example, a single gold ring weighing 3g will\r\nleave behind a staggering three tonnes of toxic mining\r\nwaste. The extraction of the metals contained in a PC\r\nproduces a total of 1.5 tonnes of waste and a toothbrush\r\nis responsible for 1.5kg of unseen waste.\r\nMining for raw materials, the fi rst step in the manufacture\r\nof many products, is responsible for a signifi cant portion\r\nof an item’s ecological rucksack. In the EU mining\r\nwaste constitutes 29% of the total waste stream at a\r\nstaggering 400M tonnes of material. Minerals exist at\r\nlow concentrations and need to be extracted from rock\r\nvia chemical and/or physical processes leaving residual\r\nmaterial called “tailings” which can be hazardous or toxic.\r\nFor example, when mining for copper, bauxite, lead or tin\r\nover 75% of the excavated material ends up as tailings. In\r\nthe Amazon, mercury is used to extract gold from gravel.\r\nIt is estimated that 130 tonnes of toxic mercury waste is\r\nreleased into the environment every year.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 461, 1264478581, 1264478376, 1, 1, 664),
('green procurement', '', 4, 3, 'how many recycled products\r\ndo you buy?', 'McDonalds spent more than US$3bn on recycledcontent\r\npurchases between 1990 – 1999 including\r\ntrays, tables, carpeting and packaging.\r\nSource: State of the World 2004, The Worldwatch Institute\r\nwww.worldwatch.org', 'Through the things they buy, institutions have great\r\ninfl uence. Public purchasing in industrialised countries\r\naccounts for up to 25% of GDP and in the EU government\r\nprocurement reached a total of more than US$1 trillion\r\nin 2001 and in North America it reached US$2 trillion.\r\nGreen procurement is the process where buyers place\r\nenvironmental demands on their suppliers and by this\r\nmeans they can shift markets. For example in 1998 the\r\nAmerican government set a standard demanding the\r\nrecycled content of all federal paper to be 30%. This\r\ngenerated a shift in recycled content of federal paper\r\nfrom 10% in 1994 to 30% in 2000 and also increased\r\nconsumption of recycled paper from 12% to 90%. The\r\nincreased government demand also boosted the overall\r\nmarket standard for recycled content in the country.\r\nThere are now more than 4500 recycled content\r\nproducts available and buying recycled products is the\r\nimportant fi nal stage in the recycling process as it is\r\neffectively “closing the loop”. Many countries are taking\r\nthis on board and Denmark is a world leader in green\r\nprocurement with a law in place since 1994 requiring all\r\nnational and local authorities to use recycled or recyclable\r\nproducts.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 462, 1264478596, 1264478391, 1, 1, 664),
('physical infrastructure', '', 2, 11, 'does transportation\r\nimprove your life?', 'Research in Morocco has shown that new roads\r\nincrease female primary school enrolments, from\r\n28% to 68%, by making travel to school safer.\r\nSource: Transport, the Missing Link?, id21 Insights\r\nwww.id21.org/insights/insights63/art00.html', 'Physical infrastructure refers to the basic systems and\r\nservices, such as water supply, drainage, transport and\r\npower supplies, that a country or organisation uses\r\nto work effectively. Infrastructure can be regarded as\r\nthe “skeleton” of an economy. It infl uences poverty in\r\nthree main ways: through its delivery and construction;\r\nrobustness; and usability. The impact of delivery on\r\npoverty is dependent on the type of technology employed\r\n(labour- or machine- intensive delivery). Road building\r\nand maintenance can generate signifi cant amounts of\r\nemployment if labour-intensive methods are used. In\r\nthe case of rural roads, one job is generated for every\r\n2.5 kilometres that need maintaining.\r\nIn terms of robustness, the technology employed in\r\ndelivering physical infrastructure projects should take\r\ninto account cultural and environmental contexts.\r\nInfrastructure delivery also needs to factor in longterm\r\nmaintenance to ensure that the systems function\r\neffi ciently over time. Physical infrastructure is important\r\nfor mobility, facilitating livelihoods and access to services.\r\nWorkers located in Tokyo travel an average of 26 km to\r\nwork which takes on average 66.9 minutes one way; in\r\nrural Sri Lanka women can spend 7 hours a day travelling\r\nwithin ten kilometres of their home, collecting water and\r\nfi rewood, and going to local markets.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 463, 1264478598, 1264478393, 1, 1, 664),
('hidden costs', '', 4, 3, 'would you throw your money\r\ndown the drain?', 'The Environmental Technology Best Practice Programme\r\nestimated the waste costs of UK industry to be at least\r\n£15bn/year - equivalent to some 4.5% of total turnover.\r\nSource: Environmental Technology Best Practice Programme, Waste\r\nminimisation pays: Five business reasons for reducing waste, 1998', 'Reducing waste not only benefi ts the environment but\r\nmakes good business sense too. It is estimated that the\r\nmajority of companies can save up to £1000 per employee\r\nper year by tackling waste minimisation. The true costs\r\nof waste are not just related to disposal. They include\r\n“hidden” costs such as the purchase of unused materials,\r\nhandling and processing costs, management and time, lost\r\nrevenues or potential business liabilities and risks.\r\nThe waste generated by construction, demolition,\r\nexcavation and refurbishment in the UK amounts to\r\nover 100M tonnes per year, a third of the country’s total\r\nwaste production. Around 15.6m³ of waste is generated\r\nin the construction of a typical UK semi-detached house\r\n- equivalent to 5 skips. The fi nancial cost of this is in the\r\nregion of £6700, made up of skip hire (6.4%), the materials\r\nthat fi ll it (85.1%) and labour (12.1%). In 2004, 190 000\r\nhouses were built in the UK incurring a loss of £1.2bn of\r\nwhich £1bn was for wasted products with an equivalent\r\nimpact of over 1M tonnes of carbon dioxide emissions. In\r\ncontrast, the implementation of a site waste management\r\nplan can result in 43% less waste sent to landfi ll, 15% less\r\non site and a 50% saving in waste handling charges.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 464, 1264478606, 1264478401, 1, 1, 664),
('ICT', '', 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 465, 1264478613, 1264478408, 1, 1, 664),
('pay-as-you-throw', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 466, 1264478621, 1264478416, 1, 1, 664),
('new product life', '', 2, 3, 'what’s your fl eece made from?', 'The average fl eece jacket may contain the re-used\r\nmaterial from around 25 plastic drinks bottles.\r\nSource: Rob Bowden, Sustainable World – Waste, 2004', 'The ability to recycle depends on the material and the\r\nmarket. Glass, paper and metals are relatively easy to\r\nrecycle but plastics are much harder as there are many\r\ndifferent types that cannot be mixed. Innovative new\r\nmethods are being developed to convert these plastics\r\nsuch as high density polyethylene (HDPE), which is used\r\nfor shampoo bottles, into a strong durable material known\r\nas plastic lumber used for foot bridges and park benches.\r\nTyres are also being recycled in new ways. Globally 750M\r\nto 1bn tyres are scrapped every year weighing 6 – 10M\r\ntonnes. New technology is fi nding novel uses for this\r\nwaste stream. Tyres are broken down into a substance\r\ncalled rubber crumb which can be used to make shock\r\nabsorbent surfaces for playgrounds, the rubber backing\r\nfor carpets and fl oor tiles or can be mixed with asphalt to\r\nmake road surfaces.\r\nUnless products can be disassembled and the materials\r\nseparated they cannot be recycled. Active disassembly\r\nuses smart materials such as shape memory polymers that\r\nchange their shape at a “trigger temperature”. For example,\r\nif designed for active disassembly, mobile phones could\r\nbe dropped into a special tumble dryer where they are\r\nheated to a trigger temperature and within seconds they\r\nare dismantled allowing plastics to be recycled and toxic\r\ncomponents to be dealt with appropriately.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 467, 1264478640, 1264478435, 1, 1, 664),
('household amenities', '', 2, 11, 'how do you prepare\r\nyour meals?', 'Cooking with solid fuels on open fi res or\r\ntraditional stoves can result in high levels of\r\nindoor air pollution. According to the 2002 World\r\nHealth Report indoor air pollution is the second\r\nbiggest environmental contributor to ill health.\r\nSource: World Health Organization, www.who.int/indoorair/\r\nhealth_impacts/burden_global/en/index.html', 'Household amenities include technologies used for\r\ncooking, heating and lighting. These amenities depend on\r\naccess to reliable, safe and affordable sources of energy.\r\nMillions of people living in developing countries have no\r\naccess to modern energy, limiting their opportunities and\r\nthreatening their lives.\r\nBiomass – wood, charcoal and organic waste – is\r\nthe main energy source for cooking for 3bn people,\r\npredominantly in low-income countries. Cooking is usually\r\nundertaken indoors using traditional three-stone cooking\r\nfi res, which presents a number of health risks associated\r\nwith poor indoor air quality. The inability to extend the\r\nworking day using artifi cial light affects educational\r\nattainment and productivity. During the past 25 years\r\nelectricity supplies have been provided to 1.3bn people\r\nliving in developing countries, yet 1.6bn or one-quarter of\r\nthe world’s population have no access to electricity with\r\nmore than 99% living in developing countries.\r\nThe implications of access to household amenities are\r\nnot restricted to low-income countries. High-income\r\ncountries face the challenge of unaffordable energy prices.\r\nAccording to the consumer group Energywatch, about\r\n1 in 6 British households is fuel poor.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 468, 1264478641, 1264478436, 1, 1, 664),
('biological treatment', '', 2, 3, 'when is waste edible?', 'There are more than 36 000 hazardous waste sites in\r\nthe US. Clean-up is expected to cost US$200-$500bn.\r\nSource: http://commtechlab.msu.edu/sites/dlc-me/zoo/zdtmain.html', 'Biological processes are often used to assist in the\r\nbreakdown of organic waste. Three types of microorganisms\r\nare involved in composting. They assimilate the\r\nsugars, starch and organic acids, and in doing so break\r\ndown the waste and generate temperatures over 60°C.\r\nAnaerobic digestion uses micro-organisms to breakdown\r\nwaste in the absence of oxygen, producing methane as a\r\nby-product which can be used as an energy source.\r\nBioremediation uses microorganisms, green plants or their\r\nenzymes to remediate contaminated land. Geobacter, for\r\nexample, passes electrons onto metals to get energy from\r\nfood in the same way that humans use oxygen. In doing\r\nso they can destroy petroleum based contaminants or\r\nlandfi ll leachate by oxidising them into harmless carbon\r\ndioxide. Geobacter can also remove radioactive uranium\r\nfrom groundwater by transforming it into an insoluble\r\nform that falls out of groundwater reducing uranium\r\ncontamination by 70% in 50 days. Phytoremediation\r\nis the process whereby plants bioaccumulate toxins in\r\ntheir parts above ground which are then removed and\r\nsafely disposed of. Thlaspi, a member of the broccoli and\r\ncabbage family, thrives on soils with high levels of zinc\r\nand cadmium accumulating up to 30 000 parts per million\r\n(ppm) zinc and 1500 ppm cadmium.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 469, 1264478657, 1264478452, 1, 1, 664),
('energy resource', '', 2, 3, 'when will waste be used\r\nto heat your home?', 'The energy produced by the 400 incinerators in\r\nEurope is enough to provide over 27M inhabitants\r\nwith electricity or 13M inhabitants with heat.\r\nSource: Cyclope and Veolia, From waste to resource: An abstract of\r\nworld waste survey, 2006', '“Energy from waste” is the process whereby embodied\r\nenergy in the waste is converted into electricity and heat.\r\nThere are a number of different techniques. Incineration is\r\nthe controlled burning of mixed waste, reducing it to 25%\r\nof its weight and 10% of its volume. Of the wastes burnt,\r\nplastics, paper and textiles have the highest calorifi c\r\nvalue. Incineration produces steam for heating buildings or\r\ngenerates electricity. Many factories use this technique to\r\nboth cut waste output and generate some of the energy\r\nthey require for production. Globally there are more than\r\n600 incinerators in 35 different countries treating 170M\r\ntonnes of waste and generating the equivalent of 220M\r\nbarrels of oil. 70% of this is incinerated in Europe, USA\r\nor Japan. More advanced thermal treatment includes\r\ngasifi cation and pyrolysis which heat waste under\r\ncontrolled conditions to generate fuel gas.\r\nMechanical Biological Treatment (MBT) has become a\r\npreferred option for many and involves the combination\r\nof both mechanical and biological processes and the\r\ngeneration of a refuse derived fuel (RDF). Greenpeace\r\nstates that MBT can help divert 85% of waste from landfi ll\r\nwithout the need for incineration.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 470, 1264478670, 1264478465, 1, 1, 664);
INSERT INTO `card` (`name`, `safe_name`, `category_id`, `topic_id`, `question`, `factoid`, `description`, `image`, `card_front`, `card_back`, `origin_event_id`, `uri`, `type`, `status`, `params`, `id`, `ctime`, `mtime`, `owner`, `group`, `perms`) VALUES
('industrial symbiosis', '', 2, 3, 'when does waste become\r\na resource?', 'Since April 2005 the UK’s National Industrial\r\nSymbiosis Programme (NISP) has diverted over\r\n2.2M tonnes of waste from landfi ll, eliminated\r\n311 000 tonnes of hazardous waste, avoided\r\nthe use of 4.8M tonnes of virgin materials and\r\nreduced CO2 emissions by 2.1M tonnes.\r\nSource: www.nisp.org', 'Human economies follow a pattern of cradle to grave.\r\nRaw materials are extracted and processed and the\r\nsubstances not directly useful become waste. An\r\nalternative “cradle to cradle” system seeks to build closed\r\nloop systems where the regenerative cycles of nature\r\nprovide a model for positive human design. The ultimate\r\ngoal is to achieve a waste-free industrial system where all\r\nwastes become another product.\r\nThis is best represented in the Danish industrial town of\r\nKalundborg where the oil refi nery provides the coal fi red\r\npower station with its treated wastewater for use in its\r\ncooling process. In return the power station supplies the\r\nwaste steam for use in the oil refi ning process. This waste\r\nsteam is also used to supply 20 000 households with\r\nheating. Waste gases from the refi nery are re-used by the\r\npower station and by Gyproc, a company which makes\r\nplasterboard. Gyproc purchases waste material from\r\nthe power station in the form of Gypsum. Other partners\r\ninclude a local fi sh farm, commercial greenhouses and a\r\nchemicals company. It is estimated that the companies\r\nhave reduced yearly consumption of oil by 45 000 tonnes,\r\ncoal by 15 000 tonnes, water by 25% and the production\r\nof ash waste by 80 000 tonnes.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 471, 1264478687, 1264478482, 1, 1, 664),
('life expectancy', '', 1, 11, 'how long will you live?', 'Every year more than 10M children in low- and\r\nmiddle-income countries die before they reach\r\ntheir fi fth birthdays. Most die because they do not\r\nhave access to effective interventions that would\r\ncombat common and preventable childhood\r\nillnesses.\r\nSource: World Health Organization, An evaluation of infant\r\nimmunization in Africa: is a transformation in progress?\r\nwww.who.int/bulletin/volumes/85/6/06-031526/en/index.html#R1', 'Health is a state of complete physical, mental and social\r\nwell-being. It is a goal of poverty alleviation as well as a\r\nkey development input towards other goals. The World\r\nHealth Organization (WHO) Constitution identifi es the\r\n“enjoyment of the highest attainable standard of health”\r\nas “one of the fundamental rights of every human being”.\r\nBetween 1950 and 2006, average global life expectancy\r\nat birth increased by almost 20 years, from 47 years in\r\n1950-1955, to 67 years in 2006. However, average life\r\nexpectancy in low-income countries in 2006 was 59 years\r\ncompared to 80 years in high-income countries. In 1998,\r\nin Sub-Saharan Africa, women lived longer than men\r\nby as much as 7 years. However, it is projected that in\r\n2008, men will live longer than women by about 2 years.\r\nThis is due to the fact that HIV/AIDS infection rates in\r\nSub-Saharan Africa have been growing far more rapidly\r\nfor women than for men. Women now account for 57% of\r\nHIV infections in the region.\r\nThe WHO notes that progress on health depends on\r\nstrong healthcare systems. The US does not have a\r\nuniversal healthcare system, yet it spends more on\r\nhealthcare than any other nation in the world. US citizens\r\nrely on health insurance as a means of fi nancing health\r\ncosts. In 2007, about 45.4M people, or 15.3% of the\r\npopulation, did not have health insurance.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 472, 1264478687, 1264478482, 1, 1, 664),
('shelter', '', 1, 11, 'where will you sleep tonight?', 'Some 35M new housing units are needed\r\nannually – or 95 000 units daily – to meet the\r\nworld’s urban housing need.\r\nSource: Habitat for Humanity, www.habitatforhumanity.org.uk', 'It is difficult for people to be productive members of\r\nsociety without a decent place to live. Poor quality\r\nshelter is associated with health risks, greater\r\nlikelihood of morbidity and premature death. The\r\nmarginal location of low-income neighbourhoods\r\nincreases the costs of securing livelihoods, adding\r\nto the diffi culties of obtaining adequate incomes and\r\nimproving housing situations.\r\nThe lack of affordable housing options means that\r\nlow-income households often have to rent poor quality\r\naccommodation, build informally and sometimes\r\nillegally, or live in unplanned, informal settlements. In\r\n2005, one out of three urban dwellers was living in\r\n“slum conditions”. This means they were lacking at\r\nleast one of the basic properties of decent housing\r\nincluding adequate sanitation, improved water supply,\r\ndurable housing or adequate living space.\r\nHousing is an expensive commodity globally. Between\r\n1997 and 2004, average housing prices grew by 60%\r\nin the US, 90% in France, 131% in Spain, 147% in\r\nthe UK, and 195% in South Africa. In high-income\r\ncountries, the cost of a dwelling can often be 2.5 to 6\r\ntimes the average annual salary, while in low-income\r\ncountries, it can be as much as 10-12 times the\r\naverage annual salary.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 473, 1264478701, 1264478497, 1, 1, 664),
('planned obsolescence', '', 2, 3, 'are your products designed to last?', 'When asked why they replaced their old computer,\r\nonly 27% of people gave the reason that their\r\nPC was no longer working in contrast to 38% of\r\npeople who replaced their computer because it\r\nwas out of date.\r\nSource: Ipsos MORI Social Research Institute, International public\r\nattitudes towards computer purchasing and the environment, 2006', 'Planned or built-in obsolescence is the conscious\r\ndecision to produce a consumer product that will\r\nbecome obsolete and/or non-functional in a defi ned\r\ntime frame. It is estimated that for every new computer\r\nput on the US market in 2005 one became obsolete. In\r\n2004 an estimated 315M working computers were made\r\nredundant in North America alone and of these only\r\n10% were reused and refurbished, the remainder being\r\ndisposed of in landfi lls. This is a signifi cant increase\r\nfrom the 63M working computers disposed of in 2003.\r\nIn 1997 a PC lasted 6 – 7 years but in 2003 people\r\nexpected to discard their Pentium class computer after\r\njust 2 – 3 years of use.\r\nBut it is not just computers that are discarded for the sake\r\nof upgraded technology. On average Americans change\r\ntheir mobiles every two years and in Europe they are\r\nonly kept for an average of 18 months. In the US it was\r\nestimated that 100M phones were discarded in 2005.\r\nThis 50 000 tonnes of still useable technical equipment\r\njoined another 200 000 tonnes already awaiting disposal.\r\nThe impact of this waste is signifi cant. The cadmium, for\r\nexample, from a single battery is suffi cient to pollute\r\n600 000 litres of water (about a third of an Olympic\r\nswimming pool).', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 474, 1264478709, 1264478504, 1, 1, 664),
('security', '', 1, 11, 'how safe are you?', 'In Lagos 70% of respondents in a\r\ncity-wide survey were fearful of being\r\nvictims of crime, with 90% fearful of\r\nbeing killed in a criminal attack.\r\nSource: UN-HABITAT, Global Report on Global\r\nSettlements 2007, www.unhabitat.org/pmss/\r\ngetPage.asp?page=bookView&book=2432', 'Safety and security covers a wide range of issues\r\nincluding crime, violence, terrorism and war. The fear of\r\ncrime and violence is an issue for both high- and\r\nlow-income countries. In the US and the UK people\r\nrepeatedly rank crime among the top concerns they\r\nhave in everyday life. Crime rates have been increasing\r\nglobally - between 1980 and 2000 the total recorded\r\ncrimes increased from 2300 to 3000 crimes for every\r\n100 000 people. Although rates fell in North America and\r\nWestern Europe, they increased in Latin America and the\r\nCaribbean, Eastern Europe and Africa.\r\nThe causes of crime and violence vary widely. Poverty\r\nhas been cited as a cause of crime and violence\r\nalongside unemployment, inequality, substance\r\nmisuse, intergenerational transmission, the rapid\r\npace of urbanisation, poor urban planning design and\r\nmanagement, growth in youthful population and the\r\nconcentration of political power. In Malawi the risk of\r\nburglary goes up in the “hungry season”, which is when\r\npeople are less likely to have food.\r\nThe poor are disproportionately more affected by\r\nterrorism and war due to their lack of options in dealing\r\nwith such risks. War has serious implications for poverty\r\nas it threatens life, property and the overall social and\r\neconomic development of a country.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 475, 1264478719, 1264478515, 1, 1, 664),
('not-in-my-backyard (NIMBY)', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 476, 1264478737, 1264478532, 1, 1, 664),
('households', '', 1, 3, 'what’s in your dustbin?', 'E-waste is one of the fastest growing\r\nwaste streams and currently represents\r\n4% of municipal waste in the EU. It is\r\nincreasing at 3-5% annually, almost\r\n3 times faster than total waste growth.\r\nSource: www.greenpeace.org/international/\r\ncampaigns/toxics/electronics/the-e-waste-problem', 'The electronic era has revolutionised the way we\r\nthink, work and communicate. Digital devices are now\r\nfundamental to the functioning of everyday life both in the\r\nhome and at work. The consumption of mobile phones\r\nin particular has seen massive growth. Launched in 1984,\r\nthe market has boomed ever since in all corners of the\r\nworld. In Africa mobile phones have seen a 40% increase\r\nsince 2000. Nokia estimate that there will be 2bn global\r\nusers by 2008 and 3bn by 2010.\r\nThese changing consumption patterns are refl ected\r\nin our waste with a growing share of municipal waste\r\ncontaining electronic or electrical products. In the US in\r\n2005 it is estimated that 130M cell phones were thrown\r\nout resulting in 64 000 tonnes of waste. In Europe only 2%\r\nof mobiles are currently recycled. Junked electronic goods\r\noften end up in landfi lls and incinerators and in the US\r\n70% of the heavy metals found in landfi lls come from\r\nE-waste. These toxins can leach into soil and ground\r\nwater and, if people are exposed to them, cause\r\ndamage to the central nervous system, endocrine\r\ndisruption, interference with brain development and\r\norgan damage. Incineration is just as harmful, the\r\nburning of PVC and bromide fl ame retardants produces\r\ndioxins and furans, two of the most deadly persistent\r\norganic pollutants (POPs).', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 477, 1264478748, 1264478543, 1, 1, 664),
('marginal communities', '', 1, 3, 'when is waste a lifeline?', 'The World Bank has\r\nestimated that up to\r\n2% of the population\r\nin developing countries\r\nsurvive by recovering\r\nmaterials from waste.\r\nSource: Rob Bowden, Waste\r\nrecycling and reuse: Our\r\nimpact on the planet, 2003', 'Informal waste collection systems have many\r\nenvironmental and economic advantages. They reduce\r\nthe need for landfi ll and save natural resources whilst\r\nproviding an important source of livelihood for some of\r\nthe world’s poorest people who are unable to obtain\r\nformal employment. In Buenos Aires informal waste\r\ncollectors, known as “scavengers”, recover 9 – 17% of\r\nmunicipal waste, representing an estimated saving for the\r\nmunicipality of US$30 000 to US$70 000 every day. In\r\nAsia whole communities have developed out of the waste\r\nindustry and handle up to 75% of urban waste. In Brazil\r\n100 000 people earn their living by collecting aluminium\r\ndrinks cans, which enabled the country to recycle 89% of\r\nthem in 2003 - the highest rate in the world.\r\nDespite these environmental and social benefi ts,\r\nscavenging also comes at a cost. The workers are often\r\nexploited by waste buyers and have poor health and\r\nliving conditions, sometimes working at night without\r\nany protective clothing. In Mexico, waste scavengers\r\nhave a life expectancy of 35 years as opposed to the\r\ngeneral population of 67 years. Experience in Calcutta\r\nhas shown that even when the workers are provided with\r\nfree protective equipment such as gloves and boots it is\r\nsimply sold for cash and fails to solve the health problems\r\nincurred by this work.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 478, 1264478762, 1264478557, 1, 1, 664),
('advertising', '', 1, 3, 'can you switch off?', 'The single most important factor for people\r\nwanting a specifi c brand is clever advertising.\r\nIn the US over 62bn pieces of junk mail\r\n(4M tonnes) are produced annually, of which\r\n44% is sent to landfi ll unopened.\r\nSource: www.41pounds.org/statistics', 'Global appetite for goods and services is driven by\r\nthe advertising industry. World advertising expenditure\r\nreached US$446bn in 2002; this is around nine times\r\nmore than in 1950. Over this same period, private\r\nconsumption expenditure has increased fourfold. Over\r\nhalf of global advertising expenditure is spent in the US\r\nwhere ads take up two thirds of the typical newspaper,\r\na third of all TV programming and half of all mail.\r\nAlthough its most obvious role is to encourage us\r\nto buy more, advertising is also being used as an\r\neffective education tool to achieve behavioural change.\r\nRecycling campaigns have limited success unless\r\npeople are made aware of what, why and how they\r\nshould use recycling facilities. Leading international\r\nrecycling programmes often invest as much in\r\nmarketing and education as they do in the recycling\r\ninfrastructure. In 1999 the United Nations Environment\r\nProgramme (UNEP) set up the Advertising and\r\nCommunication Forum which has led to numerous\r\nlocal campaigns connecting our behaviour to waste\r\ngeneration. In 2005 the ‘drop your own’ campaign\r\nwas launched in Hungary to raise awareness about\r\nhousehold waste separation. Before the campaign\r\n43% of people used the selective waste facilities, but\r\nafter the campaign this rose to 79%.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 479, 1264478773, 1264478568, 1, 1, 664),
('clothes', '', 1, 3, 'do you mend your socks?', 'In the UK 216 000 tonnes of clothing were sold in 2003 and this is\r\nset to rise to 403 600 tonnes in 2020.\r\nSource: Environmental Resources Management, Market Transformation Programme\r\n- Waste clothing textiles, October 2005', 'Modern economies are capable of producing huge\r\nquantities of goods such as clothes at very low cost. This\r\nleads consumers to regard these goods as little more than\r\ncommodities that can be discarded relatively quickly. The\r\nlist of products that we used to keep for years and now\r\ndispose of almost instantaneously is increasing. As well as\r\nclothing, our desire for disposable items such as tissues,\r\nnappies, cameras and barbecues all contribute to an\r\nexpanding “throwaway culture”. The UK Department of\r\nTrade and Industry estimates that as many as 80% of new\r\nproducts are discarded after a single use and that 99% of\r\nthe materials used in their production are discarded within\r\nthe fi rst six weeks.\r\nIn the UK women’s clothing prices have fallen by a\r\nthird in the past ten years, which is largely attributed\r\nto exploitation of female labour in factories around the\r\ndeveloping world. In Bangladesh workers who sew fabrics\r\nfor budget chains are paid just 6p an hour totalling £20\r\na month for an 80 hour week, which is only 36% of the\r\nestimated living wage. In the US people spent an average\r\nof 17% of their total disposable income on clothing in the\r\n1920s. By 2001 this had gone down to just 4.4% despite\r\nthe fact that they were buying on average 48 new pieces\r\nof clothing a year.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 480, 1264478938, 1264478734, 1, 1, 664),
('taxation', '', 5, 2, 'should we tax income or carbon?', 'Sweden is undertaking an overall tax shift\r\nreplacing taxes on income with taxes on\r\nenergy, transport and pollution amounting to\r\nseveral billion Swedish kronor.\r\nSource: www.libdems.org.uk/environment/green-taxes-arethe-\r\nway-to-change-our-world.10733.html', 'Originally taxation arose out of the need to fi nance\r\ngovernment spending. Nowadays taxation has many\r\nfunctions which have important effects on business\r\nand the economy. These include redistribution of\r\nwealth, social objectives (e.g. discouraging smoking)\r\nand economic objectives, such as reduced consumer\r\nspending to control infl ation. The result is that most\r\ntaxation is on human labour or on the value labour adds\r\nto natural resources.\r\nShifting the tax burden off human enterprise onto naturegiven\r\nresources would remove the arbitrary penalty that\r\nnow attaches to employment. A perverse result is that it\r\nis often more economical to invest in new machinery or\r\nincrease energy use than to take on more workers.\r\nTaxes on energy and CO2 emissions from fossil fuels\r\ncan be an effective tool in addressing the climate\r\nproblem, and without negative effects for a country’s\r\ncompetitiveness. This effect only works if taxes do\r\nnot go into the public purse, but are used to reduce\r\nother distortionary taxes and charges. Finland was the\r\nfi rst country to introduce a CO2 tax in 1990. In fi ve EU\r\ncountries, CO2 and energy taxation over the last 17 years\r\nhas made a small but positive contribution to economic\r\ngrowth of up to 0.5%, at the same time as CO2 emissions\r\nhave been reduced.', NULL, '65.jpg', '65back.jpg', 1, NULL, 'issue', 'active', NULL, 481, 1264479619, 1264479414, 1, 1, 664),
('stranded assets', '', 5, 2, 'do you vote for the long term?', '133GWe of gas-fi red power stations have been built in the USA\r\nsince 2000 for over US$50bn, yet the capacity factor has fallen\r\nfrom 68% to 35%.\r\nSource: The Future of Gas-fi red Power Generation, Business Insights, August 2006\r\nwww.globalbusinessinsights.com/content/rben0182m.pdf', 'Central generating plant is expensive to build but has a\r\nlong life: gas turbines exceed 25 years and coal power\r\nexceeds 45 years. In a regulated environment and during\r\nperiods of certainty, these assets will be used over their\r\nfull life, but a stranded asset is one that becomes obsolete\r\nin advance of complete depreciation, also causing\r\nsignifi cant costs to the national economy.\r\nProjected availability of resources are becoming more\r\nimportant when companies have to make decisions on\r\nplanning and construction. The recent North American\r\n“natural gas story” is a case in point. After a period of\r\nsustained domestic gas production, construction of gasfi\r\nred power stations took off in 2000 with capacity growing\r\nby 133% to 2004. Production of gas was starting to show\r\nsigns of decline though there continued to be a false\r\nsense of optimism. In fact, conventional natural gas wells\r\nbegan to deplete as soon as they started to produce.\r\nUnsustainable demands were placed on gas supplies and\r\nprices quadrupled (Fig 2), forcing large industrial users of\r\nit offshore and pushing gas-fi red electricity costs towards\r\n10c/kWh. From 2000 to 2004, output from these power\r\nstations grew by only 18% (Fig 1), the low capacity factor\r\nresulting from increased gas prices.', NULL, '64.jpg', '64back.jpg', 1, NULL, 'issue', 'active', NULL, 482, 1264479632, 1264479428, 1, 1, 664),
('hidden subsidies', '', 5, 2, 'are subsidies a boon or a bane?', 'The intentions of the Kyoto Protocol\r\ninclude phasing out subsidies in all\r\ngreenhouse gas emitting sectors and the\r\napplication of market instruments.\r\nSource: Energy For Tomorrow’s World - Acting Now!\r\nCopyright World Energy Council, London, 2000.\r\nUsed by permission of World Energy Council.\r\nwww.worldenergy.org', 'Direct subsidies by the state are straight payments to an\r\nindustry. Indirect subsidies take the form of tax rebates\r\nor exemptions, concessions such as regulatory support\r\nmechanisms and preferential planning consent, or\r\ninsurance cover for energy operators regarded as “too\r\nrisky” by commercial insurers. Many of these subsidies\r\nto industrial producers remain hidden, not appearing\r\non national accounts as government expenditure. The\r\noverall effect of hidden subsidies is that the actual cost\r\nof a kilowatt hour of electricity, for instance, is diffi cult to\r\nascertain for a given fuel type or technology.\r\nSubsidies are of concern where they distort inter-fuel\r\ncompetition. For example, promotion of coal use at\r\nthe expense of other fuels, or subsidised electricity\r\nconsumption which causes over-pumping for irrigation.\r\nSome subsidies were introduced to improve the living\r\nstandards of the poor, but over time it is debatable whether\r\nthey continute to benefi t those most in need. The political\r\ndiffi culty involved in their reduction can be signifi cant.\r\nPromotion of cleaner fossil fuel use and accelerating\r\nrenewable energy development are the new priorities.\r\nTechnology or infrastructure subsidies for these need to\r\nbe transparent and to have an exit strategy put in place.', NULL, '63.jpg', '63back.jpg', 1, NULL, 'issue', 'active', NULL, 483, 1264479647, 1264479442, 1, 1, 664),
('peak oil', '', 5, 2, 'can we go it alone?', 'In a review of over 200 oil\r\ncompanies in 2005, total\r\nexploration investment rose to\r\na record US$36bn. However\r\nexploration remains under\r\na magnifying glass because\r\ndiscovered volumes continue\r\nto disappoint. For the third\r\nstraight year, the industry failed\r\nto replace its oil reserves through\r\nthe drill-bit.\r\nSource: John S Herold, Inc / Harrison\r\nLovegrove & Co, Global Upstream\r\nPerformance Review, 2006\r\nwww.hargrove.co.uk/uploadedfi les/\r\nGUPRAbridged2006.pdf', 'Global consumption of conventional oil has been growing\r\nsteadily since the mid-1980s at 1.5% per year, but a\r\ngrowing group of petroleum geologists predict that\r\nsupplies of conventional oil will start to fall within a few\r\nyears. Many existing oil fi elds are going into decline and\r\nfewer new major sources of oil are being discovered.\r\nThe Swedish Government is setting a new policy target of\r\ncreating the conditions necessary to break their country’s\r\ndependence on fossil fuels by 2020. A Sweden free of\r\nfossil fuels is described as giving enormous advantages,\r\nnot least by reducing the impact from fl uctuations in oil\r\nprices. Nevertheless the spread of measures required are\r\na considerable challenge to the whole of society being\r\ndependant on a trusting collaboration between politics,\r\nindustry and research.\r\nEnergy effi ciency will need to be improved by 20%. All\r\noil for heating residential and commercial buildings will\r\nneed to be replaced by biofuels or electric heat pumps.\r\nRoad transport should reduce use of petrol and diesel by\r\n40%-50% with some replaced by biofuels from forest and\r\nenergy crops. Industry is expected to reduce its use of oil\r\nby 25-40%, part achieved by a switch to biofuels and/or\r\ndistrict heating.', NULL, '62.jpg', '62back.jpg', 1, NULL, 'issue', 'active', NULL, 484, 1264479658, 1264479453, 1, 1, 664),
('gas imports', '', 5, 2, 'who controls your supply?', 'The UK could be importing as much as 90% of its\r\ngas needs by 2020 compared with 10% today.\r\nSource: Energy Review Report 2006, Department of Trade and\r\nIndustry, July 2006, www.dti.gov.uk/energy/review/page31995.html', 'Natural gas has many environmental advantages of clean\r\nburning and low CO2 emissions for power generation\r\nand low emissions for domestic energy consumption.\r\nCombined with price advantages over liquid fuels (oil),\r\nworldwide demand is growing rapidly at 2.4% per year.\r\nNatural gas supplied to power, industrial and domestic\r\nconsumers is primarily methane, produced from\r\nassociated fi elds with oil or from non-associated fi elds.\r\nConventional pipelines are the longest-established and\r\nmost common method of transporting natural gas,\r\nthough they can face physical, political, technical and\r\neconomic limitations.\r\nMost Central and Eastern European countries are heavily\r\ndependent on Russian gas. A non-temporary shortage\r\ncould throw many of these countries into considerable\r\ndiffi culty both in respect of industrial production and in\r\nterms of the comfort and safety of their peoples. The\r\ndispute between Russia and the Ukraine in January 2006\r\nover gas prices, and the subsequent temporary cut off\r\nin supplies, caused political shockwaves across Europe.\r\nIt raised the question of whether Russia may cut off gas\r\nsupplies in the future for political reasons.', NULL, '61.jpg', '61back.jpg', 1, NULL, 'issue', 'active', NULL, 485, 1264479669, 1264479465, 1, 1, 664),
('wind farms', '', 3, 2, 'beauty or blight?', 'Global installed capacity of wind\r\nincreased by 43% in 2005 to 60 000MW,\r\n0.5% of total electricity generation.\r\nSource: The hidden cost of wind turbines, New\r\nScientist Environment, July 2006, http://environment.\r\nnewscientist.com/article/mg19125591.600', 'Seen by many as the major renewable alternative to fossil\r\nfuels, wind power is the world’s fastest growing source\r\nof power. Although its plants have relatively little impact\r\non the environment compared to fossil fuel power plants,\r\nconcerns are raised over rotor blade noise, visual impacts,\r\nand deaths of birds and bats that fl y into the rotors.\r\nWind turbines are tall structures that are built in open\r\nspaces. Often wind farms are quite conspicuous\r\nappearing intrusive to some people, but not to others.\r\nPeople’s opinions are based on their individual values and\r\njudgements. They are infl uenced by issues such as the\r\nvalue a person places on the preservation of the proposed\r\nsite as well as their familiarity and interest in energy supply\r\nand demand. Landscape architects aim to layout wind\r\nfarms so they seem coherent and do not appear cluttered\r\nin the landscape.\r\nSeveral large wind facilities have operated for years with\r\nonly minor impacts on wildlife. Neverthless, research in\r\nNorway adds weight to the idea that turbines and large\r\nbirds don’t mix.', NULL, '60.jpg', '60back.jpg', 1, NULL, 'issue', 'active', NULL, 486, 1264479681, 1264479476, 1, 1, 664),
('biofuels', '', 3, 2, 'should farmers grow food?', 'The dramatic increase in oil palm plantation\r\nacreage is one of the greatest threats to\r\nrainforests and their wildlife. The rainforests\r\nof Malaysia and Indonesia are being cleared\r\nso rapidly that up to 98% may be destroyed\r\nby 2022.\r\nSource: UNEP, February 2007\r\nwww.unep-wcmc.org/resources/publications/LastStand.htm', 'Biomass (plant matter for energy use) absorbs carbon\r\ndioxide as it grows, so as long as it is harvested at or\r\nbelow its growth rate, no more carbon dioxide will be put\r\ninto the atmosphere than is consumed. Thus biomass is\r\nreceiving increasing attention as a substitute for fossil fuel\r\nconsumption to reduce emissions.\r\n“Biofuels” refer specifi cally to liquid fuels for transportation\r\nand are available as two types. Bioethanol is made from\r\nstarch plants (like corn, wheat and cassava), sugar plants\r\n(beet and cane) and sometimes cellulose plants (trees). It\r\nis produced fi rst by fermentation, followed by distillation\r\nand fi nally dehydration. Biodiesel is manufactured from\r\nvegetable oils, such as from the crops soy and rape, or\r\nrecycled restaurant greases and some abattoir wastes. In\r\n2003, production of bioethanol met 2% of gasoline use\r\nand biodiesel met 0.4% of diesel use.\r\nAlthough biofuel can offset fossil fuel use, it will remain\r\nsmall, being restricted by the ability of the natural\r\nenvironment to provide both fuel and food for a large\r\nand energy-demanding world population. For example, if\r\nbioethanol were blended to just 5% of petrol consumption\r\nin Europe, this would require 20% of the EU’s 100MHa of\r\narable land.', NULL, '59.jpg', '59back.jpg', 1, NULL, 'issue', 'active', NULL, 487, 1264479699, 1264479494, 1, 1, 664),
('nuclear waste', '', 3, 2, 'what legacy will you leave behind?', 'The long-term management of higher activity\r\nradioactive waste requires an integrated programme\r\nof both geological disposal and robust interim storage\r\nand that there should be a staged process based on\r\nvolunteerism (willingness to participate on the part of\r\nhost communities).\r\nSource: Committee on Radioactive Waste Management,\r\nDoc 2135, Feb 2007, www.corwm.org.uk', 'In 2007, a global fl eet of 436 nuclear power plants will\r\nproduce 16% of world electricity. Many governments are\r\nconsidering the nuclear option for their contribution to\r\ncutting greenhouse gas emissions and security of supply,\r\nthough issues still surround the associated generation and\r\ndisposal of radioactive waste.\r\nRadioactive waste is categorised according to its\r\nradioactivity and heat generation characteristics, with\r\nhigh (HLW) and intermediate (ILW) level wastes providing\r\nthe greatest challenges. Although low level waste (LLW)\r\ncomprises by far the largest volume of radioactive waste,\r\nits treatment and storage are far less challenging. There\r\nis growing international experience in long-term waste\r\ncontainment of HLW and ILW using geological strata to\r\nprovide secure repositories. The long-term behaviour of\r\nsuch repositories is assessed in part using geological\r\nanalogies such as the remnant natural nuclear reactor at\r\nOklo, Gabon, Africa.\r\nVarious contributions by volume to conditioned nuclear\r\nwaste in the UK are shown in Fig 2. Existing and future\r\nwaste arisings for the UK are predicted to be 1.5Mm³ of\r\nLLW but with a total reactivity of just 609 terabecquerels\r\n(TBq). While HLW would produce only 750m³ by volume,\r\ntheir radioactivity would be high at 278 000 000TBq.', NULL, '58.jpg', '58back.jpg', 1, NULL, 'issue', 'active', NULL, 488, 1264479714, 1264479509, 1, 1, 664),
('carbon dioxide storage', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 489, 1264479731, 1264479526, 1, 1, 664),
('emissions', '', 3, 2, 'is electricity clean?', 'Coal-fi red power plants are responsible for 10M tonnes\r\nof SOx emissions per year, about two-thirds of the US\r\ntotal; the remaining third being caused by transportation\r\nand other industrial processes.\r\nSource: The Four Foes of Clean Air, ConservAmerica\r\nwww.conservationisconservative.org/cleanair/slide4.html', 'Coal is making a comeback as a cheap and reliable\r\nsource of energy, especially for electricity generation,\r\nprompted in part by the world’s vast coal reserves. But\r\nwhile the effi ciency and cleanliness of coal-fi red power\r\nstations is improving, coal remains the dirtiest of all fossil\r\nfuels. The main environmental problems are emissions of\r\npollutants, consisting of mercury, nitrogen oxides (NOx)\r\nand sulphur dioxides (SOx).\r\nCoal-fi red power plants are responsible for an estimated\r\n45 tonnes of mercury emissions per year, roughly one-third\r\nof the total human-caused mercury emissions in the US.\r\nBurning any fuel at a high temperature will result in\r\nformation of NOx (Fig 2). They are believed to aggravate\r\nasthmatic conditions, react with the oxygen in the air to\r\nproduce ozone, an irritant, and eventually form nitric acid\r\nwhen dissolved in water.\r\nCoal contains sulphur in varying quantities, depending\r\non the type, and SOx is created when sulphur reacts with\r\noxygen in the combustion process. As with NOx, SOx\r\nemissions also cause acid rain. Flue gas desulphurisation\r\n(FGD) is the current state-of-the art technology for\r\nremoving sulphur dioxide from the exhaust fl ue gases.', NULL, '56.jpg', '56back.jpg', 1, NULL, 'issue', 'active', NULL, 490, 1264479743, 1264479538, 1, 1, 664),
('austerity', '', 4, 2, 'is growth necessary?', '“Those of us who are older adults (I’m now 52) have lived in the most exciting\r\ntime in history. Even if we have suffered from the stresses of the fast pace...\r\nwe have benefi ted from the enormous energies at our disposal. It has been\r\na fabulous party. Shall we acknowledge that the party is over, clean up after\r\nourselves and make way for those who will come after us?”\r\nSource: Richard Heinberg, The party’s over, 2003', 'Some might question whether growth needs to continue\r\nin the OECD bloc. Its people are the most lavishly\r\nresourced in the history of the world and there is no\r\nevidence that further economic growth would make\r\nthem any happier. Fig 1 shows the human development\r\nindex (HDI) saturating above 200 GJ per capita per year.\r\n(HDI measures a country’s average achievements as\r\na summary composite of longevity, knowledge, and a\r\ndecent standard of living.)\r\nRoughly half of all the fossil energy used in OECD\r\ncountries is required for the growth process.\r\nConsequently, if we could fi nd a way to enable OECD\r\neconomies to survive without growth, or reduce the strong\r\ngrowth-energy connection, very deep and rapid cuts in\r\nworld fossil energy use would be possible.\r\nPerhaps this connection can be broken. Research of the\r\nUSA stockmarket from 1973 to 2003 shows that stocks\r\nfl ourish not only when the oil price falls but also when it\r\nrises, as long as the rise is not too fast. One analyst has\r\ndeveloped a rule to be applied monthly: keep buying\r\nstocks while the 12-month change in oil price is below\r\n+80%; once above +80%, sell stocks; re-enter the market\r\nonly once the 12-month change has fallen below +20%.', NULL, '55.jpg', '55back.jpg', 1, NULL, 'issue', 'active', NULL, 491, 1264479755, 1264479550, 1, 1, 664),
('productive capacity', '', 4, 2, 'when will the renewables parachute open?', 'The time needed to recover the embodied energy\r\nfrom a photovoltaic panel ranges from 1 to 4 years.\r\nSource: Colin Bankier, Steve Gale, Energy payback of roof mounted\r\nphotovoltaic cells, Energy Bulletin, 16 June 2006\r\nwww.energybulletin.net/17219.html', 'Increased investment in renewable energy technologies is\r\npromised but we must note the implications. The output\r\nfrom the current renewables capital stock is still well below\r\nthe base load. Therefore a large investment in capital plant\r\nwould actually stimulate a large demand for electrical\r\npower which must come from fossil sources.\r\nAnother consideration is that the more capital invested\r\nin renewables, the less there will be available for other\r\npurposes. Modelling of the economy in Australia showed\r\nthat investing in major new renewable infrastructure at\r\na rate of 4000MW per year would be constrained by a\r\nlimit of capital availability rather than a lack of physical\r\nresources. The renewables option on a large scale would\r\nblock any growth in material affl uence.\r\nFive factors will make the transition to a non-fossil world\r\nfar more diffi cult than is commonly realised. These are:\r\nthe scale of the shift; the lower energy density of the\r\nreplacement fuels; the substantially lower power density of\r\nrenewable energy extraction; intermittency of renewable\r\nfl ows; and uneven distribution of renewable energy\r\nresources. A non-fossil world may be highly desirable, but\r\ngetting there will demand great determination, cost and\r\nmany decades.', NULL, '54.jpg', '54back.jpg', 1, NULL, 'issue', 'active', NULL, 492, 1264479768, 1264479563, 1, 1, 664),
('net energy analysis', '', 4, 2, 'what’s the energy return?', 'From the early 1970s to today, the energy\r\nreturn on investment in oil and natural gas\r\nextraction in the US fell from about 20:1 to\r\nabout 15:1. The tar sands of Alberta have an\r\nenergy return of around 4:1.\r\nSource: Cutler Cleveland in Thomas Homer-Dixon, The end\r\nof ingenuity, The New York Times, 29 November 2006', 'One technique for evaluating energy systems is net\r\nenergy analysis. This seeks to compare the amount of\r\nenergy delivered to society by a technology to the total\r\nenergy required to fi nd, extract, process, deliver, and\r\notherwise upgrade that energy to a socially useful form.\r\nThis can also be represented as energy return on energy\r\ninvestment (EROEI).\r\nA shift to a lower EROEI energy system means that more\r\nof society’s productive resources are devoted directly and\r\nindirectly to delivering the same amount of energy. That\r\nenergy thus cannot be used for other purposes, notably\r\nprovision of consumption goods. Energy used to make an\r\noil rig or wind turbine cannot be used to manufacture cars\r\nor provide health care.\r\nThe position of fossil fuels in the energy hierarchy stems\r\nfrom the fact that they have a high EROEI. The largest oil\r\nand gas fi elds deliver energy surpluses that dwarf any\r\nprevious source (and any source developed since then).\r\nThat surplus, in combination with other attributes, is what\r\nmakes conventional fossil fuels unique. Society faces the\r\nlong-run challenge of replacing the current system with\r\na combination of alternatives sharing similar attributes,\r\ntogether with a much lower carbon intensity.', NULL, '53.jpg', '53back.jpg', 1, NULL, 'issue', 'active', NULL, 493, 1264479781, 1264479576, 1, 1, 664),
('carbon sequestration', '', 4, 2, 'is the price too high?', 'The energy penalty is 10 - 40% depending upon the CO2 capture\r\nmethod, the power plant design and age and other local conditions.\r\nSource: IPCC, Special Report on Carbon Dioxide and Storage\r\nwww.accsept.org/facts/concepts.htm', 'There are many ways in which CO2 emissions can be\r\nreduced, such as increasing the effi ciency of power plants\r\nor by switching from coal to natural gas. However, most\r\nscenarios suggest that these steps alone will not achieve\r\nthe required reductions in CO2 emissions. The capture\r\nand storage of CO2 from fossil fuel combustion could play\r\nan important part in solving this problem without the need\r\nfor rapid change in the energy supply infrastructure.\r\nA small fraction of CO2 from the fl ue gas stream is already\r\ncaptured at several plants for use in the food industry.\r\nHowever to reduce emissions from a typical power\r\nplant by 75% would need equipment that is 10 times\r\nlarger. Methods divide into post-combustion separation,\r\nprocessing of the fuel to remove CO2 pre-combustion, or\r\nburning the fuel in oxygen so that only CO2 is produced.\r\nIt is nearly always more expensive to capture CO2 than to\r\nallow it to escape into the atmosphere. Quite apart from\r\nthe large installation, this is because the capture of the\r\nCO2 uses up energy – a so-called “energy penalty” - for\r\nthe separation and compression of the CO2. The cost\r\nof electricity would increase by 2 to 3 cents per kWh.\r\ndepending on the price paid by the endconsumer, this\r\ncould result in price increases of 20-80%.', NULL, '52.jpg', '52back.jpg', 1, NULL, 'issue', 'active', NULL, 494, 1264479795, 1264479590, 1, 1, 664),
('inflation', '', 4, 2, 'are services energy-free?', '“In the contemporary world, the productive process is more dependent\r\nupon energy than either capital or labor. While this is hardly news to\r\nmost energy scientists it is quite remarkable the degree to which it is a\r\nconcept foreign to economists.”\r\nSource: Charles Hall, Jae-Young Ko, Advances in Energy Studies, June 2004\r\nwww.unicamp.br/fea/ortega/energy/Charles Hall.pdf', 'The ratio of fuel use (E) to real gross national product (GNP)\r\nis one measure of fuel effi ciency. The raw E/GNP ratio\r\nwould tend to suggest that fuel effi ciency in the US has\r\nimproved since 1920 (see Fig 1) whereas the corrected\r\nratio shows little or no long-term trend since 1930.\r\nThe decline of the raw ratio has been interpreted by some\r\nas resulting from factor substitution and conservation\r\nmeasures with similar improvements possible in the\r\nfuture. In fact the corrected ratio shows that 69% of the\r\nvariation can be accounted for by technological change\r\nthat has relied on intensifi ed use of higher quality fuels,\r\nsuch as petroleum and electricity. A further 27% of the\r\nvariation can be accounted for by the declining proportion\r\nof GNP spent on fuel by households.\r\nInfl ation in its simplest form can be described as a rise in\r\nthe general price level of goods and services. Fig 2 shows\r\na striking correlation between the ratio of money supply\r\nto energy consumption and the level of the US Consumer\r\nPrice Index from 1890 to 1982. From an energy\r\nperspective, infl ation can be defi ned as: too many dollars\r\nchasing too few products of economic work (for example,\r\ngoods and services) - or simply too many dollars chasing\r\ntoo little economic energy.', NULL, '51.jpg', '51back.jpg', 1, NULL, 'issue', 'active', NULL, 495, 1264479810, 1264479605, 1, 1, 664),
('photovoltaics', '', 2, 2, 'is your building solar-ready?', 'Japan has the most successful photovoltaics (PV) industry and mature\r\nmarket in the world. Leading prefab home seller, Sekisui Housing\r\nCompany, began selling homes with PV systems in 1997. By August\r\n2006, it had sold 50 000 of these homes with a total power of 192MWp.\r\nSource: Andreas Schlumberger, Right and ready PV roofs, Photon International, January 2007', 'Solar technologies have the largest ultimate capacity of all\r\nrenewable resources (Fig 1), so they will play an increasingly\r\nimportant role in the fossil-renewables transition.\r\nWhile the current cost of photovoltaics (PV) is comparatively\r\nhigh, the costs of many technologies have been shown\r\nto decrease with increasing cumulative production. This is\r\nattributed to a set of factors involving economies of scale,\r\nincremental improvement and innovation.\r\nOn a logarithmic plot of cost against global cumulative\r\nproduction, the “learning function” becomes apparent as\r\na descending straight line. Fig 2 shows a cost reduction of\r\n30% for each doubling of PV production in the early years,\r\nusing watts at peak power under standard test conditions\r\n(Wp). Since 2000, the learning rate has reduced to 16%\r\nwith annual growth of about 30%. A production of\r\n10 000MWp is projected for 2007 with a cost of $2.5Wp.\r\nIn anticipation of growth in PV, new buildings should be at\r\nthe very least “solar ready”. This involves having a roof at\r\nthe correct solar pitch oriented towards the noon sun to\r\nmaximise solar exposure. Any shading of the solar-ready\r\nroof, for example by trees, should be considered because\r\nthey can have a disproportionate effect on PV output.', NULL, '70.jpg', '70back.jpg', 1, NULL, 'issue', 'active', NULL, 496, 1264479823, 1264479618, 1, 1, 664),
('demand management', '', 2, 2, 'should electricity be on tap?', 'By the year 2025, demand response can deliver around\r\nan additional 5% reduction in system peak demand, or\r\napproximately 2800MW of load reduction, compared to\r\nthe current situation.\r\nSource: www.demandresponseresources.com/Portals/0/Australia/Australia_\r\nIEA DSM Task XIII DR Roadmap_Final_Dec06.pdf', 'In the electricity industry, the term “demand side\r\nmanagement” is used to refer to actions which change\r\nthe electrical demand on the system. For instance, signals\r\ncan be sent to householders warning of high consumption\r\nor high cost. Consumers then go round the house turning\r\noff unnecessary appliances or defering non-vital activities.\r\nBy actively engaging with consumers, savings in energy\r\nconsumption have ranged from 3% to 15%. Finland\r\nintends to have an Automatic Meter Management system\r\nin full use by 2009 with real time pricing.\r\nBackup capacity is normally provided by open cycle gas\r\nturbines, for their fast response, but they are 10-20% less\r\neffi cient than combined cycle gas turbines that provide\r\nbase load. If demand is reduced during consumption\r\npeaks, it means that the need for this low effi ciency\r\nreserve power can also be reduced. Even greater\r\nreduction in demand could result in deferring or avoiding\r\nexpansion of electricity networks.\r\nIn dynamic load management, loads can be interrupted\r\nduring peak demand without the consumer being aware.\r\nFor example, fridge temperatures could to be set slightly\r\nlower than normal or redesigned with a thermal mass\r\nlining to tolerate interruption.', NULL, '69.jpg', '69back.jpg', 1, NULL, 'issue', 'active', NULL, 497, 1264479834, 1264479629, 1, 1, 664),
('hydrogen economy', '', 2, 2, 'too good to be true?', '“No matter how you look at it, producing hydrogen\r\nfrom water is an energy sink. If you don’t understand\r\nthis concept, please mail me ten dollars and I’ll send\r\nyou back a dollar.”\r\nSource: Alice Friedemann, The Hydrogen Economy - Energy and\r\nEconomic Black Hole, March 2005\r\nwww.energypulse.net/centers/article/article_display.cfm?a_id=940', 'A hydrogen economy is a hypothetical economy in which\r\nenergy for mobile applications (vehicles, aircraft) and\r\nelectrical grid load balancing (daily peak demand reserve)\r\nis stored as hydrogen (H2). Fuel cells, using hydrogen as\r\na fuel, generate electricity with a high effi ciency, roughly\r\ndouble that of internal combustion engines. Wind turbines\r\ncould generate hydrogen when the wind blows but\r\nelectricity demand is low.\r\nHowever, despite near universal optimism for the\r\nhydrogen economy, careful analysis suggests that\r\nhydrogen is unlikely to become a major energy carrier\r\nwithin the next decades. The predominant challenge\r\nfaced by proponents of the hydrogen economy is that\r\nhydrogen is not a fuel source but an energy carrier, much\r\nlike electricity. As such, more energy will be required to\r\ncreate, compress/and or liquefy, and transport hydrogen\r\nthan will be available at the point of consumption. While\r\nproduction losses are typical with any energy source or\r\ncarrier, in most instances the energy source for hydrogen,\r\nwhether it is produced from hydrocarbons, electricity,\r\nor in any other means, is directly useable without the\r\nassociated losses.', NULL, '68.jpg', '68back.jpg', 1, NULL, 'issue', 'active', NULL, 498, 1264479847, 1264479642, 1, 1, 664),
('mayors', '', 5, 7, 'who do you want to govern you?', '“We had to build a city for people. Instead of building\r\nhighways, we restricted car use. Public space is for living,\r\ndoing business, kissing, and playing. Its value can’t be\r\nmeasured with economics or mathematics; it must be felt\r\nwith the soul.”\r\nSource: Enrique Penalosa, Mayor of Bogotá (1998 to 2001)\r\nwww.pps.org/info/placemakingtools/placemakers/epenalosa', 'The potential for strong political leadership can come with\r\nurbanisation, and such leadership can in turn strengthen a\r\ncity’s position. In Curitiba in Brazil for example, the leader\r\nof the winning team of a 1960s masterplan competition\r\nfor developing the city was subsequently elected mayor\r\nthree times, and is credited with transforming the city into\r\none of the best examples of urban planning worldwide.\r\nIn Bogotá, the effect of co-ordinated actions by successive\r\nmayors has turned a once violent, car-dominated city, facing\r\ndramatic levels of in-migration from its rural hinterlands,\r\ninto a calm and well-managed city - with an efficient rapid\r\ntransit bus system, a network of cycleways, public parks,\r\nand urban plazas that have improved the quality of life of its\r\ninhabitants and reduced crime.\r\nIn Barcelona a series of visionary urban projects has been\r\nundertaken over the last 20 years by three successive\r\nmayors – and these have had a lasting impact on its\r\neconomy. During the 1990s, London, Tokyo and Seoul all\r\nelected mayors for the fi rst time in modern history.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 499, 1264479854, 1264479649, 1, 1, 664);
INSERT INTO `card` (`name`, `safe_name`, `category_id`, `topic_id`, `question`, `factoid`, `description`, `image`, `card_front`, `card_back`, `origin_event_id`, `uri`, `type`, `status`, `params`, `id`, `ctime`, `mtime`, `owner`, `group`, `perms`) VALUES
('micro-generation', '', 2, 2, 'are you generating power?', 'By 2050, micro-generation could provide\r\n30 - 40% of the UK’s electricity needs\r\nand help reduce annual household\r\ncarbon emissions by 15%.\r\nSource: DTI, Micro-generation Strategy, March 2006\r\nwww.dti.gov.uk/energy/sources/sustainable/\r\nmicrogeneration/strategy/page27594.html', 'Microgeneration is the production of heat and/or electricity\r\non a small-scale from a low-carbon source. This can be\r\ndone by individuals, small businesses and communities to\r\nmeet their own needs with any surplus electricity exported\r\non to the grid. A signifi cant proportion of electrical power\r\nfrom central generation is lost during transmission\r\n(approximately 8% in the UK) while micro-generation\r\ndoes not incur this loss. Furthermore the various\r\ntechnologies have the potential to reduce climate change,\r\nimprove reliable energy and tackle fuel poverty.\r\nElectricity generation technologies are wind turbines,\r\nwater turbines and solar electricity. Heat generation\r\ntechnologies are solar thermal collectors, ground\r\nsource heat pumps and biomass boilers. Cogeneration\r\ntechnologies are micro combined heat and power\r\n(micro-CHP) from biomass or natural gas.\r\nIn 2004 there were approximately 82 000 micro-generation\r\ninstallations in the UK. Yet a study commissioned by\r\nthe DTI from the Energy Saving Trust suggested that by\r\n2050, micro-generation could provide 30–40% of the\r\nUK’s electricity needs and help reduce annual household\r\ncarbon emissions by 15%.', NULL, '67.jpg', '67back.jpg', 1, NULL, 'issue', 'active', NULL, 500, 1264479862, 1264479657, 1, 1, 664),
('power stations', '', 2, 2, 'is coal our salvation?', 'Global production of\r\ncoal could be ramped\r\nup by 30% to make\r\nup for the decreasing\r\nproduction of natural\r\ngas and oil in the\r\ncoming decades.\r\nSource: Coal resources and\r\nfuture production, Energy\r\nWatch Group, 28 March 2007\r\nwww.energywatchgroup.org', 'Coal-fired power stations provide 40% of global electricity\r\ndemand and natural gas provides 20%. The drive to\r\nreduce the environmental impact of power stations is\r\nincreasing the pressure to improve effi ciency of these\r\npower plants. Certainly coal will continue to be a dominant\r\nfuel for power generation worldwide for years to come\r\nand these plants have a lot of potential for improvement.\r\nFossil-fuelled generation technologies have improved\r\ncontinuously since the fi rst steam engines of the industrial\r\nrevolution. The main pathways to increased effi ciency\r\ncurrently include:\r\n• advanced boilers to produce steam at higher\r\ntemperatures and pressures\r\n• improved steam and gas turbines to handle higher\r\ntemperatures and pressures\r\n• improved gasifi ers for converting coal and heavy oils\r\nto synthesise gas\r\nCurrent best available technologies for coal have\r\nconversion effi ciencies of up to 46 - 47%, but there is\r\npotential to increase this to 60%. Similarly, for natural gas,\r\npower-generation effi ciencies could be increased from the\r\npresent 55 - 60% to 70 - 75%.', NULL, '66.jpg', '66back.jpg', 1, NULL, 'issue', 'active', NULL, 501, 1264479875, 1264479670, 1, 1, 664),
('displaced communities', '', 5, 7, 'where will all the refugees go?', 'In Azerbaijan, approximately 40% of the country’s displaced\r\npopulation (1M people, which equates to 13% of the\r\ncountry’s population) live in urban areas that have proven\r\nunsuitable and unacceptable for long-term habitation.\r\nSource: UN-HABITAT State of the World’s Cities 2006/7', 'Conflicts and crises in countries can result in the mass\r\nexodus of rural communities to urban areas, where most\r\nend up in low-income, poorly-serviced settlements, or\r\nslums. It is estimated that some 25M people have been\r\ninternally displaced by confl ict, and 70% of these are\r\nwomen. In Sudan, urban areas accommodated two-thirds\r\nof the more than 6M (a quarter of the country’s population)\r\ninternally displaced persons (IDPs) in the country in 1998.\r\nThere is no legal defi nition of the term IDP, but it is usually\r\nused to refer to people who have been forced to leave\r\ntheir home because of religious or political persecution or\r\nwar, but who have not crossed an international border.\r\nA refugee is defi ned as a person seeking asylum in a\r\nforeign country in order to escape persecution, war,\r\nterrorism, extreme poverty, famine, or natural disaster.\r\nThere are more than 8M refugees, with most being hosted\r\nby Pakistan, Iran and Germany. More than 2M Iraqis (7%\r\nof the country’s population) have fl ed their homes and\r\nthe exodus is increasing. Although many refugees and\r\ninternally dispaced persons wish to return to their former\r\nhomes, in some countries such as Somalia there may be\r\nno home to return to, as years of lawlessness have led to\r\nillegal occupation of land by armed militias.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 502, 1264479875, 1264479671, 1, 1, 664),
('electricity access', '', 1, 2, 'would a power cut stop you working?', 'Some 1.6bn people – one-quarter of the world\r\npopulation – have no access to electricity.\r\nSource: The International Energy Agency and Africa, 2003\r\nwww.iea.org/textbase/papers/2003/african_energy.pdf', 'Lack of electricity and heavy reliance on traditional\r\nbiomass are hallmarks of poverty in developing countries.\r\nFurthermore, lack of electricity exacerbates poverty and\r\ncontributes to its perpetuation, as it precludes most\r\nindustrial activities and the jobs they create.\r\nFour out of fi ve people without electricity live in rural areas\r\nof the developing world, mainly in South Asia and Sub-\r\nSaharan Africa. This pattern of electricity deprivation is set\r\nto change as 95% of the increase in population in the next\r\nthree decades will occur in urban areas.\r\nPoor people in the developing world are constantly\r\nexposed to indoor particulate and carbon monoxide\r\nconcentrations many times higher than World Health\r\nOrganization (WHO) standards. Traditional stoves\r\nusing dung and charcoal emit large amounts of carbon\r\nmonoxide and other noxious gases. Women and children\r\nsuffer most, because they are exposed for the longest\r\nperiods of time. Acute respiratory illnesses affect as much\r\nas 6% of the world population. The WHO estimates that\r\n2.5M women and young children in developing countries\r\ndie prematurely each year from breathing the fumes of\r\nindoor biomass stoves.', NULL, '75.jpg', '75back.jpg', 1, NULL, 'issue', 'active', NULL, 503, 1264479886, 1264479682, 1, 1, 664),
('fuel poverty', '', 1, 2, 'which meal will you forgo?', 'In the winter of 2003\r\n21 500 people over the age\r\nof 65 died as a direct result\r\nof the cold in England\r\nand Wales. To the nation’s\r\nshame, these numbers of\r\nunnecessary winter deaths\r\nare much higher than in\r\ncomparable European\r\ncountries.\r\nSource: www.britishgassafety.co.uk/\r\nNews.aspx?cid=133team', 'In the UK, fuel poverty applies to anyone who spends\r\nmore than 10% of their income on just keeping\r\nthemselves warm. However, fuel poverty is not just about\r\nlow incomes and unaffordable fuel prices. It is part of a\r\ncomplex picture linked to multiple deprivation together\r\nwith poor housing stock characterised by inadequate\r\ninsulation and ineffi cient heating systems.\r\nThe social implications of fuel poverty can be immense,\r\nespecially for the most vulnerable members of the\r\npopulation, such as children, the elderly and those\r\nwith disabilities or suffering from long-term illness. For\r\nexample, the effects of fuel poverty on children can lead to\r\neducational under-achievement, social exclusion, physical\r\nand psychological ill health.\r\nFuel poverty is being addressed in several ways. Between\r\n1996 and 2003 in the UK, over half of the reduction in fuel\r\npoverty was due to improvements in income, around a fi fth\r\ndue to energy price reductions and a fi fth due to energy\r\neffi ciency improvements. By 2020, it is projected that\r\nnew homes should need no more than 2000 kWh/year\r\nfor space heating, while existing housing will need to\r\nbe improved to 6800 kWh/year. In contrast, pioneering\r\nhousing in Scandinavia, where winters are often much\r\nharsher, has achieved 1000 kWh/year.', NULL, '74.jpg', '74back.jpg', 1, NULL, 'issue', 'active', NULL, 504, 1264479897, 1264479692, 1, 1, 664),
('infrastructure', '', 5, 7, 'who should pay?', 'More than a quarter of the developing world’s\r\nurban population lacks adequate sanitation.\r\nSource: UN-HABITAT Urban Indicators Programme Phase III, 2005', 'Infrastructure refers to all basic requirements needed\r\nfor the proper functioning of a community. Main\r\nservices include water, electricity, telecommunications,\r\nand transportation, as well as health, education, and\r\nsanitation. Until the 1990s, most developing countries\r\nrelied on public sector monopolies to fi nance and operate\r\ntheir infrastructure. But in the late 1980s countries such as\r\nBrazil, Argentina and Nigeria began turning to the private\r\nsector to take over the operation and development of\r\ninfrastructure, with mixed results.\r\nRapid population growth can severely hinder the capacity\r\nof poorer cities to provide adequate infrastructure\r\nfor its inhabitants. Strategic pro-poor investment\r\nby governments in services and the fi nancial and\r\ninstitutional strengthening of local authorities can all help\r\nto develop living conditions. Most importantly, there\r\nis growing consensus that improvements undertaken\r\ncooperatively and locally among citizens, community\r\ngroups, businesses and local authorities have the best\r\nchance of success. Ten years ago urban services in\r\nSomolu (a metropolitan area of Lagos with a population\r\nof one million) were in a state of neglect with widespread\r\ncorruption. The Somolu Local Authority embraced\r\nintegrative management practices involving businesses\r\nand the local community, which have resulted in dramatic\r\nimprovements in sanitation, roads and drainage.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 505, 1264479911, 1264479706, 1, 1, 664),
('occupational hazard', '', 1, 2, 'how many suffered to bring you your fuel?', 'China’s coalmine death rate per million tonnes is\r\nsome 50-fold higher than the rates in many developed\r\ncountries. In 2006, 4746 people were killed in 2945\r\ncoalmine accidents.\r\nSource: China Daily, 13 March 2007\r\nwww.chinadaily.com.cn/china/2007-03/13/content_826694.htm', 'Coal mining is a risky occupation, particularly deep\r\nunderground. The top six producer countries are China,\r\nUSA, India, Australia, South Africa and Russia. Their\r\nmodern coal mines have made great strides to improve\r\nworking conditions. Many now have rigorous safety\r\nprocedures, health and safety standards and worker\r\neducation and training, which have led to signifi cant\r\nimprovements in safety levels. (See the declining curves\r\nin Fig 1.)\r\nThe increasing global consumption of goods\r\nmanufactured in China has had repercussions on its coal\r\nindustry. China’s use of coal since 2000 has expanded at\r\nan astonishing rate of more than 10% annually.\r\nSafety in coal mining in China is still a critical issue\r\nsince the number of fatalities is unacceptably high. Of\r\nthe thousands of coal miners who die annually, the\r\noverwhelming majority are migrant peasants from rural\r\nareas, who are among the most vulnerable of the social\r\ngroups in China. The Chinese authorities do recognise this\r\nand are working hard to improve performance, closing\r\nunsafe mines and promoting best practice.', NULL, '73.jpg', '73back.jpg', 1, NULL, 'issue', 'active', NULL, 506, 1264479914, 1264479709, 1, 1, 664),
('personal mileage', '', 1, 2, 'how far do you roam?', 'In 1950 the average Briton travelled 5 miles a day;\r\ntoday it’s more than 30 miles and forecast to double\r\nagain in the next two decades.\r\nSource: Clipping Our Wings?, BBC Radio 4’s Analysis, 1 March 2007\r\nhttp://news.bbc.co.uk/1/hi/programmes/analysis/6389415.stm', 'Why has mobility come to mean so much? Not only\r\nis it a means to get around, secure a job and the\r\nway we trade and create new things, but it is also an\r\nexpression for many of a personal liberty they don’t\r\nwant restricted.\r\nBetween 1997 and 2004, car journeys in the UK\r\nincreased by 9% and this growth is expected to\r\naccelerate. Projection is for traffi c to grow by 26%\r\nbetween 2000 and 2010, implying an annual average\r\nincrease of 2.3%. Declining job security may be one\r\nreason for commuting distances to have increased\r\nover the last fi ve years; the UK has the longest car\r\ncommutes in Europe in terms of distance and time.\r\nOur types of journey are also changing. In 2004 we\r\ncycled 6% less then we did in 1992. Many of those\r\nwho once walked or cycled now use cars for the same\r\ntrips instead; one quarter of all car journeys cover less\r\nthan 2 miles, for example, the school run.\r\nThe job of restraining this consumption of energy\r\nand reducing emission of greenhouse gases as\r\nwell as easing congestion falls to governments. But\r\ngovernments constantly have to negotiate the paradox\r\nof mass movement: create a system that treats\r\ntraffi c like a herd while granting drivers the illusion of\r\nautonomy and the freedom of the road.', NULL, '72.jpg', '72back.jpg', 1, NULL, 'issue', 'active', NULL, 507, 1264479928, 1264479723, 1, 1, 664),
('planning policies', '', 5, 7, 'who are cities planned for?', 'Every week for the next 30 years, the\r\nequivalent of a new 1M population city\r\nis needed to accommodate the doubling\r\nof the urban population of developing\r\ncountries from 2bn to 4bn.\r\nSource: World Urban Forum 3', 'One out of every three urban dwellers – nearly 1bn people\r\n– lives in a slum. Some low- or middle-income countries\r\n(such as Brazil, Colombia, Philippines, Indonesia, South\r\nAfrica and Sri Lanka) have managed to prevent some\r\nslum formation by anticipating and planning for growing\r\nurban populations. They have achieved this by expanding\r\neconomic and employment opportunities for the urban\r\npoor, by investing in low-cost affordable housing for\r\nthe most vulnerable groups, and by instituting pro-poor\r\nreforms and policies that have had a positive impact on\r\nlow-income people’s access to services.\r\nThe absence of effective governance structures\r\nresults in a lack of planning, development control, and\r\ninfrastructure provision. Allowing settlements to develop\r\nspontaneously can result in problems. This tends to take\r\nplace at the periphery of cities and it is rarely possible to\r\nretro-fi t effective public transport, so workers face long,\r\ninconvenient and congested journeys. Uncontrolled\r\nphysical expansion destroys natural landscapes that\r\nshould be preserved as parks, reserves, or open space.\r\nThe World Health Organization recommends at least 8m²\r\nof green open space per capita in cities. In an increasingly\r\nurbanised world, performance based planning policies\r\nwith an acute awareness of social contexts are needed for\r\nboth urban and rural areas.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 508, 1264479936, 1264479731, 1, 1, 664),
('affluence', '', 1, 2, 'can we all be consumers?', 'By 2050, energy demand could double or\r\ntriple as population rises and developing\r\ncountries expand their economies and\r\novercome poverty.\r\nSource: World Business Council for Sustainable\r\nDevelopment, Facts & Trends to 2050 - Energy &\r\nclimate change, September 2004\r\nwww.wbcsd.org/web/publications/facts-and-trends.pdf', 'Using gross domestic product (GDP) as a measure of\r\nwealth, the chart shows the relationship between energy\r\nuse and wealth per capita for a wide range of countries.\r\nThere is a clear indication that energy use per capita\r\nincreases as economic growth rises.\r\nAs countries develop economically, three phases can be\r\nidentified (for US$ per capita at 1995 purchase power parity):\r\n• Above $3000, energy demand explodes as\r\nindustrialisation and personal mobility take off\r\n• Above $15 000, demand grows more slowly as the\r\nmain burst of industrialisation is complete and services\r\nbegin to dominate\r\n• Beyond $25 000, economic growth can continue\r\nwithout signifi cant energy increases, but the absolute\r\nlevel varies widely depending on national circumstances\r\nEmerging economies, such as Malaysia, appear to be\r\nfollowing this trajectory. In addition to per capita increases,\r\nChina’s high population exacerbates the total demand for\r\nprimary energy.', NULL, '71.jpg', '71back.jpg', 1, NULL, 'issue', 'active', NULL, 509, 1264479937, 1264479732, 1, 1, 664),
('rural areas', '', 5, 7, 'who will be left?', 'The rural population is forecast to decline\r\nafter 2015 with a decrease of more than\r\n155M people worldwide over 15 years.\r\nSource: UN-HABITAT State of the World’s Cities 2006/7', 'In 18th century Britain people were driven from the land to\r\nurban areas because of farm enclosures. More recently,\r\nthe mechanisation of agriculture and the amalgamation of\r\nfarms has reduced rural job opportunities. In some parts\r\nof the world, major environmental changes, such as soil\r\nerosion, have contributed to the decline of rural economies.\r\nThree-quarters of all governments have reported that\r\nthey are dissatisfi ed with the spatial distribution of their\r\npopulations. Many developing countries have enacted\r\npolicies to reduce the fl ow of persons moving to urban\r\nareas. This emphasises the need for integrated ruralurban\r\nplanning. China, for example, is promoting a\r\n“harmonious society” policy, which includes reducing\r\nthe wealth gap between urban and rural areas. In 2005,\r\naverage per capita income of urban residents was 3.22\r\ntimes that of farmers. In addition, a survey by the Chinese\r\nNational Bureau of Statistics showed that 10% of urban\r\nresidents commanded 45% of the total wealth in Chinese\r\ncities, while the bottom 10% shared only 2% of the total\r\nwealth. The wealth gap between urban and rural areas is\r\nalso expanding. Offi cials and researchers are concerned\r\nthat if the government fails to take effective measures to\r\nnarrow inequalities, the public may stop supporting its\r\neconomic reform and open-door policy, resulting in more\r\nsocial unrest.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 510, 1264479955, 1264479750, 1, 1, 664),
('heat islands', '', 3, 7, 'how will you keep cool?', 'environmental urbanisation\r\nA consequence of urban heat islands is the increased\r\nenergy required for air conditioning and refrigeration in\r\ncities that are in comparatively hot climates. The Heat\r\nIsland Group estimates that the heat island effect costs\r\nLos Angeles about $100M per year in energy.\r\nSource: http://en.wikipedia.org/wiki/Urban_heat_island_effect', 'Large cities can disturb weather patterns, creating a\r\nmicroclimate called an urban heat island (UHI). Urban\r\nareas can have UHIs that may be up to 5-6°C warmer\r\nthan the surrounding countryside. Compared with\r\nvegetated surfaces, building materials retain more\r\nsolar energy during the day, and have lower rates of\r\nradiant cooling during the night. Urban areas also have\r\nlower wind speeds, less convective heat losses and\r\nevapotranspiration*, yielding more energy for surface\r\nwarming. Artifi cial space heating, air conditioning,\r\ntransportation, cooking and industrial processes introduce\r\nadditional sources of heat into the urban environment,\r\ncausing distinct weekly cycles in UHI intensity.\r\nForms of heat island mitigation include installing cool or\r\nvegetated green roofs, planting trees, and switching to\r\ncool paving materials that are lighter coloured and porous.\r\nAccording to the Center for Disease Control & Prevention,\r\nexcessive heat claims more lives in the US each year\r\nthan hurricanes, lightning, tornadoes, fl oods, and\r\nearthquakes combined.\r\n*Evapotranspiration is the water lost to the atmosphere by\r\nevaporation and transpiration.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 511, 1264479981, 1264479776, 1, 1, 664),
('flooding', '', 3, 7, 'will your city drown?', 'By the end of this century sea levels are likely to rise by 28-43cm or dramatically\r\nmore if rapid melting of the Greenland and Antarctic ice sheets occurs. 22 of the\r\nworld’s major cities are at risk of fl ooding from coastal surges.\r\nSource: IPCC Report, Climate Change, 2007 and Munich Re Group, Megacities - megarisks, 2005', 'There is growing consensus that the populations,\r\ninfrastructure, and ecology of cities are at risk from the\r\nimpacts of climate change. Water and food shortages\r\nand an infl ux of “climate refugees” are just some of these\r\nimpacts likely to occur unless drastic action is taken to\r\nreduce the emission of greenhouse gases. Rising sea\r\nlevels due to global warming would take a heavy toll on\r\ncities because many are located on low ground close to\r\nthe sea; 40% of the world’s population live within 65km\r\nof the sea. Many non-coastal cities would also face\r\nproblems of fl ooding as they are beside rivers or in the\r\nfoothills of mountains in locations vulnerable to intense\r\nrainfall or snowmelt.\r\nUrban areas are both subject to, and an increasing\r\ncomponent of, regional climate change. Most of the\r\nincrease of CO2 in the atmosphere is attributable to energy\r\nconsumption in the world’s cities. The highly urbanised\r\ndeveloped regions of the world generate by far the greatest\r\nproportion of CO2. While many of these countries are\r\nputting in place reforms to limit CO2, emissions are rising\r\nin the industrialising cities of Asia. With CO2 emissions\r\nincreasing to record highs, global warming may soon\r\nbe irreversible; 11 of the last 12 years (1995 - 2006) rank\r\namong the 12 warmest years in the instrumental record of\r\nglobal surface temperature since 1850.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 512, 1264479998, 1264479793, 1, 1, 664),
('eco-cities', '', 3, 7, 'how green is your city?', '“The historical experience of human progress shows\r\nthat we should never seek development at the cost\r\nof wasting resources and damaging the environment.\r\nDevelopment should be promoted along the road of high\r\ntechnological content, sound economic effi ciency, low\r\nresources consumption, little environmental pollution,\r\nand full use of human resources.”\r\nSource: Hu Jintao, President of the People’s Republic of China, speech at\r\nthe APEC CEO Summit, Santiago, Chile, 19 November 2004', 'Rising concerns about the adverse environmental impacts\r\nof urbanisation are generating considerable interest in\r\nthe development of eco-cities. “Eco-city” can be used to\r\ndefi ne new settlements adopting a sustainable approach\r\nto urban development, or existing municipalities that\r\nhave implemented regulations for restoration and further\r\nconstruction as part of an integrated environmental policy.\r\nOne such example is Freiburg, Germany, which, since\r\nJune 1992, only permits the construction of “low-energy”\r\nbuildings on municipal land. Lease and bills of sale contain\r\nrulings that 5000m² must be kept clear for solar collectors.\r\nOther elements of the municipal authority’s eco-approach\r\ninclude low-priced tickets for local public transportation,\r\nand a power station using methane gas from the municipal\r\nwaste disposal site.\r\nChina is working on a new paradigm of urban development\r\nto deal with the rising pollution and resource depletion\r\nassociated with its rapid urbanisation process. To\r\ndemonstrate this approach, Dongtan, a new city for up\r\nto 500 000 residents, is being developed on Chongming\r\nIsland, adjacent to Shanghai. It will have at its core an\r\nintegral and systematic plan for the construction of\r\ninfrastructure, environmental protection, industrial ecology\r\nand social resilience. Work on the masterplan began\r\nin 2005 and the aim is to complete the fi rst phase of\r\ndevelopment for the Shanghai Expo in 2010.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 513, 1264480029, 1264479824, 1, 1, 664),
('natural disasters', '', 3, 7, 'is your city in the right place?', '50% of the world’s cities with a population above 2M\r\nare located on or near sites at risk of earthquakes of\r\nup to 7.5 on the Richter scale.\r\nSource: Prof Roger Bilham, University of Colorado at Boulder\r\nwww.innovations-report.de/html/berichte/geowissenschaften/bericht-\r\n18136.html', 'Many of the world’s largest cities are concentrated in\r\nareas where earthquakes are most likely. 75% of the\r\nworld’s population lives in areas affected at least once\r\nby an earthquake, a tropical cyclone, fl oods, or drought\r\nbetween 1980 and 2000. Poor people in developing\r\ncountries are particularly vulnerable to disasters as\r\nthey are more likely to live on dangerous fl oodplains,\r\nriver banks, steep slopes and reclaimed land, and their\r\nhousing is less likely to survive a major disaster. An\r\ninvestigation into the 2003 earthquake in Bam, Iran, found\r\nthat most of the 40 000 people killed lived in housing built\r\nin the traditional mud-brick style structurally unable to\r\nwithstand tremors.\r\nIn poor countries, disasters not only wipe out decades of\r\ndevelopment in a matter of hours, they can also have a\r\nsignifi cant impact on GDP. The 2004 tsunami resulted in\r\nAceh, Indonesia, suffering destruction of its capital stock\r\nequivalent to 97% of its GDP. Grenada lost the equivalent\r\nof 200% of its GDP to Hurricane Ivan. Understanding\r\nurban vulnerability is the fi rst step toward developing\r\nmitigation strategies that effectively improve resilience and\r\nreduce vulnerabilities of urban populations in the long term.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 514, 1264480055, 1264479850, 1, 1, 664),
('urban footprint', '', 3, 7, 'how many worlds will an\r\nurban future need?', 'Cities house half the world’s population but\r\nconsume three-quarters of the world’s resources\r\nand produce three-quarters of the world’s pollution.\r\nSource: H Girardet, Cities People Planet, 2004', 'The ecological footprint measures humanity’s demand\r\non the biosphere and it is referred to in terms of global\r\nhectares (gha) per capita, this being a hectare with\r\nworld-average ability to produce resources and absorb\r\nwastes. In 2003 the world’s biocapacity was 11.2bn\r\ngha, equivalent to 1.8 gha per person based on then\r\ncurrent population numbers - however the average\r\nglobal footprint was 2.2 gha per person. This overshoot\r\nmeans that it took approximately 15 months for the globe\r\nto produce the resources used and absorb the wastes\r\ngenerated in that year. The more urbanised parts of the\r\nworld have signifi cantly larger ecological footprints - the\r\naverage in Africa is 1.1 gha, and in North America it is\r\n9.4 gha per person.\r\nTwo-thirds of the world’s ecosystems are now severely\r\ndamaged, mostly due to global urban consumption and\r\nwaste disposal. It is widely assumed that urbanisation will\r\ncontinue. But the growing scarcity of water and the high\r\ncost of the energy invested in transporting water over long\r\ndistances may itself begin to constrain urban growth. For\r\nexample, some 400 cities in China are already facing a\r\nchronic shortage of water. In a world of land, water, and\r\nenergy scarcity, the value of each resource may increase\r\nsubstantially, shifting the terms of trade between rural and\r\nurban areas.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 515, 1264480073, 1264479868, 1, 1, 664),
('congestion', '', 4, 7, 'how long do you wait?', 'In 2005 the number of vehicles in use worldwide\r\nexceeded 1bn. In European cities, 20-25% of\r\nurban space is devoted to transport activities,\r\ncompared to only 7-11% in Bangkok and Calcutta.\r\nSource: P Hall, and U Pfeiffer, Urban Future 21, 2000', 'Congestion is a ubiquitous urban experience in both\r\ndeveloped and less-developed countries – and car\r\nownership continues to increase. The car has produced a\r\nmobility revolution that has transformed cities worldwide,\r\nbut some consider it is now driving the city into a dead\r\nend from which it cannot escape. In the UK it is estimated\r\nthat congestion costs the economy £20bn a year. In Los\r\nAngeles a study by the Texas Transportation Institute\r\nsays that the hours lost per year to congestion by a peaktime\r\ntraveller on the road increased from 47 in 1982 to\r\n136 in 2000.\r\nSome countries are seeking to limit congestion through\r\nplanning. For example, in 2006 the Indian Government\r\noffi cially approved the National Urban Transport Policy\r\nwhich is intended to guide the long-term planning of\r\nIndia’s major cities that will experience a large population\r\nincrease in the future. The policy is intended to encourage\r\nintegrated land use and transport planning in cities,\r\nwhile targeting greater use of public transport and nonmotorised\r\ntransport modes backed by central fi nancial\r\nassistance. It has been drawn up to spur the development\r\nof safe, affordable and convenient transport access for the\r\ngrowing number of residents in India’s expanding cities.\r\nTransport planning to minimise travel distances will be\r\nemphasised as part of improving city dwellers’ access to\r\nworkplaces, education, and other social needs.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 516, 1264480091, 1264479886, 1, 1, 664),
('agriculture', '', 4, 7, 'where should your food be grown?', 'Shanghai is one of the world’s fastest-growing\r\ncities, yet half the 630 000ha administered by the\r\nauthorities has been set aside for urban agriculture.\r\nSource: H Girardet, Cities People Planet, 2004', 'The development of urban areas was made possible\r\nthrough the concentration of food production to create a\r\nsurplus. But many cities have now come to depend on\r\nhighly unsustainable supplies for most of their food. In\r\nLondon, the components of a typical Sunday lunch for\r\nfour people travel over 24 000 miles. This practice is in\r\nmarked contrast to that of many cities of the developing\r\nworld, which have built upon a tradition of sourcing food\r\ngrown locally.\r\nUrban agriculture – the practice of growing, raising,\r\nprocessing and distributing food in and around an\r\nurban area – contributes signifi cantly to household\r\nfood security, particularly among low-income groups.\r\nCuba has become a world leader, with food production\r\ndecentralised from large mechanised state farms to\r\nurban cultivation systems. Half of Shanghai’s pork and\r\npoultry, 60% of its vegetables and 90% of its milk and\r\neggs come from the city and its outskirts. Dar es Salaam\r\nutilises 650ha of land to produce vegetables, providing a\r\nlivelihood for 4000 urban farmers while 80% of Hanoi’s\r\ndemand for fresh vegetables comes from farms within\r\nand around the city. According to the 2007 State of the\r\nWorld report, the income of farmers living in and around\r\nBeijing has doubled in the past decade.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 517, 1264480108, 1264479903, 1, 1, 664),
('poverty', '', 4, 7, 'are there two cities within each city?', 'One fi fth of the world’s population live in countries\r\nwhere many people think nothing of spending $2 a\r\nday on a cappucino. Another fi fth of the population\r\nsurvive on less than a dollar a day.\r\nSource: UNDP Human Development Report, International\r\ncooperation at a crossroads - aid, trade and security in an unequal\r\nworld, 2005', 'The link between urbanisation and socio-economic\r\ndevelopment is rarely disputed. But in many cities\r\nworldwide, economic growth has not resulted in\r\nprosperity for all. Instead the gap between rich and poor\r\nhas widened. In 2006 UN-HABITAT stated that many\r\ncities consist of two within one. The population of one\r\nhas all the benefi ts of urban living, while in the other, the\r\npoor live in slums and squatter settlements that are often\r\nworse than those of their rural relatives.\r\nSub-Saharan African countries have some of the world’s\r\nhighest levels of urban poverty, extending to more than\r\n50% of the urban populations in Chad, Niger and Sierra\r\nLeone. In Asia, India has the highest urban poverty levels,\r\nat 30%. In the US, a survey of 23 cities found that the\r\nrequests for food aid and shelter rose by 19 per cent\r\nbetween 2004 and 2006. While rural areas are currently\r\nhome to most of the world’s poor, by 2035 cities are\r\npredicted to become the predominant sites of poverty.\r\nThe high cost of items such as transport, health, education\r\nand water, coupled with poor living conditions, including\r\ninadequate housing and poor access to basic services,\r\naffect the ability of the urban poor to rise out of poverty.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 518, 1264480127, 1264479922, 1, 1, 664),
('global economy', '', 4, 7, 'who controls your job?', 'The accelerating pace of globalisation is having a\r\nprofound effect on life in rich and poor countries\r\nalike, transforming cities such as Detroit or\r\nBangalore from boom to bust - or vice versa - in\r\na generation. India is the world’s leading exporter\r\nof IT services, with its volume of offshore business\r\ndoubling every three years.\r\nSource: http://news.bbc.co.uk/1/hi/business/6279679.stm', 'Cities function as engines of economic growth. The\r\nestablishment of new technologies in the 1980s resulted\r\nin the globalisation of economic forces and changes to\r\nemployment structures. As a result, around 65% of the\r\nworld’s working population has become active in the\r\nservice industries, mostly in urban areas. The expansion\r\nof offi ce operations in major cities goes hand in hand with\r\nthe expansion of operations globally. Today global fi rms\r\nhave taken over some governance capabilities and the 100\r\nrichest fi rms are wealthier than many nation states.\r\nIn the past decade, Bangalore has been the hub for IT\r\nservices for many foreign companies. But salaries for “info\r\ntech staff” are growing at 12% to 14% a year, turnover\r\nis increasing, and an infl ux of workers is straining city\r\nresources. As a result, the outsourcing of such services\r\nis starting to expand into smaller Indian cities, as well\r\nas China. Other cities on the list include Moscow, St.\r\nPetersburg and Prague. India, however, remains an IT\r\noutsourcing powerhouse, with US$17.7bn in software\r\nand IT services exports in 2005, compared with $3.6bn\r\nfor China and $1bn for Russia, according to trade\r\norganisations in each country. Moving IT operations into\r\ndeveloping countries like Vietnam or China can also pose\r\nrisks, such as insurmountable language and cultural\r\ndifferences, geopolitical instability, and the risk of stolen\r\nintellectual property, all of which can negate savings.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 519, 1264480147, 1264479942, 1, 1, 664),
('connectivity', '', 2, 7, 'how do you keep in touch?', 'Five years ago in Nigeria, there\r\nwere 370 000 people with\r\nmobile phones. Just four years\r\nlater, mobile phone users in\r\nthe country topped 16.8M.\r\nSource: http://web.worldbank.org/', 'There has been a signifi cant increase in the number of\r\nindividuals with access to telephones, with developing\r\ncountries accounting for more than 60% of the world’s\r\ntelephone lines in 2005, most of the growth being in\r\nmobile telephones which now outnumber fi xed ones.\r\nEven poor households can benefi t from telephone access\r\nthrough prepaid services and calling cards. New wireless\r\ntechnology and associated business models have\r\nincreased competition and accelerated the development\r\nof broadband infrastructure worldwide. In particular, they\r\nhave helped connect the urban poor and rural communities\r\nwith affordable yet commercially viable services.\r\nSome cities are actively promoting wireless communities.\r\nFor example, in the UK, Glasgow City Council aims to\r\nlead the world in providing a municipal wireless service to\r\nsupport economic growth, enhance the delivery of public\r\nservices and add to the wellbeing of its citizens and all\r\nthose who work in or visit the city. In some developed\r\ncountries, advances in digital technology have reduced\r\nthe physical need to be in urban areas, allowing remote\r\nworking, etc. However, perhaps suprisingly, research\r\nhas shown that more telecommunications increase the\r\ndemand for face-to-face contact, which most readily\r\ntakes place in cities.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 520, 1264480166, 1264479961, 1, 1, 664),
('techno-reliance', '', 2, 7, 'how vulnerable are you?', 'The US north-east blackout of 2003 affected\r\npower generation, water supply, trains, air\r\nservices, fuel supplies at gas stations, oil\r\nrefi neries, communication systems (including\r\nwired and mobile telephones, as well as radio,\r\ntelevision and the internet), and large numbers of\r\nfactories were closed.\r\nSouce: http://en.wikipedia.org/wiki/2003_North_America_blackout', 'Urbanisation implies a shift from dependence on a rural\r\nenvironment where natural resource is paramount, to\r\nreliance on a built environment and on technology. With\r\nincreased dependence on the technical infrastructure\r\nof urban environments can come vulnerability - either\r\nfrom technology failing, or from increased susceptibility\r\nto malicious intervention, such as a terrorist attack. Tall\r\nbuildings are perhaps the most reliant on technology, and\r\nthe number of such buildings in urban areas is forecast to\r\nincrease dramatically. Between 2001 and 2012 almost as\r\nmany skyscrapers will be constructed as were built in the\r\nwhole of the 20th century. Urban transport systems, such\r\nas underground or high speed rail, are also dependent\r\non technology – if systems fail, populations are severely\r\ndisrupted. In recent years, both tall buildings and transport\r\nsystems have also been the focus of terrorist attacks.\r\nEnergy shortages and blackouts (for example, in North\r\nAmerica and in Italy in 2003 and in Western Europe in\r\n2006) have illustrated this vulnerability. The 2003 power\r\noutage blackout in Italy affected a total of 56M people\r\nin that country and Switzerland, leaving many stranded.\r\nThe November 2006 power failure led to people being\r\nstuck in lifts in Paris, as well as train delays in Germany’s\r\nRuhr region.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 521, 1264480189, 1264479984, 1, 1, 664),
('community', '', 1, 7, 'do you know your neighbours?', 'London is home to\r\npeople from more than\r\n200 different cultural\r\ncommunities. Such diversity\r\nstimulates creativity,\r\nwhich is why London has\r\nbecome a global hotspot\r\nfor innovative theatre, fi lm,\r\nart, dance, music, fashion,\r\nand food.\r\nSource: www.london2012.org/en/\r\nourvision/olympism+and+culture/', 'Urban areas often bring together a mix of people and\r\ncultures. Sao Paulo, for example, with its core population\r\nof 10.6M, has the largest Lebanese urban community\r\noutside Lebanon and the largest Japanese “city” outside\r\nJapan as well as the world’s third-largest Italian urban\r\npopulation. Colombia’s capital, Bogotá, has seen a tenfold\r\nincrease in its population since the 1960s and less than\r\n50% of its inhabitants were born within the city. Its multiethnic\r\npopulation, including Caucasians, Afro-Colombians\r\nof the Pacifi c and 47 indigenous groups of remote\r\norigins, all contribute to a rich cultural fabric. Against\r\nthis background, the city authorities adopted a radical\r\nsustainable development plan over the past ten years to\r\noffer its communities opportunities – for example, car-free\r\ndays - to reclaim the streets and to stimulate diverse\r\nsocial interactions.\r\nIn contrast, gated communities have, since the 1970s,\r\nbecome a symbol of urban fragmentation and social\r\nsegregation in many North and South American cities.\r\nIn the US, they represent an average of 10% of the new\r\nhomes market and more than 30% in low-density urban\r\nareas. The motivations for living in a gated community\r\nare mostly driven by fear of crime and difference. Various\r\nstudies have shown that no single criterion of class,\r\ngender, or wealth is as important as the number of social\r\nrelationships a person has for happiness.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 522, 1264480204, 1264479999, 1, 1, 664),
('aspirations', '', 1, 7, 'are urban opportunities a myth?', 'The top 50 countries in the United Nations 2006 Human Development Index\r\n(a comparative measure of life expectancy, literacy, education, and standard\r\nof living) all have more than half of their populations living in urban areas.\r\nSource: United Nations Development Programme, reproduced with permission of Palgrave Macmillan\r\nhttp://hdr.undp.org/hdr2006/statistics/indicators/41.html', 'Across the world, cities are seen as attractive economic,\r\nsocial and cultural centres. According to the architect\r\nRichard Rogers “Cities are for the face-to-face meeting\r\nof people, for the exchange of ideas and the purpose of\r\ntrade. They are the heart of our culture and the engines\r\nthat drive our economy.” In many developing countries,\r\nurban areas are magnets that attract people from small\r\ntowns and rural areas, because cities offer more hope of\r\njobs, education, healthcare, and better living standards.\r\nAs well as the “pull” factor of more opportunity, there are\r\nthe “push” factors of stagnant rural economies, inequitable\r\nland distribution, and degraded environments.\r\nIn 2003, the Ugandan National Household Survey\r\nfound a much higher rate of literacy in urban areas\r\n(87%) compared to rural areas (65%). Improved literacy\r\nincreases the capacity of people to communicate and to\r\nbe reached through the electronic and print media, the\r\ncapability to effectively participate in their communities\r\nand in broader governance issues, and provides new\r\nopportunities to engage in wealth creation. However, it\r\ncannot be assumed that all urban dwellers benefi t from\r\nbasic services by virtue of proximity. Many incoming\r\nmigrants remain without adequate jobs, housing or urban\r\nservices – or often, all three.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 523, 1264480235, 1264480030, 1, 1, 664),
('health', '', 1, 7, 'is city living good for you?', 'Tuberculosis is making a worrying comeback in\r\nLondon, with a fourfold increase in some areas over the\r\nlast decade. In the world today, more people are dying\r\nof tuberculosis than at any other time in history.\r\nSource: www.london.gov.uk/assembly/reports/health/tb.pdf', 'Healthcare facilities are one of the many benefi ts offered\r\nby urban areas. However, urbanisation has become\r\nvirtually synonymous with slum growth, and people living\r\nin slums have worse health outcomes and are more likely\r\nto be affected by child mortality and acute respiratory\r\nillnesses than their non-slum counterparts. In developed\r\ncountries, urban areas are also suffering health problems,\r\nsuch as the increase of tuberculosis in London. The city is\r\nnow a tuberculosis hotspot with nearly half of all UK cases\r\noccuring in the capital - around 3000 each year - double\r\nthe total of 15 years ago.\r\nIn recent years, urbanisation has emerged as an\r\nincreasingly important factor in the spread of HIV/AIDS.\r\nResearch has shown that the disease often starts in cities\r\nthen moves into the countryside along trucking routes.\r\nIn India, migrant workers who travel from remote villages\r\nlooking for work in the cities are spreading the HIV virus\r\nthroughout the country. The UN estimates that India has\r\nthe highest number of HIV infections (5.7M people) of\r\nany nation. Cities and their poor are disproportionately\r\naffected by the HIV/AIDS pandemic in both the developed\r\nand developing regions of the world. In the US and\r\nCanada for example, HIV prevalence is closely linked to\r\nurban poverty.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 524, 1264480250, 1264480045, 1, 1, 664),
('housing', '', 1, 7, 'is the roof over your head robust?', '18% of all urban housing units are nonpermanent\r\nstructures. One-third of the\r\nworld’s urban population lives in what are\r\ndefi ned by the UN as slum conditions.\r\nSource: UN-HABITAT State of the World’s Cities 2006/7', 'Urbanisation in less-developed countries is often\r\ncharacterised by poor quality housing and a lack of\r\nsecurity of tenure. Migrants may leave housing in rural\r\nareas with better physical and environmental quality and\r\nsecurity of tenure, for poorer quality housing in urban\r\nareas because of the economic benefi ts considered to\r\nbe offered by towns and cities. Non-empirical evidence\r\nfrom UN-HABITAT indicates that 30% to 50% of\r\nurban residents in the developing world have no legal\r\ndocuments such as a title deed or contract to prove\r\ntenure security. Without these papers, forced urban\r\nevictions can result.\r\nRapid urbanisation often leads to slum settlements\r\nand shanty towns. Durable housing is one of the fi ve\r\nconditions used by the UN to defi ne slum conditions.\r\nA house is considered ‘durable’ if it is built on a nonhazardous\r\nlocation and has a permanent structure,\r\nadequate to protect its occupants from extremes\r\nof climatic conditions such as rain, heat, cold, and\r\nhumidity. Given the predicted growth in urbanisation in\r\nless-developed countries, the problems of non-durable\r\nhousing and lack of security of tenure are likely to worsen.\r\nIt is up to government agencies, corporate and civic\r\nleaders to adopt integrated approaches to environmental\r\nplanning and management to prevent this happening.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 525, 1264480264, 1264480059, 1, 1, 664),
('growth', '', 1, 7, 'is your city too big?', 'The global urban population is forecast to double from\r\n2000 to 2025, and 180 000 people are added every\r\nday. 95% of urban growth in the next two decades will\r\nbe in the less-developed world.\r\nMore than half of the world’s urban population live in\r\nsettlements of 500 000 people or fewer.\r\nSource: World Urban Forum 2006', 'Urbanisation is defi ned as growth in the proportion of a\r\ncountry’s population living in urban areas. However, there\r\nis no universal defi nition of “urban”, with governments\r\nusing methods such as administrative criteria, population\r\nsize or density, economic characteristics and urban\r\ninfrastructure. Urbanisation has accelerated rapidly over\r\nthe last century. In 1900, 15% of the world’s 1.5bn people\r\nlived in urban areas. By 2000, the global population had\r\nincreased to 6bn and the percentage living in urban areas\r\nhad grown to 47%.\r\nDuring the 19th and 20th centuries, urbanisation was\r\nlargely concentrated in the north and arose from the\r\nspread of industrialisation and the rapid increase in the\r\nuse of fossil fuel-based technologies. Now, urbanisation\r\nis happening more in the south, mainly due to industrial\r\ndevelopment, the mechanisation of agriculture and, in\r\nsome places, drastic rural decline. China and India, the\r\ntwo most populous and traditionally rural countries,\r\nrespectively have 37% and 29% of their populations\r\nliving in urban areas, and this proportion is increasing.\r\nBy 2030 the proportion of Africa’s urbanised population\r\nis expected to reach 53%, mirroring the global trend for\r\nurban growth.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 526, 1264480281, 1264480077, 1, 1, 664);
INSERT INTO `card` (`name`, `safe_name`, `category_id`, `topic_id`, `question`, `factoid`, `description`, `image`, `card_front`, `card_back`, `origin_event_id`, `uri`, `type`, `status`, `params`, `id`, `ctime`, `mtime`, `owner`, `group`, `perms`) VALUES
('HIV/AIDS', '', 5, 6, 'are developing countries\r\nlosing their future?', 'The UN Development Programme estimates that\r\nfewer than 50% of South Africans currently alive\r\ncan expect to reach the age of 60, compared\r\nwith an average of 70% for all developing\r\ncountries and 90% for industrialised countries.\r\nSource: US State Department,\r\nAIDS: The threat to world security, July 2000\r\nhttp://usinfo.state.gov/journals/itgic/0700/ijge/ijge0700.pdf', 'The estimated number of adults living with HIV around the\r\nworld was 1.5M in 1985 . In 2006, approximately 39.5M\r\npeople were living with HIV including the 4.3M who were\r\ninfected in that year. Around one-tenth of the world’s\r\npopulation live in Sub-Saharan Africa, which is home to\r\nalmost 63% of all people living with HIV (an estimated\r\n24.7M). Almost 9 out of 10 children living with HIV are in\r\nsub-Saharan Africa, two million in all.\r\nIn the decades ahead, the centre of the global HIV/AIDS\r\npandemic is set to shift from Africa to Eurasia. East Asia,\r\neastern Europe and Central Asia show the sharpest rises\r\nin HIV cases. And it is expected that the death toll in that\r\nregion’s three pivotal countries - Russia, India, and China\r\n- could be unprecedented. Eurasia is home to the great\r\nmajority of the world’s population; fi ve out of every eight\r\npeople on the planet live there.', NULL, '40.jpg', '40back.jpg', 1, NULL, 'issue', 'active', NULL, 527, 1264480753, 1264480548, 1, 1, 664),
('resource conflicts', '', 5, 6, 'what will you fi ght for?', '“The blunt truth is that the lack of water and\r\nagricultural land is a signifi cant contributory\r\nfactor to the tragic confl ict we see unfolding\r\nin Darfur. We should see this as a warning\r\nsign.”\r\nSource: John Reid, former British Defence Secretary, in\r\nMichael T Klare, The Coming Resource Wars, Institute of\r\nAmerica’s Future, 7 March 2006', 'Global climate change and dwindling natural resources\r\nare combining to increase the likelihood of violent confl ict\r\nover land, water and energy.\r\nWhile resource confl icts are most likely to arise in the\r\ndeveloping world, the more advanced and affl uent\r\ncountries are not likely to be spared the damaging and\r\ndestabilising effects of global climate change. With the\r\nworld population rising, global consumption rates soaring,\r\nenergy supplies rapidly disappearing, and climate change\r\neradicating valuable farmland, the stage is being set for\r\npersistent and worldwide struggles over vital resources.\r\nReligious and political strife will not disappear in this\r\nscenario, but rather will be funnelled into contests over\r\nvaluable sources of water, food and energy. It is believed\r\nthat over time, confl icts over land and water use are likely\r\nto become more severe – and more violent. As states\r\nbecome increasingly desperate, the pressure for action\r\nwill grow.', NULL, '39.jpg', '39back.jpg', 1, NULL, 'issue', 'active', NULL, 528, 1264480766, 1264480561, 1, 1, 664),
('food industry', '', 5, 6, 'who controls what we eat?', 'Advertising expenses totalled US$26.1bn\r\nand accounted for 4 percent of food\r\nexpenditures in 2000.\r\nSource: www.resurgence.org/resurgence/articles/\r\ntim_lang.htm', 'The world is producing more food than ever before.\r\nGlobally there are over 25 000 products in the average\r\nsupermarket, and more than 20 000 new packaged foods\r\nand beverages came onto the market in 2002 alone.\r\nMaking food is very big business. Food companies in\r\n2000 generated nearly US$900bn in sales. Within the\r\nindustry, companies compete fi ercely for consumer\r\ndollars, spending US$30bn annually on marketing and\r\nadvertising campaigns. The economic underpinnings\r\nof what goes on in the politics of food have increasingly\r\nfallen under the scrutiny of food policy lobby groups.\r\nEconomic growth in the food industry, as constructed in\r\nthe 20th century, depends upon convincing people to eat\r\nmore. And the higher profi t margins lie with value-added\r\n(ie, processed) foods and not mere raw ingredients. Water,\r\nsalt, fat and sugar are the most cost-effective additives,\r\nas is minimum-wage labour. Currently, only 20% of the\r\nfood dollar goes to the farm. The pivotal transition is\r\nfrom a food policy world dominated by farming\r\nand agriculture, to one dominated by consumption.\r\nMajor branded food manufacturers, food retailing\r\nand food service are causing new tensions and will\r\ncontinue to be central to the food wars and food\r\npolicy debate.', NULL, '38.jpg', '38back.jpg', 1, NULL, 'issue', 'active', NULL, 529, 1264480969, 1264480764, 1, 1, 664),
('primary needs', '', 5, 6, 'are food emergencies inevitable?', 'Armed confl icts are now the leading cause of world\r\nhunger with the effects of HIV/AIDS and climate\r\nchange not far behind, according to an FAO report\r\npresented to the Committee on World Food Security.\r\nSource: Food and Agriculture Organization of the United Nations 2005\r\nwww.fao.org/newsroom/en/news/2005/102562/index.html', 'The Food and Agricultural Organization (FAO) estimates\r\nthat 852M people worldwide were undernourished in\r\n2000–2002, comprising 815M in developing countries,\r\n28M in the countries in transition, and 9M in the\r\nindustrialised countries. South Asia and Sub-Saharan\r\nAfrica have a disproportionate share of the world’s hungry.\r\nConfl ict is now the most common cause of food\r\ninsecurity. The number and scale of confl ict-related, food\r\nsecurity emergencies is increasing. Human-induced\r\ndisasters can also escalate a natural crisis, such as\r\ndrought.\r\nThe proportion of food emergencies that can be\r\nconsidered human-made has increased over time.\r\nConfl ict and economic problems were cited as the main\r\ncause of more than 35% of food emergencies between\r\n1992 and 2003, compared to around 15% in the period\r\nfrom 1986 to 1991. More than half of the countries where\r\nunder-nourishment is most prevalent experienced confl ict\r\nduring the 1990s. Civil wars in many developing countries\r\ntoday, particularly in Sub-Saharan Africa, pose the main\r\nthreat to long-term food security and economic progress.\r\nRepeated food emergencies are concentrated in\r\nSub-Saharan Africa, where the majority of the affected\r\ncountries (61%) are hosts to civil wars.', NULL, '37.jpg', '37back.jpg', 1, NULL, 'issue', 'active', NULL, 530, 1264480980, 1264480775, 1, 1, 664),
('undocumented labour', '', 5, 6, 'should illegal immigrants be\r\nprotected or deported?', 'In Latin America eight out of 10 jobs are in the informal\r\nsector. As of 2005 the number of new immigrant workers\r\nentering the US illegally was between 1.4M and 2.7M.\r\nSource: A Sum, P Harrington, I Khatiwada, The impact of new immigrants\r\non young native-born workers 2000-2005, Centre for Immigration Studies,\r\nSeptember 2006, www.thirdworldcentre.org/swsmegacities.pdf, www.cis.org', 'Immigration has become a hotly debated issue across the\r\nglobe. A growing number of US Americans believe that\r\nimmigrants are a burden to the country, taking jobs and\r\nhousing and creating strains on the healthcare system. In\r\n2000 migration reached its highest level ever according\r\nto the International Organization for Migration, 30M more\r\nthan 10 years ago. And international migration fl ows are\r\nexpected to rise during the 21st century.\r\nThe American public is split over many of the policy\r\nproposals aimed at dealing with the estimated 11.5-12M\r\nunauthorised migrants in the US. Overall, 53% say\r\npeople who are in the US illegally should be required to go\r\nhome, while 40% say they should be granted some kind\r\nof legal status that allows them to stay here. There is also\r\na division of opinion over how to stem the fl ow of illegal\r\nimmigrants across the Mexican border.\r\nContrary to some of these immigration fears, a report\r\nby the Pew Hispanic Center found that the rapid growth\r\nin foreign-born population at the US state level is not\r\nassociated with negative effects on the employment of\r\nnative-born workers. Assessments also showed that the\r\nsize of the foreign-born population is unrelated to the\r\nemployment prospects for native-born workers.', NULL, '36.jpg', '36back.jpg', 1, NULL, 'issue', 'active', NULL, 531, 1264481005, 1264480800, 1, 1, 664),
('supply vulnerability', '', 5, 5, 'how secure is your\r\nwater supply?', '61M people depend on dams and\r\nreservoirs for their water, making\r\nthem a potentially signifi cant\r\nterrorist target.\r\nSource: National Public Radio, Morning\r\nEdition, 18 October 2001', 'Vulnerability assessments help water utilities to evaluate\r\ntheir susceptibility to potential threats and identify any\r\ncorrective actions that could reduce risk of serious\r\nconsequences from vandalism, insider sabotage, or\r\nterrorist attack. Terrorist attacks on water supplies have\r\noccurred in the past. Reportedly, Al-Qaeda issued a threat\r\nagainst United States’ drinking water systems in 2003.\r\nTerrorists in Baghdad also launched a direct attack on the\r\ncity’s water supply pipelines following the United States\r\ninvasion.\r\nThe contamination of drinking water or distribution chain\r\nsabotage are often regarded as likely terrorist acts, yet\r\nthe quantity of toxic chemical needed to contaminate a\r\nmunicipal water supply is hard to defi ne. Most biological\r\npathogens would fail to survive in water as a contaminant\r\ndue to standard water treatment. The vulnerability of the\r\nwater supply increases post-treatment, but the population\r\nsize affected diminishes as well. A supervisory control and\r\ndata acquisition system, such as the SCADA software\r\nused by US reservoirs, could, on the other hand, face the\r\nthreat of electronic attack. In 2003, the US Environmental\r\nProtection Agency spent US$90.3M on water-security\r\nissues, as set out in emergency legislation.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 532, 1264481012, 1264480807, 1, 1, 664),
('motorisation', '', 3, 6, 'having trouble breathing?', 'Between 2000 and 2004, production of passenger cars in China\r\njumped from 605 000 to 2.33M. More people are driving cars,\r\nand the number of motor vehicles other than two-wheelers in the\r\nworld is expected to double in the next 15 years to 1.3bn.\r\nSource: www.peopleandplanet.net/doc.php?id=627', 'In October 2004, China’s Ministry of Communication\r\nannounced that the nation’s freeways had reached\r\n30 000km in length. While China is receiving a lot of\r\nattention, some international transportation experts say\r\nthat the motorisation trend is global. According to Daniel\r\nSperling, professor of engineering and environmental\r\nscience and policy at UC Davis, motorisation is soaring\r\neverywhere, with the fastest growth occuring in Asia and\r\nLatin America. On 5 February 2005, the China Federation\r\nof Machinery Industry forecast 20% growth, to a level that\r\nwould move China past Germany into third place globally\r\nfor motor vehicle production.\r\nThe impact of increased motorisation on Chinese urban\r\nair is still diffi cult to determine. Chinese cities are\r\nundergoing a shift from industrial pollution to motor\r\nvehicle pollution. At the same time that motor vehicles\r\nhave begun to clog city thoroughfares, industry has been\r\nmoving out to urban peripheries. This shift means that\r\nsulphur dioxide levels have been going down in Chinese\r\ncity air, but they are being replaced by vehicle emissions\r\nincluding carbon monoxide and ozone-forming nitrogen\r\noxides. As motor vehicles proliferate in the developing\r\nworld, the challenge of achieving an acceptable trade-off\r\nbetween economic benefi ts and environmental impacts\r\nis formidable.', NULL, '33.jpg', '33back.jpg', 1, NULL, 'issue', 'active', NULL, 533, 1264481032, 1264480827, 1, 1, 664),
('watershed co-operation', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 534, 1264481036, 1264480831, 1, 1, 664),
('dependency ratios', '', 4, 6, 'how many people will you support?', 'The declining ratio of workers to retirees is a\r\ngrowing threat. Today the ratio is 3:1, by 2030\r\nit is projected to fall to 1.5:1.\r\nSource: Active ageing in age-friendly cities, IFA Global\r\nConference, June 2006', 'The dependency ratio tells us how many young people\r\n(under 16) and older people (over 64) depend on those of\r\nworking age (16-64).\r\nOld age dependency ratios will rise in every major world\r\nregion during the next 25 years due to ageing populations.\r\nThe world community as a whole will face an elderly\r\nsupport burden nearly 50% larger in 2025 than in 1998.\r\nIn spite of ageing population trends, children will still make\r\nup the largest share of dependents. At present nearly\r\n90% of the combined dependent age groups in the less\r\ndeveloped regions of Africa, Asia and Latin America are\r\nunder the age of 15, and children will still account for 75%\r\nof all dependents in these regions in 2025.\r\nIn the US and other more developed countries, elderly\r\ndependents will come to outnumber dependents under\r\nthe age of 15 over the next 25 years. Here, the total\r\ndependency ratio is projected to rise sharply over the next\r\n50 years, as low fertility increasingly affects labour force\r\nsize and the baby boom generations move into old age.', NULL, '30.jpg', '30back.jpg', 1, NULL, 'issue', 'active', NULL, 535, 1264481052, 1264480847, 1, 1, 664),
('water wars', '', 5, 5, 'when will water wars no longer\r\nbe headline news?', 'In 2000, UN Secretary-General Kofi Annan\r\nsuggested that “fi erce competition for freshwater\r\nmay well become a source of confl ict and war in\r\nthe future”.\r\nSource: UN Secretary-General Kofi Annan, Millennium Report,\r\nNew York, 3 April 2000', 'Increased water scarcity is considered a potential trigger\r\nfor future international confl icts, also called water wars.\r\nThe confl ict between Iraq and Turkey is expected to\r\nintensify as Turkey attempts to move with its $32bn plan\r\nto build 22 dams on the Euphrates for the irrigation of\r\n1.7Mha of land. This could result in Iraq losing as much as\r\n80-90% of its allotment of Euphrates water. Water scarcity\r\nis often measured using Falkenmark’s Water Stress\r\nIndex (WSI), which divides the volume of available water\r\nresources for each country by its population. A country is\r\nconsidered to be water stressed if the resulting average\r\namount of water available per inhabitant falls short of\r\n1700m³ per year. If it falls below 1000m³ per person per\r\nyear, it is considered water scarce and if it drops below\r\n500m³ per person per year, it is considered water poor.\r\nThe 1997 UN Convention on Non-Navigational Uses of\r\nInternational Watercourses is one international instrument\r\nthat specifi cally focuses on shared water resources. It\r\nestablished two key principles to guide nations regarding\r\nshared watercourses: “equitable and reasonable use” and\r\n“the obligation not to cause signifi cant harm” to\r\nneighbours. While this sets out a framework that was\r\napproved by 103 countries in the UN General Assembly,\r\nonly 14 states had ratifi ed it by 2005.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 536, 1264481053, 1264480848, 1, 1, 664),
('water pricing', '', 5, 5, 'do subsidies hinder effi ciency?', 'Farmers in water-short Tunisia pay fi ve\r\ncents per m³ for irrigation water, which\r\nis one-seventh the cost of supplying it.\r\nSource: Technology Review 04/97', 'Government subsidies for freshwater have often been\r\ndesigned to promote use of water resources to spur\r\ndevelopment and agricultural production. United States\r\nsubsidies support the use of water for irrigation in the\r\narid, western portions of the country. According to the\r\nOrganisation for Economic Cooperation and Development\r\n(OECD), the United States provided US$46.9bn in\r\nagricultural producer support in 1998; the total water\r\nsubsidy in the western United States is estimated at\r\nUS$4.4bn. Farmers using irrigation water from federallysupported\r\nprojects pay on average only about 17% of\r\nthe actual cost of water. As subsidies prevent prices from\r\nrising as supplies diminish, there is potential for water\r\nshortages to occur.\r\nSome subsidies have been restructured to provide\r\nincentives for conservation, effi ciency and watershed\r\nprotection. Some countries are now pushing for a\r\ncomplete phase-out of agricultural water subsidies, and\r\nreplacing these with an increase in fi nancial incentives for\r\nconservation. Policies that simply favour low-cost energy\r\nand subsidies for natural resource extraction encourage\r\nhigh levels of production and use, and may make it more\r\ndiffi cult to attain environmental goals.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 537, 1264481070, 1264480865, 1, 1, 664),
('water rights', '', 5, 5, 'is water a right or a commodity?', '“Water rights as natural\r\nrights do not originate\r\nwith the state; they\r\nevolve out of a given\r\necological context of\r\nhuman existence.”\r\nSource: Vandana Shiva, Water\r\nWars: Privatisation, Pollution,\r\nand Profi t, 2002', 'The concept of water rights is evident in the ancient text,\r\nThe Institute of Justinian, which states: “By the law of\r\nnature these things are common to mankind: the air,\r\nrunning water, the sea and consequently the shore of the\r\nsea”. Countries such as India have long viewed water as\r\nbeing outside of the realm of individual property rights.\r\nThe beginnings of European water law go back to the\r\ntime of the Romans. The Riparian Doctrine established\r\nthat the owner of property adjacent to a body of water\r\nautomatically acquires the right to use the water as long\r\nas the quality and quantity of the downstream water\r\nsupply are not affected.\r\nIn 2002, the UN Economic and Social Council adopted\r\nGeneral Comment No. 15, which for the fi rst time explicitly\r\nrecognised water as a fundamental human right. The 145\r\ncountries that have ratifi ed the International Covenant of\r\nEconomic, Social, and Cultural Rights are now working\r\nto ensure that everyone has access to safe and secure\r\ndrinking water, equitably and without discrimination. The\r\nWorld Health Organization specifi es reasonable access\r\nto water as at least 20 litres per person per day, from an\r\nimproved water source within 1km of a user’s dwelling.\r\n“Improved” water supply technologies such as household\r\nconnections, public standpipes, or protected dug wells\r\nare neither complex nor expensive to achieve, but would\r\nrequire major policy shifts by governments to implement.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 538, 1264481086, 1264480881, 1, 1, 664),
('ecosystem services', '', 3, 5, 'what ecosystem benefi ts are\r\nyou cashing in on?', 'In 1997 New York City opted to save an estimated\r\nUS$6-8bn by restoring the natural capital it had in\r\nthe Catskill’s watershed as opposed to installing an\r\nartifi cial fi ltration plant. The cost of this approach to\r\nensuring fresh water for the city was US$660M.\r\nSource: www.esa.org/ecoservices/', 'Ecosystems encompass services such as cycling\r\nnutrients, pollination, and decomposing wastes. While\r\nmany of these services are seemingly free, the estimated\r\nequivalent value of just water-based ecosystem services\r\nis almost US$5254bn per year. This number is based on\r\nestimations of the indirect values of aquatic ecosystems\r\nin fl ood control, groundwater recharge, shore protection,\r\nshoreline stabilisation, nutrition cycling and retention,\r\nwater purifi cation, preservation of biodiversity, and\r\nrecreation and tourism.\r\nA World Bank study found that one-third of the 105 big\r\ncities studied, including New York, Tokyo, Barcelona\r\nand Melbourne, get much of their water from protected\r\nforests. The study concluded that preserving these forests\r\nis a cost-effective way to provide clean drinking water.\r\nSustainable urban drainage systems (SUDS) are another\r\nexample of integrating ecosystem services. SUDS are\r\noften cheaper as well as easier to maintain than traditional\r\nengineered drainage solutions. Larger SUDS wetland\r\nschemes have the added value of providing wildlife\r\nhabitat and recreational potential. The growing trend of\r\ndam removal can also take advantage of ecosystem\r\nservices. While economics play an important role in dam\r\nremoval, water-management priorities are also changing\r\nto include protecting wetlands, improving water quality\r\nand reducing risk to downstream communities.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 539, 1264481110, 1264480905, 1, 1, 664),
('pharma water', '', 3, 5, 'is there prozac in your water?', 'In 2003, scientists discovered that male fi sh living\r\ndownstream from a cattle feedlot in Nebraska’s\r\nElkhorn River had one-third less testosterone than\r\nnormal and females had 20% less estrogen, but\r\n45% more testosterone than normal.\r\nSource: www.sciencedaily.com/releases/2003/12/031219072830.htm', 'In addition to agricultural and industrial pollution,\r\nfreshwater supplies are increasingly polluted by consumer\r\nby-products. A US Geological Survey study of 139\r\nstreams in 30 states found human and veterinary drugs,\r\nhormones, and other substances in 80% of the streams.\r\n83% of the substances found were pharmaceuticals or\r\nhormones. In addition to various medications, caffeine\r\nand cotinine (a nicotine breakdown product), were among\r\nthe most frequently detected compounds. Cholesterol\r\nand coprostanol, which is a steroid that can be indicative\r\nof fecal contamination, were also found in the water.\r\nThe list of the most frequently detected compounds\r\nalso included insect repellent, active ingredients from\r\nantimicrobial soaps and detergents, a fl ame retardant and\r\na detergent breakdown product with endocrine disruptive\r\nproperties. Of the 95 target compounds, researchers\r\nfound 82 of them in at least one stream. Scientists found\r\n10 or more compounds in 35% of streams. In one stream\r\nalone, they found 38 chemicals.\r\nThe full impact of these chemical compounds in\r\nfreshwater is unclear. One documented phenomenon\r\nis hermaphrodite fi sh, or fi sh with both male and female\r\ncharacteristics. These feminised male fi sh were fi rst found\r\nin the UK downstream from sewage plants.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 540, 1264481143, 1264480939, 1, 1, 664),
('groundwater overdraft', '', 3, 5, 'how long until water recycling\r\nis the only option?', 'Annual non-renewable groundwater\r\ndepletion in India, China, the United\r\nStates, North Africa and the Arabian\r\nPeninsula totals 160bn m³ a year, which\r\nis equivalent to the total annual fl ow of\r\ntwo Nile Rivers.\r\nSource: www.peopleandplanet.net/doc.php?id=627', 'An estimated 2bn people, approximately one-third of the\r\nworld’s population, depend on groundwater supplies. Out\r\nof total global water supplies, about 20%--or between\r\n600-700km³ annually--is withdrawn from mostly shallow\r\naquifers. Agriculture is the single largest consumer of\r\ngroundwater and as such is responsible for most of its\r\ndepletion as well as up to 70% of its pollution. The general\r\ntrend is that as groundwater becomes more depleted it\r\nis also becoming more polluted. Within the last 50 years\r\nover 60 000km² of groundwater aquifers in western and\r\ncentral Europe have been contaminated with pesticides\r\nand fertilisers.\r\nAs a result of overexploitation of groundwater, watertables\r\nare dropping and some rivers, such as the Colorado\r\nRiver in the United States and the Yellow River in China,\r\noften run dry before they reach the sea. Many of the\r\nworld’s most important grain lands are also consuming\r\ngroundwater at unsustainable rates. The Ogallala Aquifer\r\nthat feeds irrigated agriculture in eight US High Plains\r\nStates demonstrates the problem. The aquifer is being\r\ndepleted at a rate of about 12bn m³ a year but due to its\r\ndepth underground it gets very little replenishment from\r\nrainfall. Similarly China’s northern and central plains, which\r\nproduce roughly 40% of the country’s grain, have\r\nexperienced a drop of water table levels by 1-1.5m\r\nper year.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 541, 1264481162, 1264480957, 1, 1, 664),
('salinisation', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 542, 1264481179, 1264480974, 1, 1, 664),
('disparate rainfall', '', 3, 5, 'what if the rains don’t come?', 'Precipitation is the main source of water for all\r\nhuman uses and for ecosystems. We withdraw\r\n8% of the total annual renewable freshwater\r\nresources, and appropriate 26% of annual\r\nevapotranspiration and 54% of accessible runoff.\r\nSource: Based on Water for People Water for Life, The United\r\nNations World Water Development Report, Executive Summary\r\n© UNESCO 2003, p 9', 'Although the global supply of water stays relatively stable,\r\nregional differences in seasonal and annual precipitation\r\nare signifi cant. Recent estimates suggest that climate\r\nchange will account for about 20% of the increase in\r\nglobal water scarcity. By mid-century, estimates range\r\nfrom 2bn people in 48 countries being short of water, to\r\nup to 7bn people in 60 countries. According to Science\r\nMagazine, water availability rather than temperature is the\r\nkey climatic determinant for life in semi-arid areas. The\r\nDust Bowl, which lasted from 1933-38, is an example of\r\nthe impact of a widespread reduction in rainfall across the\r\nAmerican West. Analysis reveals that its socio-economic\r\nimpact was in part due to wanton agricultural practices\r\njust before the drought when rainfall was more abundant.\r\nClimate change may impact the geographic distribution of\r\nfreshwater. It is estimated that precipitation will probably\r\nincrease from latitudes 30ºN and 30ºS, while many\r\ntropical and sub-tropical regions will probably get lower\r\nand more erratic rainfall. The new climate conditions\r\nmay directly affect the magnitude and timing of runoff,\r\nthe intensity of fl oods and drought, and have signifi cant\r\nimpacts on regional water resources. These combined\r\nwould affect both surface water and groundwater supply\r\nfor domestic and industrial uses, irrigation, hydropower\r\ngeneration, navigation, in-stream ecosystems and waterbased\r\nrecreation and development.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 543, 1264481204, 1264480999, 1, 1, 664),
('industrial demands', '', 4, 5, 'how can we increase the\r\nproductivity of water?', 'Global annual water use by industry\r\nis expected to rise from an estimated\r\n725km3 in 1995 to about 1170km3 by\r\n2025, by which time industrial water\r\nusage will represent 24% of all water\r\nabstractions.\r\nSource: Water for People Water for Life, The\r\nUnited Nations World Water Development Report,\r\nExecutive Summary © UNESCO 2003', 'Industry is considered an important ingredient for\r\neconomic growth. Global annual water use by industry\r\nis expected to rise from an estimated 725km³ in 1995, to\r\nabout 1170km³ by 2025. Much of the increase in\r\nindustrial water use will be in developing countries which\r\nare now experiencing rapid industrial development.\r\nCurrently, Europe and North America are the only global\r\nregions where more water is used for industry than for\r\nagriculture or domestic purposes. In most Mediterranean\r\ncountries and in Central Asia most water is used for\r\nagriculture. To meet the projected growth in industrial\r\ndemand for water it will be necessary to improve water\r\nmanagement, promote recycling and shift away from\r\nwater-consuming industries.\r\nWater discharged by industries may be of poor quality\r\nand, unless adequately treated, threatens the surface and\r\nground water resources. The damage of industrial\r\neffl uents is not just a local problem as both population\r\nand industry increasingly concentrate in coastal zones.\r\nWhile “polluter pays” policies may help reduce such\r\ndamage, many countries are unwilling to hinder potential\r\nindustrial and economic development. It is possible to\r\nreduce demand for water by making industry managers\r\nin middle and lower-income countries more aware of how\r\nwater is used in their enterprises.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 544, 1264481228, 1264481023, 1, 1, 664),
('water recycling', '', 4, 5, 'when will you collect and sell\r\nyour rainwater?', 'A wastewater recycling project at\r\nKwinana, Western Australia, is to\r\nprocess 5GL (13 700m3 per day)\r\nof municipal wastewater for reuse\r\nby local industries. This has the the\r\npotential to reduce the amount of\r\nindustrial wastewater discharged\r\ninto Cockburn Sound by six million\r\nlitres a day.\r\nSource: Taken from speech by Geoff Gallop,\r\nPremier of Western Australia, Opportunities for\r\nSustainability in Western Australia, The Global\r\nLinkage Forum Environmental Unit Session,\r\nJapan, 22 July 2002', 'Improved water treatment technologies along with\r\nincreasing water demands make water recycling an\r\nincreasingly important option. Technically wastewater\r\ncan be reused for any purpose as long as the level of\r\ntreatment required is appropriate for a particular need. In\r\nregions where agricultural water demands are high and\r\nother sources of supply are limited, like the Middle East\r\nand North Africa, the use of reclaimed water for irrigation\r\ncan be an important application. Where industrial and\r\ncommercial water demands are high, as in Japan, reuse\r\napplications in these sectors predominate.\r\nThe cost of reclaimed water is signifi cant in determining\r\nthe feasibility of its use. Several factors impact the costeffectiveness\r\nof reclaimed water, including which\r\nprocesses were used to produce it, the distance to the\r\npoint of use, the quality of the water needed, and the\r\nmarginal cost of new supplies. The costs of production\r\nare lowest for reclaimed water used to irrigate fodder,\r\nfi bre, seed crops, and orchards and vineyards where the\r\nwater does not come in direct contact with the fruit. The\r\nestimated range of costs is from US$0.09 to $2.65 per\r\nm³, with the cost for potable reuse in excess of $1 per m³.\r\nIn developing countries the most effective methods for\r\ncollecting and treating waste waters have been low-cost\r\nand low-tech rather than the complex systems used in\r\nmore affl uent economies.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 545, 1264481249, 1264481044, 1, 1, 664),
('privatisation', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 546, 1264481278, 1264481073, 1, 1, 664),
('virtual water', '', 4, 5, 'how much embodied water\r\nis in your laptop?', 'A typical 6 inch wafer fabrication plant\r\nprocessing 40 000 wafers per month\r\nreportedly consumes 2-3M gallons of water\r\nper day. This is equivalent to over 1500\r\ngallons per wafer.\r\nSource: www.svtc.org/resource/pubs/execsum.htm', 'Embodied water, also known as virtual water, is the water\r\nrequired to produce goods and services. Virtual water\r\nis an essential tool in calculating the real water use of a\r\ncountry, or its water footprint. This is equal to the total\r\ndomestic use, plus the virtual water import, minus the\r\nvirtual water export of a country. Trade in virtual water has\r\nsteadily increased over the last 40 years: about 15% of\r\nthe water used in the world is for export, in virtual form.\r\nSince, at global level, agriculture is the largest economic\r\nsector in terms of water use, trade in agricultural products\r\nis the main component of trade in virtual water. More\r\nspecifi cally, 67% of the global virtual water trade is related\r\nto international trade of crops, 23% is related to trade of\r\nlivestock and livestock products, and 10% is related to\r\ntrade of industrial products.\r\nThe value of the water used for producing staple foods in\r\nwater-poor countries can be many times higher than the\r\nvalue of the product. Thus, instead of using their scarce\r\nwater resources for water-intensive products, such\r\ncountries can import cheap food, and relieve the\r\npressure on their own water resources. Some experts\r\nargue that the importing of virtual water (via food or\r\nindustrial products) can be a valuable solution to water\r\nscarcity, especially for arid countries that depend on\r\nirrigation to grow low-value food with high water needs.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 547, 1264481301, 1264481096, 1, 1, 664),
('water packaging', '', 4, 5, 'why do you not drink\r\ntap water?', 'Making bottles to meet\r\nAmericans’ demand for bottled\r\nwater requires more than 17M\r\nbarrels of oil annually, enough\r\nto fuel more than 1M US cars\r\nfor a year.\r\nSource: Earth Policy Institute\r\nwww.earthpolicy.org', 'Global bottled water consumption reached 154bn litres in\r\n2004, up 57% from the 98bn litres consumed fi ve years\r\nearlier. Although in the industrial world bottled water is\r\noften no healthier than tap water, it can cost up to\r\n10 000 times more. When priced at US$2.50 per litre (or\r\nroughly US$10 per gallon), bottled water costs more than\r\ngasoline. The United States is the number one consumer\r\nof bottled water, drinking 26bn litres in 2004. Italians drink\r\nthe most bottled water per person, at nearly 184 litres in\r\n2004, followed by Mexico and the United Arab Emirates\r\nat 169 and 164 litres per person respectively. Of the top\r\n15 per capita consumers of bottled water, Lebanon,\r\nthe United Arab Emirates, and Mexico have the fastest\r\ngrowth rates, with consumption per person increasing\r\nby 44-50% between 1999 and 2004. Although per\r\ncapita rates are not as high in India and China, the total\r\nconsumption has tripled in India and doubled in China in a\r\nfi ve year period.\r\nThe most commonly used plastic for making water bottles\r\nis polyethylene terephthalate (PET), which is derived from\r\ncrude oil. Worldwide, over 2.7M tons of plastic are used to\r\nbottle water each year. Most new water bottles must be\r\nmanufactured almost entirely from virgin petroleum resin,\r\nconsuming signifi cant amounts of energy and resources.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 548, 1264481322, 1264481117, 1, 1, 664),
('dry crops', '', 2, 5, 'how necessary is rainfall?', 'Breeders in the Philippines have shortened\r\nthe maturation time for irrigated rice from\r\n150 days to 110, signifi cantly reducing\r\nwater demand.\r\nSource: Technology Review 04/97', 'Biologists can now hasten the process of plants\r\nadapting to drier conditions through plant breeding.\r\nThis is an alternative to the more traditional approach\r\nof dealing with water shortages with changes in\r\nirrigation practices. If the proper selection of crops is\r\nused, it is possible to get relatively high productivity\r\neven in unfavourable conditions. Genetic techniques\r\ncan also be used to screen crop varieties for higher\r\nwater-use effi ciency. Developing crops with shorter\r\ngrowing seasons or the ability to grow in cooler\r\nperiods when evaporation and transpiration are lower\r\ncould help improve water-use effi ciency.\r\nMatching crops to varying water quality can also\r\nenhance supplies for irrigated agriculture. In western\r\nIsrael, for example, farmers successully grow cotton\r\nusing highly salty water from a local saline aquifer.\r\nCertain crops, such as tomatoes grown for canning or\r\npastes, may benefi t from slightly salty irrigation water.\r\nThe process of defi ning new plant types requires input\r\nfrom crop physiologists and water/irrigation managers/\r\nengineers. Breeders need to include in their trait\r\nassessment not only plant characteristics but also\r\nwater parameters, such as water productivity and\r\nwater savings. In addition, suggested characteristics\r\namong new plant types must be tested to determine\r\nwhere they fi t in the agricultural system.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 549, 1264481342, 1264481137, 1, 1, 664),
('water harvesting', '', 2, 5, 'could you collect all your\r\nown water?', 'Inspired by the Namib Desert beetle’s water\r\ncollecting wings, researchers at the\r\nMassachusetts Institute of Technology (MIT)\r\nhave developed a hydrophobic/hydrophilic\r\nsurface patterned to both repel and attract\r\nwater.\r\nSource: Technology Review 05/06', 'Water harvesting innovations make it possible to capture\r\nwater from unconventional sources. Scientists developed\r\na method of harnessing coastal fog as a source of water\r\nin the coastal village of Chungungo, Chile. The fog is\r\ncaught using collectors that resemble oversized volleyball\r\nnets. As fog passes through the nets, beads of water form\r\non the mesh and run down into gutters draining into a\r\n100 000 litre reservoir. These fog catchers provide an\r\naverage of 10 000 litres of water every day. Prior to this\r\ninnovation, the water supply had to be transported in\r\nweekly from a town 40km away.\r\nResearchers at MIT have developed a surface that mimics\r\nthe wings of the Namib Desert beetle. On the days when\r\nfog blows in from the Atlantic, the Namib beetle faces the\r\nwind and droplets of water stick to the bumps on its back.\r\nThis water builds up until it rolls down the water-repelling\r\nchannels on the beetle’s back and into its mouth. A\r\nsurface with a microscopic pattern of water-attracting and\r\nwater-repelling areas could be used for water collection\r\nin dry regions of the world. The hydrophilic areas would\r\nattract moisture in the air and collect water drops until they\r\nspilled over into the hydrophobic regions and rolled into a\r\ncollecting channel. Compared to the large polypropylene\r\nfi bre meshes used to harvest water from fog, this\r\ntechnology provides a tenfold increase in effi ciency.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 550, 1264481364, 1264481159, 1, 1, 664),
('two-speed society', '', 4, 6, 'has the world become\r\nmore unequal?', 'In 1990 the average American was 38 times richer\r\nthan the average Tanzanian. Today the average\r\nAmerican is 61 times richer. Purchasing power\r\nparity income in lower income countries as a group\r\nis one-thirteenth of that in high-income countries.\r\nSource: http://hdr.undp.org/reports/global/2005/pdf/HDR05_\r\ncomplete.pdf', 'Global income distribution resembles a cocktail glass.\r\nAt the top where the glass is widest the richest 20% of\r\nthe population hold three-quarters of world income. At\r\nthe bottom of the stem, where the glass is narrowest, the\r\npoorest 40% hold 5% of the world income and the\r\npoorest 20% hold just 1.5%. For the past decade the\r\nworld’s poorest countries have continued a trend of\r\nnot reducing poverty and of falling further behind rich\r\ncountries. The average gap between the poorest and\r\nrichest citizen is getting wider.\r\nIncome inequality varies markedly across regions. In\r\nbroad terms Latin America and Sub-Saharan Africa\r\nregister very high levels of inequality, while South Asian\r\nand OECD countries register much lower levels. Although\r\nthere are no clear threshold points, countries with Gini\r\ncoeffi cients above 50 can be said to be in the high\r\ninequality category. While it is diffi cult to compare different\r\nsurveys across countries and time, there has been a\r\nclear trend over the past two decades towards rising\r\ninequality within countries. Of the 73 countries for which\r\ndata are available, 53 (with more than 80% of the world’s\r\npopulation) have seen inequality rise, while only nine (with\r\n4% of the population) have seen it narrow.', NULL, '29.jpg', '29back.jpg', 1, NULL, 'issue', 'active', NULL, 551, 1264481389, 1264481184, 1, 1, 664),
('desalination', '', 2, 5, 'is desalination the solution,\r\nor the problem?', 'In 1998, more than 600km of pipes in Berlin were\r\ninspected via video camera vehicles as part of\r\nroutine maintenance. This preventive maintenance\r\npolicy has reduced the percentage of unaccounted\r\nwater to 5%.\r\nSource: www.bwb.de/englisch/trinkwasser/pipeline_network.html', 'Desalination is the process of removing dissolved\r\nminerals, such as salt, from seawater, brackish water, or\r\ntreated wastewater. Desalination technologies include\r\nreverse osmosis, distillation, electrodialysis, and vacuum\r\nfreezing. In 2002, there were over 12 500 desalination\r\nplants around the world in 120 countries. All together they\r\nproduced approximately 14M m³ of freshwater per day,\r\nwhich is less than 1% of total world consumption.\r\nDesalination is already a signifi cant potable water option\r\nfor energy-rich, arid, and water-scarce regions. Among the\r\nindustrialised countries, the Unites States comprises 6.5%\r\nof total production. The global market for desalination\r\namounts to about US$35bn annually. Although the costs\r\nof desalination have come down to US$1.00-1.60 per\r\nm³, it remains one of the most expensive water supply\r\noptions. Desalination is also a high energy process - the\r\ntheoretical minimum required to remove all salt from a\r\nlitre of seawater is 2.8 kilojoules. In dry coastal areas,\r\ndesalination can be more energy effi cient than pumping\r\nfrom distant water sources. In other areas, however, the\r\nfull life cycle cost and greenhouse impact make it a less\r\nviable option.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 552, 1264481391, 1264481186, 1, 1, 664),
('womenomics', '', 4, 6, 'who is your boss?', 'In developed economies,\r\nwomen produce just under 40%\r\nof offi cial GDP. But if the worth\r\nof housework is added then\r\nwomen would produce slightly\r\nmore than half of total output.\r\nSource: Women and the economy,\r\nThe Economist, 12 April 2006', 'In 1950 only one-third of American women of working\r\nage had a paid job. Today two-thirds do, and women\r\nmake up almost half of America’s workforce. Since\r\n1950 men’s employment rate has slid by 12 percentage\r\npoints, to 77%. In fact, almost everywhere more women\r\nare employed and the percentage of men with jobs has\r\nfallen—although in some countries the feminisation of the\r\nworkplace still has far to go: in Italy and Japan, women’s\r\nshare of jobs is still 40% or less.\r\nThe increase in female employment in developed\r\ncountries has been aided by a big shift in the type of jobs\r\non offer. Manufacturing work, traditionally a male preserve,\r\nhas declined, while jobs in services have expanded. This\r\nhas reduced the demand for manual labour and put the\r\nsexes on a more equal footing.\r\nIn the developing world, too, more women now have paid\r\njobs. In the emerging East Asian economies, for every 100\r\nmen in the labour force there are now 83 women, higher\r\neven than the average in OECD countries. Women have\r\nbeen particularly important to the success of Asia’s export\r\nindustries, typically accounting for 60-80% of jobs in\r\nmany export sectors, such as textiles and clothing.', NULL, '28.jpg', '28back.jpg', 1, NULL, 'issue', 'active', NULL, 553, 1264481405, 1299767474, 1, 1, 664),
('labour gaps', '', 4, 6, 'who will show up to work?', 'By 2050 a projected labour force gap of some 244M is\r\nexpected in ageing industrialised countries.\r\nSource: The Economics of Ageing, IFA Global Conference, June 2006', 'By 2025, one in fi ve Europeans will be more than\r\n65 years old, up from 16% in 2002. Across the continent,\r\nthe number of working-age citizens will stagnate or shrink,\r\nwhile the number of retirees explodes. As a result,\r\nhousehold fi nancial wealth, which had enjoyed steady,\r\nhealthy growth during past decades, will slow drastically\r\nover the next 20 years, according to new research by the\r\nMcKinsey Global Institute (MGI). The slowdown will leave\r\nhouseholds in three of Europe’s biggest economies—the\r\nUnited Kingdom, Germany, and Italy—with US$4 trillion\r\nless than they would have accumulated if historical growth\r\nrates had persisted.\r\nBecause of the impact of the baby boom and the decline\r\nin fertility at the end of the 1960s, the population of core\r\nworking ages is older in Canada than in all other G8\r\ncountries except Germany and Japan. Japan expects\r\nits workforce to shrink by 16% over the next 25 years.\r\nAlong with Japan, Canada has the lowest ratio of younger\r\nindividuals in the workforce (20 to 39) to those aged 40 to\r\n59. In no other G8 country is there such a contrast in the\r\npopulation sizes of the younger to the older population in\r\nthe core working ages. The workforce is ageing across the\r\nrich world.', NULL, '27.jpg', '27back.jpg', 1, NULL, 'issue', 'active', NULL, 554, 1264481419, 1264481214, 1, 1, 664),
('distribution efficiency', '', 2, 5, 'how many leaks are you\r\npaying for?', 'In 1998, more than 600km of pipes in Berlin were\r\ninspected via video camera vehicles as part of\r\nroutine maintenance. This preventive maintenance\r\npolicy has reduced the percentage of unaccounted\r\nwater to 5%.\r\nSource: www.bwb.de/englisch/trinkwasser/pipeline_network.html', 'Ineffi cient distribution systems result in signifi cant\r\namounts of water loss. By replacing 219km of faulty\r\npipes in London, Thames Water will save an estimated\r\n30M litres of water every 24 hours. In many developing\r\ncountries up to 60% of water extracted for irrigation is lost\r\nto evaporation or is returned to rivers and groundwater\r\naquifers due to poor water delivery mechanisms.\r\nSwitching from trench or sprinkler irrigation systems to\r\ndrip systems can cut water use by 30-60%, while also\r\nincreasing crop yields by a similar margin.\r\nNew technologies, such as wireless sensor networks,\r\ncan help farmers optimise how much water to give\r\ntheir plants. The wireless watering network developed\r\nat National ICT, Australia consists of a few hundred\r\nwireless nodes equipped with a computer chip and a\r\nWi-Fi transmitter. The information collected from sensors\r\nmeasuring soil moisture, leaf temperature and evaporation\r\nis then linked to a central server that wirelessly controls\r\nthe irrigation pumps to deliver the optimal amount of\r\nwater. Similarly, a weather station system developed by\r\nSmartLine collects ambient air temperature, rain and\r\nfreeze conditions, and relays this 24-hour weather data\r\nto a controller that then re-adjusts water fl ow based\r\non changing conditions. These types of water saving\r\ntechnologies often also increase crops yields as plants are\r\nfed an optimal amount of water.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 555, 1264481432, 1264481227, 1, 1, 664),
('food production', '', 1, 5, 'should we all become\r\nvegetarians?', 'Providing the 2800 calories per person per day\r\nneeded for adequate nourishment requires an\r\naverage of 1000 m3 of water per year.\r\nSource: Water for People Water for Life, The United Nations World\r\nWater Development Report, Executive Summary © UNESCO 2003', 'Systematic agriculture is the main source of food for the\r\nearth’s 6bn population. Unmanaged earth systems can\r\nonly feed an estimated 500M people. While most\r\nagriculture is rain fed, irrigated land accounts for one-fi fth\r\nof the total arable area in developing countries. Currently,\r\nirrigation accounts for about 70% of all water withdrawals\r\nin the world. This amount is expected to increase by 14%\r\nin the next 30 years as the area of irrigated land expands\r\nby 20%. By 2030, 60% of all land with irrigation potential\r\nwill be in use. Climate change and increased water\r\nscarcity may lead to diffi cult choices between agriculture\r\nand other uses.\r\nIn 1998, irrigated land produced two-fi fths of all crops\r\nand three-fi fths of all cereals. Cereals are the most\r\neffective crop as they provide for 56% of calories\r\nconsumed while only requiring an equivalent 1.5m³\r\nof water to produce. Cattle, by comparison, require\r\nan equivalent 4000m³ of water per head.\r\nIn a survey conducted by the Food and Agriculture\r\nOrganization of the UN, 10 out of the 93 developing\r\ncountries are already using 40% of their renewable\r\nfreshwater for irrigation. Over-pumping of aquifers and\r\nwater pollution caused by agricultural chemicals have a\r\nnegative impact on shallow groundwater supplies, which\r\nare an important source of irrigation water.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 556, 1264481457, 1264481252, 1, 1, 664);
INSERT INTO `card` (`name`, `safe_name`, `category_id`, `topic_id`, `question`, `factoid`, `description`, `image`, `card_front`, `card_back`, `origin_event_id`, `uri`, `type`, `status`, `params`, `id`, `ctime`, `mtime`, `owner`, `group`, `perms`) VALUES
('chronic disease', '', 4, 6, 'how much are you costing\r\nyour country?', 'China will lose US$558bn over the next 10 years\r\nin foregone national income due to heart disease,\r\nstroke and diabetes alone.\r\nSource: www.who.int/chp/chronic_disease_report/media/\r\nFactsheet4.pdf', 'In 2005 around 35M out a total of 58M deaths were the\r\nresult of chronic diseases. They are currently the major\r\ncause of death among adults in almost all countries and\r\nthe toll is projected to increase by a further 17% in the\r\nnext 10 years. There is a widespread belief that chronic\r\ndiseases are only “diseases of affl uence”, but this\r\nassumption is incorrect. In almost all countries, the\r\npoorest people are the most at risk of developing chronic\r\ndiseases and dying prematurely as a result. 80% of\r\nchronic disease deaths occur in low and middle income\r\ncountries and these deaths occur in equal numbers\r\namong men and women.\r\nThe estimated losses in national income from heart\r\ndisease, stroke and diabetes were US$18bn in China,\r\n$11bn in the Russian Federation, $9bn in India and $3bn\r\nin Brazil. These losses will accumulate over time. The\r\nWorld Health Organization (WHO ) has set the goal of\r\nreducing chronic disease by 2% a year over the next\r\n10 years. This would prevent 36M premature deaths\r\nworldwide over the next 10 years and would translate into\r\nsubstantial gains in countries’ economic growth. WHO\r\nestimates that the achievement of the global goal would\r\nresult in an accumulated growth of US$36bn in China,\r\n$15bn in India, and $20bn in the Russian Federation over\r\nthe next 10 years.', NULL, '26.jpg', '26back.jpg', 1, NULL, 'issue', 'active', NULL, 557, 1264481458, 1264481253, 1, 1, 664),
('urbanisation', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 558, 1264481481, 1264481276, 1, 1, 664),
('water consciousness', '', 1, 5, 'do you know how long your\r\nshower lasted?', 'In the US, an estimated 32% of\r\ncurrent indoor residential water use\r\ngoes to fl ushing toilets, making it\r\nthe largest single use of domestic\r\nwater.\r\nSource: The World’s Water: 2004-2005, p 113', 'Daily residential water use per capita in North America and\r\nJapan is 350 litres, 200 litres in Europe, and 10-20 litres\r\nin sub-Saharan Africa. An increase in population directly\r\nreduces the amount of water available per person as\r\nwater resource levels are generally static. When looked\r\nat on a global level, per capita water supplies have\r\ndecreased by a third between 1970 and 1990. Even as\r\npopulation growth rates diminish and global population\r\nlevels stabilise, water becomes scarcer as demand grows\r\nin developing countries.\r\nIn developed economies, effective reductions in water\r\nuse can be made through either changes in behaviour\r\nor increasing the water effi ciency of appliances. For\r\nexample, cutting one minute off a typical shower can\r\nsave about 2600 litres of water per month. Technical\r\ninnovations can increase the productivity of water use,\r\nwith maximum water-use effi ciency occurring when the\r\nminimum amount of water necessary is consumed to\r\ndo something. As toilets make up a large fraction of total\r\nindoor use, low-fl ow technology can provide signifi cant\r\nreductions in water consumption. Similarly, replacing a\r\n19 litres per minute shower head with a 9.5 litres per\r\nminute model will save about 64 litres per shower, or the\r\nequivalent of 15 000 litres per person per year.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 559, 1264481511, 1264481306, 1, 1, 664),
('bionic humans', '', 2, 6, 'where will the fi rst bionic\r\nOlympics be?', 'Retinal prostheses could effectively treat an estimated\r\n2.5M visually impaired Americans affected by macular\r\ndegeneration by 2020.\r\nSource: Jim Stallard, The human body shop, PBS Special Report\r\nwww.pbs.org/wnet/innovation/episode2_essay2.html', 'Bionics is the application of methods and systems found\r\nin nature to the study and design of engineering systems\r\nand modern technology. Advances in computer\r\ntechnology, material sciences, laser surgery, and the\r\nunderstanding of chemicals, genes, viruses and bacteria\r\nare bringing us closer to the reality of the bionic being.\r\nIn the past decade, transplanting has become routine and\r\nthe survival rates have risen dramatically - mainly because\r\nof developments in immuno-suppressant drugs.\r\nCambridge University researchers have been able to\r\nmodify the gene structure of pigs to prevent the rejection\r\nof their organs by humans.\r\nNeurobotics attempts to fuse together advances in\r\nmedical science with those in robotics and technology\r\nin order to explore how emerging technologies could\r\nenhance and augment human existence. Current\r\nadvances in neurobotics are aimed at creating robotic\r\ndevices that are intended to interact and interface with\r\nusers in order to assist humans with their execution of\r\ndaily living activities. The devices include heptic,\r\nprosthetic, implantable and wearable devices. This has\r\nsignifi cant implications for handicapped, ageing, and\r\namputee communities.', NULL, '50.jpg', '50back.jpg', 1, NULL, 'issue', 'active', NULL, 560, 1264481517, 1264481312, 1, 1, 664),
('hygiene education', '', 1, 5, 'did you wash your hands?', 'In 2000, the estimated mortality rate due to water\r\nsanitation and hygiene-associated diarrhoeas and\r\nother water/sanitation-associated diseases (including\r\nschistosomiasis, trachoma, intestinal helminth infections)\r\nwas 2 213 000.\r\nSource: Water for People Water for Life, The United Nations World Water\r\nDevelopment Report, Executive Summary © UNESCO 2003', 'According to WaterAid, about 2.6bn of the world’s\r\npopulation lack adequate sanitation facilities. Water-borne\r\ndiseases causing gastro-intestinal illness stem from\r\ndrinking contaminated water, and water-washed diseases\r\nare caused by bacteria or parasites resulting from\r\ninsuffi cient water for basic hygiene. The majority of people\r\naffected by water-related mortality are under fi ve years\r\nold.\r\nGood hygiene behaviour can provide huge health gains\r\nwith relatively small investment. According to the World\r\nHealth Organization, hand washing with soap can cut the\r\nrisk of diarrhoeal diseases by 42-47%. A successful hand\r\nwashing campaign in Burkina Faso involved house visits,\r\nradio messages and training health-centre staff. After the\r\ncampaign, the proportion that washed their hands after\r\nusing the latrine rose from 1% to 17%. Organisations\r\nsuch as UNICEF often combine improved sanitation\r\nfacilities with hygiene education at schools.\r\nThe estimated cost of meeting the Millennium\r\nDevelopment Goals for water access and sanitation is\r\nUS$30bn annually; current annual spending is US$14bn.\r\nIn 2004-2005, WaterAid raised a total of £15.6M in\r\nvoluntary income benefi ting approximately 1M people\r\nthrough delivery of water projects and sanitation initiatives.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 561, 1264481544, 1264481339, 1, 1, 664),
('brain plasticity', '', 2, 6, 'will you need a brain wrinkle remover?', '“We have been training 70 to 90-plusyear-\r\nolds to be more accurate aurallanguage\r\nreceivers and language users.\r\nAfter 40 hours or so of training, the\r\naverage trainee’s cognitive abilities are\r\nrejuvenated by about 10 years.”\r\nSource: Dr. Michael Merzenich, neuroscientist\r\nhttp://news.com.com/2102-1008_3-5875494.\r\nhtml?tag=st.util.print', 'Brain plasticity is a fi eld of neuroscience. It deals with the\r\nability of grey matter to adapt and change physically and\r\nfunctionally throughout life. Unless neural connections\r\nare constantly challenged with new information, they\r\ngradually weaken with age. An 80-year-old produces\r\none-fi fth the dopamine, a chemical strongly tied to\r\nattentiveness and memory, than that produced by a\r\n20-year-old. Without as much lubrication, older brains\r\nbegin to fail, and experience neurological decline.\r\nNeuroscientists are working to improve memory and\r\ncognition among older people, as well as develop brainfi\r\ntness software for treating neurological diseases such as\r\nAlzheimer’s and schizophrenia.\r\nBy 2050 16% of the world’s population, nearly 1.5bn\r\npeople, will have turned 60. Nearly 50% of Americans\r\nolder than 85 develop Alzheimer’s disease. About 4.5M\r\nAmericans now have the brain disorder, a number that\r\nis projected to increase to between 11M and 16M by\r\n2050. There are currently an estimated 24M people in the\r\nworld with dementia. More than 60% live in developing\r\ncountries and numbers are increasing. By 2040 this will\r\nrise to 71%. The fastest growth in the elderly population\r\nis taking place in China, India, and their South Asian and\r\nwestern Pacifi c neighbours. A strategy to delay the onset\r\nof Alzheimer’s by fi ve years could halve the number of\r\naffected individuals over the next 50 years.', NULL, '49.jpg', '49back.jpg', 1, NULL, 'issue', 'active', NULL, 562, 1264481569, 1264481364, 1, 1, 664),
('genetic screening', '', 2, 6, 'would you design your baby?', 'Preimplantation genetic haplotyping (PGH) is a new\r\ntechnique to screen embryos in the in vitro fertilisation\r\nprocess for 6000 inherited diseases.\r\nSource: Elizabeth R Schiltz, Confessions of a “Genetic Outlaw”,\r\nBusinessWeek Online, 20 July 2006', 'British fertility specialists have developed a new way to\r\ntest embryos for inherited diseases, offering hundreds of\r\ncouples the fi rst real opportunity to have healthy children.\r\nThe preimplantation genetic halotyping (PGH) procedure\r\nhas increased the number of testable diseases from\r\nabout 200 to nearly 6000. For example, it will allow\r\ndoctors to test for a vast array of inherited diseases\r\nwhere the specifi c genetic mutation is not known. These\r\ninclude Duchenne’s muscular dystrophy and some forms\r\nof cystic fi brosis. Using PGH doctors can examine each\r\nembryo created for a couple through in vitro fertilisation\r\nand determine whether it is healthy and unaffected, or a\r\ncarrier of disease.\r\nWhereas current tests only screen for a single mutation,\r\nPGH will allow couples to determine the likelihood of\r\nhaving babies with genetic defects. Trust for America’s\r\nHealth found that birth defects are the leading cause\r\nof death among infants in the US, accounting for\r\napproximately one out of every fi ve deaths per year.\r\nStudies revealed that the lifetime expenses for 12\r\nselected birth defects could amount to US$700 000 per\r\nchild.', NULL, '48.jpg', '48back.jpg', 1, NULL, 'issue', 'active', NULL, 563, 1264481582, 1264481377, 1, 1, 664),
('virtue engineering', '', 2, 6, 'what would you change?', '“Human genetic engineering will be a part of our future\r\nand will eventually help provide our children with long\r\nhealthy lives in a prosperous world.”\r\nSource: James J Hughes, Secretary, World Transhumanist Association\r\nwww.transhumanism.org, controlling our bodies, powerpt', 'The Genetic Virtue Program (GVP) is a proposal for\r\ninfl uencing our biological natures. Its aim is to improve the\r\nethical quality of individual lives. The premise is that genes\r\ninfl uence our behaviour. Altering them may therefore affect\r\nthe way we behave. This process, known as “virtual\r\nengineering”, could lead to the modifi cation and\r\nacquisition of certain morals, which are identifi ed to be\r\nlacking on the individual level. In laboratory practice this\r\ncould be realised in several ways including selecting\r\nhuman embryos with desirable genes or genetically\r\nengineering human zygotes (fertilised cells).\r\nThe GVP functions on the assumption that it is morally\r\npermissible to use biotechnology to alter human biology.\r\nIt proposes that if “evil” or misconduct are rooted in our\r\nbiological natures and in our “human nature”, then GVP\r\nprovides a plausible alternative and solution for its\r\nelimination.\r\nTranshumanists are those working on human\r\nenhancements through technological means. They do\r\nnot represent mainstream science, nevertheless, in recent\r\nyears they have received increasing support from the\r\nbroader scientifi c research sector.', NULL, '47.jpg', '47back.jpg', 1, NULL, 'issue', 'active', NULL, 564, 1264481615, 1264481410, 1, 1, 664),
('virtual gaming', '', 2, 6, 'do you have a virtual life?', 'Four in 10 Americans say they play computer\r\nor video games. Among American adults 45%\r\nreported playing video, computer, or online\r\ngames on a regular basis.\r\nSource: AP/AOL poll conducted by Ipsos Public Affairs', 'JupiterResearch estimates that the massively multiplayer\r\nonline games (MMOG) industry generates revenues\r\nof US$350bn a year, and occupies about nine hours a\r\nweek for the typical player. Most gamers are between the\r\nages of 18 and 34. MMOG games fall into four genres:\r\nfantasy; sci-fi and superhero; combat simulation and\r\nfi rst-person shooter; social and other situation-based\r\ngames. Fantasy games hold the highest market share. A\r\nForrester Consumer report says 21% of North American\r\nconsumers regularly spend leisure time playing games,\r\nwith the MMOG category taking up a signifi cant portion\r\nof that.\r\nThe younger the adult, the more likely they are to play\r\nconsumer or video games online. Online gamers are also\r\nmore likely to be “hardcore” gamers: 42% say they spend\r\nat least four hours playing games during an average week.\r\nThe popular MMOG game Second Life makes about\r\nUS$5.3M in user transactions over the course of one\r\nmonth. More than 20M people play MMOG worldwide,\r\naccording to economist Edward Castranova.The online\r\ngaming market is set to almost quadruple in the\r\nnext few years due to new consoles and online\r\nfunctionality. The worldwide online market is\r\nexpected to grow from US$3.4bn in 2005 to more\r\nthan US$13bn in 2011.', NULL, '46.jpg', '46back.jpg', 1, NULL, 'issue', 'active', NULL, 565, 1264481625, 1264481420, 1, 1, 664),
('changing households', '', 1, 6, 'who do you live with?', 'In 76 countries regarded as “hotspots”, including\r\nthe United States, Brazil, Australia, and Kenya,\r\nthe number of households grew annually by 3.1%\r\nwhile the population increased just 1.8%.\r\nSource: World Futurist Society, www.wfs.org/trendmj03.htm', 'The average household is shrinking – a worldwide trend\r\nthat is fuelling an international housing boom. Housing\r\nunits throughout the world are being built at a rate that\r\noutpaces overall population growth, resulting in a loss of\r\nhabitat, natural resources, and biodiversity.\r\nThe housing boom is largely being driven by a global trend\r\ntowards smaller households. Throughout the world the\r\naverage number of people living together in a household\r\nis shrinking – primarily because of lower fertility rates,\r\nhigher divorce rates, higher per capita income, ageing\r\npopulations, and a decline in multi-generational family\r\nunits. In Western Europe and North America, postponed\r\nmarriage is increasingly being replaced or preceded by\r\ncohabitation or “living-apart-together” (LAT) relations.\r\nUnmarried cohabitation is increasing, premarital as well as\r\nafter separation, divorce, or widowhood.\r\nThe UN compiled a study of demographic data on 141\r\ncountries between 1985 and 2000. It revealed that the\r\nnumber of new housing units worldwide increased at a\r\nrate more rapid than population growth, particularly in\r\nhotspot countries. Had the average number of occupants\r\nper household remained constant, there would have been\r\n155M fewer households in hotspot countries in 2000.', NULL, '45.jpg', '45back.jpg', 1, NULL, 'issue', 'active', NULL, 566, 1264481638, 1264481433, 1, 1, 664),
('obesity', '', 1, 6, 'do you know your BMI?', 'The overweight now outnumber the malnourished.\r\nWhile 800M people in the developing world are\r\nchronically malnourished, more than 1bn people\r\nnow have a BMI (body mass index) that makes them\r\nclinically overweight, and at least 300M are obese.\r\nSource: www.who.int/topics/obesity/en/', 'The World Health Organization (WHO) estimates that the\r\nnumber of obese people globally has risen dramatically\r\nin the last 10 years, from 200M in 1995 to over 300M in\r\n2005. They estimate that there are currently 1.1bn people\r\nwho are overweight and expect this total to rise to over\r\n1.5bn by 2015. Obesity is a major contributor to the global\r\nburden of chronic disease and disability.\r\nUntil recently in the developing world obesity was\r\ngenerally associated with groups of higher economic\r\nstatus who had made a nutritional transition to a Western\r\ndiet. However, there is increasing evidence of growing\r\nlevels of obesity among those of lower economic status.\r\nCurrent obesity levels range from 5% in China, Japan\r\nand certain African nations, to over 75% in urban Samoa.\r\nEven in low prevalence countries like China, rates are\r\nalmost 20% in some cities. Obesity in developing\r\ncountries often co-exists with under-nutrition and affects\r\nalmost all ages and socio-economic groups.\r\nThe British Heart Foundation found that two-thirds of the\r\nUK population are obese or overweight and at risk of\r\nhealth problems. The group Weight Concern has said that\r\nserious illness and premature death caused by obesity\r\ncost Britain up to £7.4bn a year', NULL, '43.jpg', '43back.jpg', 1, NULL, 'issue', 'active', NULL, 567, 1264481656, 1264481451, 1, 1, 664),
('social media', '', 1, 6, 'how many communities are you in?', '44% of US Internet users have contributed their\r\nthoughts and their fi les to the online world.\r\nSource: www.pewinternet.org, February 2004', 'Social media are the online tools and platforms that\r\npeople use to share opinions, insights, experiences,\r\nand perspectives with each other. Social media can\r\ntake many different forms, including text, images,\r\naudio, and video. Popular ones include blogs,\r\nmessage boards, podcasts, wikis and vlogs.\r\nMySpace, YouTube, Facebook, Shutterfl y, Bebo\r\nand Flickr, are examples of some that have become\r\nextremely popular among younger digitally literate\r\ngenerations. MySpace is one of the top sites on\r\nthe Web. As of August 2005 it had racked up 9.4bn\r\npageviews - more than Google - and new users are\r\nsigning up at the rate of 3.5M a month. The site hosts\r\n12% of all ads on the Web, more than any other.\r\nIn 2003 the Pew Internet & American Life Project found\r\nthat more than 53M American adults had used the\r\nInternet to publish their thoughts, respond to others,\r\npost pictures, share fi les, and otherwise contribute\r\nto the explosion of content available online. 21% of\r\nInternet users say they have posted photographs to\r\nWebsites. Content creators are also more likely to be\r\nstudents—20% of all content creators are thought to\r\nbe full or part-time students.', NULL, '42.jpg', '42back.jpg', 1, NULL, 'issue', 'active', NULL, 568, 1264481666, 1264481461, 1, 1, 664),
('urban migration', '', 1, 6, 'will we have enough homes?', 'Over the next three decades the population\r\nof urban areas in less developed regions is\r\nexpected to increase and even double in size\r\nfrom 2bn to 4bn by 2030.\r\nSource: www.undp.org/mdg/goal2.shtml', 'In 1950, approximately a third of the world’s population\r\nlived in cities. By the year 2006, the proportion had\r\nincreased to half the world living in a town or city. It is\r\nprojected that by 2050, nearly two-thirds or 6bn people\r\nwill inhabit urban areas. China is seeing a great movement\r\nof population from the rural interior to cities in the east. In\r\n1950, the urban population represented less than 13% of\r\nthe total - it is now about 40% and is expected to reach\r\n60% by 2030.\r\nIt is predicted that by 2015, there will be close to 60\r\nmega-cities in the world. The most rapid growth is in the\r\neconomically weakest cities. Of the 15 largest megacities,\r\nonly four are in highly industrialised countries:\r\nTokyo, New York, Los Angeles, and Osaka-Kobe-Kyoto.\r\n70% of growth happens outside the planning process.\r\nMost of the world’s population growth is taking place in\r\nurban areas of the less developed regions where 85% of\r\nthe people live. In Sub-Saharan Africa the urban\r\npopulation is growing by more than 5% a year. Already\r\nabout 900M people are estimated to occupy informal\r\nsettlements characterised by insecure tenure, inadequate\r\nhousing, and a lack of access to water or sanitation.\r\nUN-HABITAT fi gures for 2004 show that a quarter of\r\nthe world’s urban population does not have adequate\r\nhousing.', NULL, '41.jpg', '41back.jpg', 1, NULL, 'issue', 'active', NULL, 569, 1264481684, 1264481479, 1, 1, 664),
('ADAPTABILITY', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 16, NULL, 'issue', 'active', NULL, 570, 1265010735, 1265010510, 43, 43, 664),
('Social', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 15, NULL, 'issue', 'active', NULL, 571, 1265097065, 1265096837, 44, 44, 664),
('testing environment', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 15, NULL, 'issue', 'active', NULL, 572, 1265176001, 1265175769, 45, 45, 664),
('urbanization', '', 3, 5, 'how do you quench the thirst\r\nof X billion people?', 'Currently 50% of the world’s population lives\r\nin town and cities. By 2030, this proportion is\r\nprojected to increase to 60%.\r\nSource: United Nations Environment Programme, Global\r\nenvironment outlook GEO-4: Environment for development,\r\nUNEP, 2007, www.unep.org/geo/geo4/media/', 'Urban migration intensifi es demands on available water\r\nresources. A review of the world’s developing regions\r\nreveals that Africa and Asia are the two regions suffering\r\nmost from lack of water supply and sanitation. By 2015,\r\nhalf of the population of less-developed countries will be\r\nliving in urban areas. Major concerns include overexploitation\r\nand pollution of water sources.\r\nChinese cities already face a water shortage of an\r\nestimated 6bnm³ due to water pollution, overexploitation\r\nof underground water and ineffi ciencies in\r\ntransfer and use. The over-exploitation of groundwater\r\nsources by cities can also have unexpected side effects.\r\nThe depletion of a regional aquifer for 80% of Mexico\r\nCity’s water supply has resulted in shifting of the land and,\r\nas a result, the city is now sinking. Other problems, such\r\nas lack of wastewater treatment and drainage facilities\r\ndue to poor maintenance or lack of infrastructure, can\r\nlead to pollution of ground and surface water supplies. In\r\n1997-98, an epidemic of cholera broke out in East Africa\r\ndue to drinking water contaminated by storm water\r\ncontaining human waste from informal settlements\r\nlacking minimal facilities. Children are the hardest hit\r\nby lack of sanitation. Child mortality rates in cities with\r\neffi cient sanitation and water supply are generally around\r\n10 per 1000 live births. In cities without proper provisions,\r\ninfant mortality rates are 10 to 20 times higher.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 573, 1266226193, 1266306484, 1, 1, 664),
('global trade', '', 4, 8, 'when will ‘made at home’\r\nbe obligatory?', 'The US is the largest importing\r\neconomy, accounting for\r\none-fifth of world merchandise\r\nimports, equivalent to half the\r\nglobal trade expansion in 2002.\r\nThe European Union is the\r\nworld’s leading exporter of\r\ngoods: over €973bn in 2001,\r\nalmost one-fifth of the world total.', 'In the past 20 years the global economy has become\r\nincreasingly integrated. International financial flows have\r\ngrown, people are on the move, and countries are\r\nexchanging more goods and services. A striking feature\r\nof the current global balance of payments situation is the\r\nhuge US trade deficit at $489.3 billion in 2003, 17% up\r\nfrom 2002. This is partly financed with surpluses in the\r\ncurrent and capital account of developing countries,\r\nespecially in Asia. The deficit reflects a shortage of\r\nsavings in the domestic economy and a reliance on\r\ncapital imports to finance that shortfall. Deficit with China\r\nwas US$123.9 billion and with the EU, US$94.2 billion.\r\nIn 2003, merchandise accounted for 81% of\r\nall exports of goods and commercial services.\r\nManufactured goods accounted for 77% of\r\nmerchandise exports. The trade in services\r\nis also changing whereby transport services\r\nare being replaced in importance by travel,\r\ninsurance and financial services, and computer\r\ninformation. In the 1990s high-income\r\ncountries were the main exporters of financial\r\nservices, whereas now many developing\r\ncountries are emerging as the exporters of\r\nthese new services.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 574, 1266226237, 1266306871, 1, 1, 664),
('wealth gap', '', 4, 8, 'how soon will it be before\r\nChinese and Indian\r\nincomes reach that of\r\nthe OECD countries?', 'In the last five years, urban\r\ndisposable incomes in China\r\nhave risen by an average of\r\n8.6% a year, compared to only\r\na 3.8% growth in rural areas.', 'The Human Development Index (HDI) measures\r\nthe average achievements in a country based on\r\nthree criteria:\r\n- life expectancy at birth\r\n- adult literacy rate & education enrolment\r\n- GDP per capita.\r\nThe HDI is increasing in all regions (apart from\r\nsub-Saharan Africa) but the disparity between\r\nregions continues to be high. Fig 1 shows the\r\nglobal disparities in HDI calculated on the basis\r\nof data on life expectancy from the UN (2003),\r\non adult literacy rates from UNESCO Institute of\r\nStatistics (2003), and on GDP per capita from the\r\nWorld Bank (2004).\r\nWhat of the wealth gap within OECD countries?\r\nRecent research by Roger Burrows for the Joseph\r\nRowntree Foundation, released in 2005, has pinpointed\r\nthe role of the Internet in defining neighbourhood\r\nincome levels. It is suggested that a new generation\r\nof internet information services, enabling house\r\nhunters to select their ''ideal'' neighbourhood, have\r\nthe potential to widen the divide between the\r\nrichest and poorest places in Britain and the US.\r\nThe report warns that sophisticated new Internetbased\r\nNeighbourhood Information Systems (IBNIS)\r\ncould lead to a more segregated society by not\r\nonly guiding buyers to the best schools or lowest\r\ncrime figures, but also helping them choose areas\r\nwith the kind of existing residents they would most\r\nwant as neighbours.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 575, 1266226255, 1266306866, 1, 1, 664),
('insurance', '', 4, 4, 'does your policy have\r\na climate change premium?', 'Estimated economic losses of over\r\nUS$170bn were caused by the three\r\nlarge hurricanes of 2005 (Katrina,\r\nWilma and Rita). Only around one\r\nthird of these losses were insured.\r\nSource: Swiss Re, Sigma No 2/2006: Natural\r\ncatastrophes and man-made disasters, 2005\r\nwww.swissre.com', 'Many people rely on insurance as a way of providing the\r\neconomic means to cope with extreme or unexpected\r\nweather. As such, insurance provides a reactive measure\r\nto adapt to the physical impacts of climate change.\r\nResearch by the insurance industry has found that\r\nthe frequency and severity of extreme weather events\r\nhas increased in recent years leading to an increase in\r\nclaims (Fig 1). This trend is set to continue under climate\r\nchange. Insured losses from the three major storm types\r\n(hurricanes, windstorms and typhoons) are projected to\r\nincrease by two thirds to an average of US$27bn per\r\nannum by 2080 in today’s money.\r\nThe insurance industry is highly aware of the changing\r\nnature of climate risks and it is becoming increasingly\r\ndiffi cult to get cover for certain types of weather related\r\ndamage. For risks such as fl ooding, cover may not be\r\navailable in high-risk areas or may be prohibitively costly.\r\nIn the absence of insurance cover, other measures will\r\nbe required to provide the economic means to adapt to\r\nclimate change.', NULL, '3.jpg', '3back.jpg', 1, NULL, 'issue', 'active', NULL, 576, 1266226273, 1266306851, 1, 1, 664),
('healthcare', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 577, 1266226289, 1266306828, 1, 1, 664),
('agriculture', '', 5, 7, 'where should your food be grown?', 'Shanghai is one of the world’s fastest-growing\r\ncities, yet half the 630 000ha administered by the\r\nauthorities has been set aside for urban agriculture.\r\nSource: H Girardet, Cities People Planet, 2004', 'The development of urban areas was made possible\r\nthrough the concentration of food production to create a\r\nsurplus. But many cities have now come to depend on\r\nhighly unsustainable supplies for most of their food. In\r\nLondon, the components of a typical Sunday lunch for\r\nfour people travel over 24 000 miles. This practice is in\r\nmarked contrast to that of many cities of the developing\r\nworld, which have built upon a tradition of sourcing food\r\ngrown locally.\r\nUrban agriculture – the practice of growing, raising,\r\nprocessing and distributing food in and around an\r\nurban area – contributes signifi cantly to household\r\nfood security, particularly among low-income groups.\r\nCuba has become a world leader, with food production\r\ndecentralised from large mechanised state farms to\r\nurban cultivation systems. Half of Shanghai’s pork and\r\npoultry, 60% of its vegetables and 90% of its milk and\r\neggs come from the city and its outskirts. Dar es Salaam\r\nutilises 650ha of land to produce vegetables, providing a\r\nlivelihood for 4000 urban farmers while 80% of Hanoi’s\r\ndemand for fresh vegetables comes from farms within\r\nand around the city. According to the 2007 State of the\r\nWorld report, the income of farmers living in and around\r\nBeijing has doubled in the past decade.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 578, 1266226335, 1266306818, 1, 1, 664),
('urbanization', '', 5, 5, 'how do you quench the thirst\r\nof X billion people?', 'Currently 50% of the world’s population lives\r\nin town and cities. By 2030, this proportion is\r\nprojected to increase to 60%.\r\nSource: United Nations Environment Programme, Global\r\nenvironment outlook GEO-4: Environment for development,\r\nUNEP, 2007, www.unep.org/geo/geo4/media/', 'Urban migration intensifi es demands on available water\r\nresources. A review of the world’s developing regions\r\nreveals that Africa and Asia are the two regions suffering\r\nmost from lack of water supply and sanitation. By 2015,\r\nhalf of the population of less-developed countries will be\r\nliving in urban areas. Major concerns include overexploitation\r\nand pollution of water sources.\r\nChinese cities already face a water shortage of an\r\nestimated 6bnm³ due to water pollution, overexploitation\r\nof underground water and ineffi ciencies in\r\ntransfer and use. The over-exploitation of groundwater\r\nsources by cities can also have unexpected side effects.\r\nThe depletion of a regional aquifer for 80% of Mexico\r\nCity’s water supply has resulted in shifting of the land and,\r\nas a result, the city is now sinking. Other problems, such\r\nas lack of wastewater treatment and drainage facilities\r\ndue to poor maintenance or lack of infrastructure, can\r\nlead to pollution of ground and surface water supplies. In\r\n1997-98, an epidemic of cholera broke out in East Africa\r\ndue to drinking water contaminated by storm water\r\ncontaining human waste from informal settlements\r\nlacking minimal facilities. Children are the hardest hit\r\nby lack of sanitation. Child mortality rates in cities with\r\neffi cient sanitation and water supply are generally around\r\n10 per 1000 live births. In cities without proper provisions,\r\ninfant mortality rates are 10 to 20 times higher.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 579, 1266226347, 1266306468, 1, 1, 664),
