('Peak Oil', '', 5, 2, 'can we go it alone?', 'In a review of over 200 oil\r\ncompanies in 2005, total\r\nexploration investment rose to\r\na record US$36bn. However\r\nexploration remains under\r\na magnifying glass because\r\ndiscovered volumes continue\r\nto disappoint. For the third\r\nstraight year, the industry failed\r\nto replace its oil reserves through\r\nthe drill-bit.\r\nSource: John S Herold, Inc / Harrison\r\nLovegrove & Co, Global Upstream\r\nPerformance Review, 2006\r\nwww.hargrove.co.uk/uploadedfi les/\r\nGUPRAbridged2006.pdf', 'Global consumption of conventional oil has been growing\r\nsteadily since the mid-1980s at 1.5% per year, but a\r\ngrowing group of petroleum geologists predict that\r\nsupplies of conventional oil will start to fall within a few\r\nyears. Many existing oil fi elds are going into decline and\r\nfewer new major sources of oil are being discovered.\r\nThe Swedish Government is setting a new policy target of\r\ncreating the conditions necessary to break their country’s\r\ndependence on fossil fuels by 2020. A Sweden free of\r\nfossil fuels is described as giving enormous advantages,\r\nnot least by reducing the impact from fl uctuations in oil\r\nprices. Nevertheless the spread of measures required are\r\na considerable challenge to the whole of society being\r\ndependant on a trusting collaboration between politics,\r\nindustry and research.\r\nEnergy effi ciency will need to be improved by 20%. All\r\noil for heating residential and commercial buildings will\r\nneed to be replaced by biofuels or electric heat pumps.\r\nRoad transport should reduce use of petrol and diesel by\r\n40%-50% with some replaced by biofuels from forest and\r\nenergy crops. Industry is expected to reduce its use of oil\r\nby 25-40%, part achieved by a switch to biofuels and/or\r\ndistrict heating.', NULL, '62.jpg', '62back.jpg', 23, NULL, 'issue', 'active', NULL, 597, 1266578176, 1266578176, 51, 51, 664),
('Social networks', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 598, 1266578216, 1266578216, 51, 51, 664),
('food production', '', 3, 5, 'should we all become\r\nvegetarians?', 'Providing the 2800 calories per person per day\r\nneeded for adequate nourishment requires an\r\naverage of 1000 m3 of water per year.\r\nSource: Water for People Water for Life, The United Nations World\r\nWater Development Report, Executive Summary © UNESCO 2003', 'Systematic agriculture is the main source of food for the\r\nearth’s 6bn population. Unmanaged earth systems can\r\nonly feed an estimated 500M people. While most\r\nagriculture is rain fed, irrigated land accounts for one-fi fth\r\nof the total arable area in developing countries. Currently,\r\nirrigation accounts for about 70% of all water withdrawals\r\nin the world. This amount is expected to increase by 14%\r\nin the next 30 years as the area of irrigated land expands\r\nby 20%. By 2030, 60% of all land with irrigation potential\r\nwill be in use. Climate change and increased water\r\nscarcity may lead to diffi cult choices between agriculture\r\nand other uses.\r\nIn 1998, irrigated land produced two-fi fths of all crops\r\nand three-fi fths of all cereals. Cereals are the most\r\neffective crop as they provide for 56% of calories\r\nconsumed while only requiring an equivalent 1.5m³\r\nof water to produce. Cattle, by comparison, require\r\nan equivalent 4000m³ of water per head.\r\nIn a survey conducted by the Food and Agriculture\r\nOrganization of the UN, 10 out of the 93 developing\r\ncountries are already using 40% of their renewable\r\nfreshwater for irrigation. Over-pumping of aquifers and\r\nwater pollution caused by agricultural chemicals have a\r\nnegative impact on shallow groundwater supplies, which\r\nare an important source of irrigation water.', NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 599, 1266579169, 1266579169, 52, 52, 664),
('Price of Oil', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 600, 1266922605, 1266922605, 53, 53, 664),
('How reliable is the information you get?', '', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 601, 1267198036, 1267198036, 54, 54, 664),
('New Financial Mechanisms', '', 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 602, 1267704295, 1267704295, 55, 55, 664),
('Climate Change Impacts', '', 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 603, 1267777747, 1267777747, 56, 56, 664),
('US Dollar  devaluation', '', 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, 23, NULL, 'issue', 'active', NULL, 604, 1268028077, 1268028077, 57, 57, 664),
('Supply chain', '', 2, 10, 'is your food better\r\ntravelled than you?', 'Global trade in both food and agricultural\r\nproducts more than doubled in value\r\nbetween 2000 and 2007, reaching US$913bn\r\nand US$1.1trillion respectively.\r\nSource: World Trade Organization, Merchandise Trade by\r\nProduct, 2008, pp 48, 54, www.wto.org/english/res_e/statis_\r\ne/its2008_e/its08_merch_trade_product_e.pdf', 'Global supply chains connect minimum-cost producers\r\nand processors with their target consumers. Since about\r\n75% of world food sales are processed items, food\r\nusually makes at least one stop on its way to your plate,\r\nno matter how close the plate may be to the producer.\r\nDawnfresh in Scotland ships its scampi to China to be\r\nhand-shelled before returning the product 5000 miles to\r\nbe processed and sold. Though environmentally-taxing,\r\nshipping can greatly reduce overall cost - Norwegian cod\r\ncosts US$1.36 per pound to process locally, but US$0.23\r\nper pound to process in Asia.\r\nThough processed food trade is often profitable,\r\nnon-processed goods travel much more frequently, in part\r\nbecause they face lower tariffs; 6% of processed goods\r\nare traded, but 16% of basic commodities cross borders.\r\n50% of vegetables and 95% of fruit eaten in the UK\r\ncomes from abroad, yet over half of these imports could\r\nbe sourced locally.\r\nFood represents nearly 30% of goods transported\r\non Britain’s roads. The resulting congestion costs the\r\nUK economy £5bn, and accidents, emissions, and\r\ninfrastructure wear account for another £4bn.\r\nThe £26.2bn made by agriculture and the food and drink\r\nindustry thus includes £9bn in transit subsidy, paid mostly\r\nby the taxpayer.', NULL, NULL, NULL, 31, NULL, 'issue', 'active', NULL, 607, 1284510145, 1284510145, 59, 59, 664),
