('Surveillance Society', '', 5, 8, 'did you smile?', 'You can be caught on\r\ncamera up to 300 times\r\na day in London.\r\n91% of UK broadband users\r\nin 2003 had spyware lurking\r\non their computers.', 'Traffic data collected in the UK under the\r\nvoluntary code of practice could include\r\nan individual’s geographical location\r\ndetermined through their mobile phone;\r\nthe sender and recipient information from\r\nemails; a complete log of a person’s internet\r\nsessions, including IP address; and the\r\naddress of all visited web sites. This\r\nintelligence would provide an incomplete\r\nmap of a person’s private life.\r\nA three-year study commissioned by\r\nthe British government on ‘spy’ cameras\r\nconcluded that ‘reductions were noted\r\nin certain categories, but there was no\r\nevidence to suggest that the cameras had\r\nreduced crime overall.’', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 850, 1299047666, 1299047666, 1, 1, 664),
('Personal Productivity', '', 1, 8, 'who controls your free time?\r\nyou or your TV?', 'In 2004, average television\r\nconsumption worldwide remained\r\nstable at three hours, seven minutes’\r\ndaily viewing time per person;\r\nthe average American spent four\r\nhours 28 minutes watching TV.\r\nSome Europeans spend\r\nbetween one-third\r\n(Norway, Germany and\r\nSweden) and half (Hungary\r\nand Estonia) of their free\r\ntime watching TV.', 'In the majority of countries, adults spend most\r\ntime doing gainful work from Tuesday to Thursday.\r\nThe least time is spent working on Sundays,\r\nbut in Finland and Sweden there is no notable\r\ndifference in working hours between Saturdays\r\nand Sundays. A survey undertaken by the\r\nCranfield School of Management estimated that\r\nsurreptitious use of the internet by UK office\r\nworkers is costing small businesses around\r\n£1.5bn per year. It found that 30% of the\r\ncompanies questioned were losing more than\r\na day''s work per week to this activity. 61% of\r\ncompanies lose two hours per week, and a\r\nfurther 30% lose up to 10 hours per week.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 851, 1299047696, 1299047696, 1, 1, 664),
('Corruption', '', 5, 11, 'how clean is your\r\ngovernment?', 'US$50bn of corrupt money is estimated\r\nto be deposited in Western banks and\r\ntax havens each year.\r\nSource: David Nussbaum, Chief Executive,\r\nTransparency International, 18/10/06www.lse.ac.uk/\r\ncollections/LSEPublicLecturesAndEvents/pdf/\r\n20061018_Nussbaum.pdf', 'Public corruption is defi ned as the abuse of public roles\r\nor resources for private benefi t. This includes the bribery\r\nof government offi cials to obtain business advantage\r\nand government contracts. Corruption is both a cause\r\nand a consequence of poverty. When the Corruption\r\nPerceptions Index (CPI) for countries is compared with\r\ntheir Human Development Index (HDI) rankings, a strong\r\ncorrelation emerges between corruption and development\r\n– countries with lower corruption tend to have higher\r\nHDIs. Corruption results in the diversion of spending\r\naway from the provision of essential services, therefore\r\nlimiting their quality and quantity. This forces the poor\r\nto rely on bribes and other illegal payments for these\r\nservices. A study in Mexico revealed that approximately\r\n25% of income earned by poor households went to\r\npetty corruption. The Transparency Global Corruption\r\nBarometer for 2007 showed that the poor pay more\r\nbribes than other income groups for services such as\r\nhealthcare, education and police assistance.\r\nCorruption is not only present in low-income countries.\r\nBetween 1990 and 2008, Italy’s prime minister faced\r\nvarious corruption cases, including embezzlement and\r\nfraud, but was not charged. The US Government has\r\nbeen accused of outsourcing more than half of their\r\ncontracts without an open-bid process.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 852, 1299047711, 1299047711, 1, 1, 664),
('Empowerment', '', 5, 11, 'are you in control of\r\nyour life?', 'In 2005, the International Labour\r\nOrganization (ILO) estimated that between\r\n5-6M children were forced labourers; that is\r\n40-50% of all forced labourers.\r\nSource: ILO, www.ilo.org/wcmsp5/groups/public/---\r\ndgreports/---dcomm/documents/publication/kd00012.pdf', 'Empowerment refers broadly to the expansion of\r\nfreedom of choice and action. The four key elements\r\nof empowerment are access to information, inclusion/\r\nparticipation, accountability, and local organisational\r\ncapacity. The poor are particularly voiceless in dealings\r\nwith the state and markets. It is those with the most\r\nassets, including health, education, money, land and\r\ninformation, which tend to have a greater voice in\r\ndecision-making. However, it is usually the poor who\r\nare disproportionately affected by uninformed decisions\r\nand bad policies. This is especially the case when\r\ngovernments decide to go to war. Most forced internal\r\ndisplacement in the last decade was caused by internal\r\narmed confl icts. In 2007, there were 26M Internally\r\nDisplaced Persons (IDPs) worldwide. Governments\r\nwere responsible for forced displacement in 21 out of 28\r\ncountries with new displacement.\r\nModern-day slavery is a manifestation of the lack of\r\nempowerment which comes with being poor. The\r\nInternational Labour Organization (ILO) estimates that\r\nthere are 12.3M forced labourers worldwide; researchers\r\nhave suggested that the fi gure might be closer to 27M.\r\nPrivate agents are responsible for 75% of forced labour\r\n- this includes bonded labour and forced domestic and\r\nagricultural work. Another 20% of cases of modern-day\r\nslavery are state imposed.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 853, 1299047724, 1299047724, 1, 1, 664),
('Outsourcing', '', 4, 8, 'what will we do in a global\r\nknowledge economy when we\r\nhave outsourced everything?', '829 ‘HQ operations’ of\r\nmultinationals were relocated\r\nbetween January 2002 and\r\nMarch 2003.', 'The beginning of the 21st century saw multinational\r\nbusinesses shifting the operation and control of key\r\nbusiness functions away from their head office.\r\nThis diffusion of power increased in 2004 and has\r\nbecome known as the third age in the global\r\nstrategy of multinationals. A recent United Nations\r\nConference on Trade and Development (UNCTAD)\r\nsurvey found that 829 ‘HQ operations’ of\r\nmultinationals were relocated between January 2002\r\nand March 2003, nearly a quarter of them in\r\ndeveloping countries. The number of chief executives\r\nof global companies that are of different nationalities\r\nto that of their company has also tended to rise.\r\nAccording to a study by the global market\r\nintelligence and advisory firm IDC, the Asia Pacific\r\nIT outsourcing market will have grown from\r\nUS$4.7bn in 2001 to around US$14bn by 2006.\r\nThe major types of outsourcing services provided\r\nby companies in Asia are manufacturing, business\r\nprocess services (BPO) and Information Technology\r\nservices (IT services). India is the most competitive\r\nand popular IT-outsourcing destination in the world\r\nand tops the ranking of The Global Outsourcing\r\nReport 2005. China is in second position, followed\r\nby Costa Rica and the Czech Republic,\r\nconsecutively.', NULL, NULL, NULL, 1, NULL, 'issue', 'active', NULL, 854, 1299047738, 1299047738, 1, 1, 664),
